            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000045": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>I</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000046": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000047": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>In my younger and more vulnerable years my father gave me some advice that I’ve been turning over in my mind ever since.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000048": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000049": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Whenever you feel like criticizing anyone,” he told me, “just remember that all the people in this world haven’t had the advantages that you’ve had.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000050": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000051": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He didn’t say any more, but we’ve always been unusually communicative in a reserved way, and I understood that he meant a great deal more than that. In consequence, I’m inclined to reserve all judgements, a habit that has opened up many curious natures to me and also made me the victim of not a few veteran bores. The abnormal mind is quick to detect and attach itself to this quality when it appears in a normal person, and so it came about that in college I was unjustly accused of being a politician, because I was privy to the secret griefs of wild, unknown men. Most of the confidences were unsought—frequently I have feigned sleep, preoccupation, or a hostile levity when I realized by some unmistakable sign that an intimate revelation was quivering on the horizon; for the intimate revelations of young men, or at least the terms in which they express them, are usually plagiaristic and marred by obvious suppressions. Reserving judgements is a matter of infinite hope. I am still a little afraid of missing something if I forget that, as my father snobbishly suggested, and I snobbishly repeat, a sense of the fundamental decencies is parcelled out unequally at birth.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000052": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000053": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>And, after boasting this way of my tolerance, I come to the admission that it has a limit. Conduct may be founded on the hard rock or the wet marshes, but after a certain point I don’t care what it’s founded on. When I came back from the East last autumn I felt that I wanted the world to be in uniform and at a sort of moral attention forever; I wanted no more riotous excursions with privileged glimpses into the human heart. Only Gatsby, the man who gives his name to this book, was exempt from my reaction—Gatsby, who represented everything for which I have an unaffected scorn. If personality is an unbroken series of successful gestures, then there was something gorgeous about him, some heightened sensitivity to the promises of life, as if he were related to one of those intricate machines that register earthquakes ten thousand miles away. This responsiveness had nothing to do with that flabby impressionability which is dignified under the name of the “creative temperament”—it was an extraordinary gift for hope, a romantic readiness such as I have never found in any other person and which it is not likely I shall ever find again. No—Gatsby turned out all right at the end; it is what preyed on Gatsby, what foul dust floated in the wake of his dreams that temporarily closed out my interest in the abortive sorrows and short-winded elations of men.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000054": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000055": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>My family have been prominent, well-to-do people in this Middle Western city for three generations. The Carraways are something of a clan, and we have a tradition that we’re descended from the Dukes of Buccleuch, but the actual founder of my line was my grandfather’s brother, who came here in fifty-one, sent a substitute to the Civil War, and started the wholesale hardware business that my father carries on today.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000056": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000057": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I never saw this great-uncle, but I’m supposed to look like him—with special reference to the rather hard-boiled painting that hangs in father’s office. I graduated from New Haven in 1915, just a quarter of a century after my father, and a little later I participated in that delayed Teutonic migration known as the Great War. I enjoyed the counter-raid so thoroughly that I came back restless. Instead of being the warm centre of the world, the Middle West now seemed like the ragged edge of the universe—so I decided to go East and learn the bond business. Everybody I knew was in the bond business, so I supposed it could support one more single man. All my aunts and uncles talked it over as if they were choosing a prep school for me, and finally said, “Why—ye-es,” with very grave, hesitant faces. Father agreed to finance me for a year, and after various delays I came East, permanently, I thought, in the spring of twenty-two.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000058": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000059": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The practical thing was to find rooms in the city, but it was a warm season, and I had just left a country of wide lawns and friendly trees, so when a young man at the office suggested that we take a house together in a commuting town, it sounded like a great idea. He found the house, a weather-beaten cardboard bungalow at eighty a month, but at the last minute the firm ordered him to Washington, and I went out to the country alone. I had a dog—at least I had him for a few days until he ran away—and an old Dodge and a Finnish woman, who made my bed and cooked breakfast and muttered Finnish wisdom to herself over the electric stove.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000060": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000061": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was lonely for a day or so until one morning some man, more recently arrived than I, stopped me on the road.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000062": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000063": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How do you get to West Egg village?” he asked helplessly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000064": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000065": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I told him. And as I walked on I was lonely no longer. I was a guide, a pathfinder, an original settler. He had casually conferred on me the freedom of the neighbourhood.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000066": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000067": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>And so with the sunshine and the great bursts of leaves growing on the trees, just as things grow in fast movies, I had that familiar conviction that life was beginning over again with the summer.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000068": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000069": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was so much to read, for one thing, and so much fine health to be pulled down out of the young breath-giving air. I bought a dozen volumes on banking and credit and investment securities, and they stood on my shelf in red and gold like new money from the mint, promising to unfold the shining secrets that only Midas and Morgan and Maecenas knew. And I had the high intention of reading many other books besides. I was rather literary in college—one year I wrote a series of very solemn and obvious editorials for the Yale News—and now I was going to bring back all such things into my life and become again that most limited of all specialists, the “well-rounded man.” This isn’t just an epigram—life is much more successfully looked at from a single window, after all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000070": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000071": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was a matter of chance that I should have rented a house in one of the strangest communities in North America. It was on that slender riotous island which extends itself due east of New York—and where there are, among other natural curiosities, two unusual formations of land. Twenty miles from the city a pair of enormous eggs, identical in contour and separated only by a courtesy bay, jut out into the most domesticated body of salt water in the Western hemisphere, the great wet barnyard of Long Island Sound. They are not perfect ovals—like the egg in the Columbus story, they are both crushed flat at the contact end—but their physical resemblance must be a source of perpetual wonder to the gulls that fly overhead. To the wingless a more interesting phenomenon is their dissimilarity in every particular except shape and size.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000072": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000073": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I lived at West Egg, the—well, the less fashionable of the two, though this is a most superficial tag to express the bizarre and not a little sinister contrast between them. My house was at the very tip of the egg, only fifty yards from the Sound, and squeezed between two huge places that rented for twelve or fifteen thousand a season. The one on my right was a colossal affair by any standard—it was a factual imitation of some Hôtel de Ville in Normandy, with a tower on one side, spanking new under a thin beard of raw ivy, and a marble swimming pool, and more than forty acres of lawn and garden. It was Gatsby’s mansion. Or, rather, as I didn’t know Mr. Gatsby, it was a mansion inhabited by a gentleman of that name. My own house was an eyesore, but it was a small eyesore, and it had been overlooked, so I had a view of the water, a partial view of my neighbour’s lawn, and the consoling proximity of millionaires—all for eighty dollars a month.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000074": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000075": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Across the courtesy bay the white palaces of fashionable East Egg glittered along the water, and the history of the summer really begins on the evening I drove over there to have dinner with the Tom Buchanans. Daisy was my second cousin once removed, and I’d known Tom in college. And just after the war I spent two days with them in Chicago.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000076": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000077": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her husband, among various physical accomplishments, had been one of the most powerful ends that ever played football at New Haven—a national figure in a way, one of those men who reach such an acute limited excellence at twenty-one that everything afterward savours of anticlimax. His family were enormously wealthy—even in college his freedom with money was a matter for reproach—but now he’d left Chicago and come East in a fashion that rather took your breath away: for instance, he’d brought down a string of polo ponies from Lake Forest. It was hard to realize that a man in my own generation was wealthy enough to do that.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000078": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000079": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Why they came East I don’t know. They had spent a year in France for no particular reason, and then drifted here and there unrestfully wherever people played polo and were rich together. This was a permanent move, said Daisy over the telephone, but I didn’t believe it—I had no sight into Daisy’s heart, but I felt that Tom would drift on forever seeking, a little wistfully, for the dramatic turbulence of some irrecoverable football game.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000080": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000081": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>And so it happened that on a warm windy evening I drove over to East Egg to see two old friends whom I scarcely knew at all. Their house was even more elaborate than I expected, a cheerful red-and-white Georgian Colonial mansion, overlooking the bay. The lawn started at the beach and ran towards the front door for a quarter of a mile, jumping over sundials and brick walks and burning gardens—finally when it reached the house drifting up the side in bright vines as though from the momentum of its run. The front was broken by a line of French windows, glowing now with reflected gold and wide open to the warm windy afternoon, and Tom Buchanan in riding clothes was standing with his legs apart on the front porch.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000082": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000083": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He had changed since his New Haven years. Now he was a sturdy straw-haired man of thirty, with a rather hard mouth and a supercilious manner. Two shining arrogant eyes had established dominance over his face and gave him the appearance of always leaning aggressively forward. Not even the effeminate swank of his riding clothes could hide the enormous power of that body—he seemed to fill those glistening boots until he strained the top lacing, and you could see a great pack of muscle shifting when his shoulder moved under his thin coat. It was a body capable of enormous leverage—a cruel body.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000084": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000085": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His speaking voice, a gruff husky tenor, added to the impression of fractiousness he conveyed. There was a touch of paternal contempt in it, even toward people he liked—and there were men at New Haven who had hated his guts.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000086": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000087": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Now, don’t think my opinion on these matters is final,” he seemed to say, “just because I’m stronger and more of a man than you are.” We were in the same senior society, and while we were never intimate I always had the impression that he approved of me and wanted me to like him with some harsh, defiant wistfulness of his own.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000088": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000089": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We talked for a few minutes on the sunny porch.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000090": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000091": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got a nice place here,” he said, his eyes flashing about restlessly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000092": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000093": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Turning me around by one arm, he moved a broad flat hand along the front vista, including in its sweep a sunken Italian garden, a half acre of deep, pungent roses, and a snub-nosed motorboat that bumped the tide offshore.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000094": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000095": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It belonged to Demaine, the oil man.” He turned me around again, politely and abruptly. “We’ll go inside.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000096": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000097": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We walked through a high hallway into a bright rosy-coloured space, fragilely bound into the house by French windows at either end. The windows were ajar and gleaming white against the fresh grass outside that seemed to grow a little way into the house. A breeze blew through the room, blew curtains in at one end and out the other like pale flags, twisting them up toward the frosted wedding-cake of the ceiling, and then rippled over the wine-coloured rug, making a shadow on it as wind does on the sea.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000098": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000099": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The only completely stationary object in the room was an enormous couch on which two young women were buoyed up as though upon an anchored balloon. They were both in white, and their dresses were rippling and fluttering as if they had just been blown back in after a short flight around the house. I must have stood for a few moments listening to the whip and snap of the curtains and the groan of a picture on the wall. Then there was a boom as Tom Buchanan shut the rear windows and the caught wind died out about the room, and the curtains and the rugs and the two young women ballooned slowly to the floor.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000100": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000101": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The younger of the two was a stranger to me. She was extended full length at her end of the divan, completely motionless, and with her chin raised a little, as if she were balancing something on it which was quite likely to fall. If she saw me out of the corner of her eyes she gave no hint of it—indeed, I was almost surprised into murmuring an apology for having disturbed her by coming in.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000102": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000103": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The other girl, Daisy, made an attempt to rise—she leaned slightly forward with a conscientious expression—then she laughed, an absurd, charming little laugh, and I laughed too and came forward into the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000104": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000105": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m p-paralysed with happiness.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000106": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000107": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She laughed again, as if she said something very witty, and held my hand for a moment, looking up into my face, promising that there was no one in the world she so much wanted to see. That was a way she had. She hinted in a murmur that the surname of the balancing girl was Baker. (I’ve heard it said that Daisy’s murmur was only to make people lean toward her; an irrelevant criticism that made it no less charming.)</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000108": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At any rate, Miss Baker’s lips fluttered, she nodded at me almost imperceptibly, and then quickly tipped her head back again—the object she was balancing had obviously tottered a little and given her something of a fright. Again a sort of apology arose to my lips. Almost any exhibition of complete self-sufficiency draws a stunned tribute from me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000110": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000111": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I looked back at my cousin, who began to ask me questions in her low, thrilling voice. It was the kind of voice that the ear follows up and down, as if each speech is an arrangement of notes that will never be played again. Her face was sad and lovely with bright things in it, bright eyes and a bright passionate mouth, but there was an excitement in her voice that men who had cared for her found difficult to forget: a singing compulsion, a whispered “Listen,” a promise that she had done gay, exciting things just a while since and that there were gay, exciting things hovering in the next hour.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000113": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I told her how I had stopped off in Chicago for a day on my way East, and how a dozen people had sent their love through me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000114": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000115": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do they miss me?” she cried ecstatically.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000116": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000117": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The whole town is desolate. All the cars have the left rear wheel painted black as a mourning wreath, and there’s a persistent wail all night along the north shore.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000118": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000119": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How gorgeous! Let’s go back, Tom. Tomorrow!” Then she added irrelevantly: “You ought to see the baby.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000120": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000121": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’d like to.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000122": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000123": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s asleep. She’s three years old. Haven’t you ever seen her?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000124": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000125": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Never.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000126": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000127": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, you ought to see her. She’s—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000128": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000129": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom Buchanan, who had been hovering restlessly about the room, stopped and rested his hand on my shoulder.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000130": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000131": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What you doing, Nick?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000132": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000133": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m a bond man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000134": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000135": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who with?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000136": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000137": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I told him.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000138": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000139": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Never heard of them,” he remarked decisively.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000140": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000141": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>This annoyed me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000142": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000143": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You will,” I answered shortly. “You will if you stay in the East.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000144": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000145": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, I’ll stay in the East, don’t you worry,” he said, glancing at Daisy and then back at me, as if he were alert for something more. “I’d be a God damned fool to live anywhere else.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000146": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000147": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At this point Miss Baker said: “Absolutely!” with such suddenness that I started—it was the first word she had uttered since I came into the room. Evidently it surprised her as much as it did me, for she yawned and with a series of rapid, deft movements stood up into the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000148": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000149": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m stiff,” she complained, “I’ve been lying on that sofa for as long as I can remember.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000150": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000151": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t look at me,” Daisy retorted, “I’ve been trying to get you to New York all afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000152": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000153": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, thanks,” said Miss Baker to the four cocktails just in from the pantry. “I’m absolutely in training.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000154": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000155": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her host looked at her incredulously.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000156": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000157": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You are!” He took down his drink as if it were a drop in the bottom of a glass. “How you ever get anything done is beyond me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000158": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000159": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I looked at Miss Baker, wondering what it was she “got done.” I enjoyed looking at her. She was a slender, small-breasted girl, with an erect carriage, which she accentuated by throwing her body backward at the shoulders like a young cadet. Her grey sun-strained eyes looked back at me with polite reciprocal curiosity out of a wan, charming, discontented face. It occurred to me now that I had seen her, or a picture of her, somewhere before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000160": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000161": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You live in West Egg,” she remarked contemptuously. “I know somebody there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000162": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000163": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t know a single—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000164": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000165": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You must know Gatsby.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000166": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000167": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Gatsby?” demanded Daisy. “What Gatsby?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000168": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000169": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Before I could reply that he was my neighbour dinner was announced; wedging his tense arm imperatively under mine, Tom Buchanan compelled me from the room as though he were moving a checker to another square.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000170": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000171": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Slenderly, languidly, their hands set lightly on their hips, the two young women preceded us out on to a rosy-coloured porch, open toward the sunset, where four candles flickered on the table in the diminished wind.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000172": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000173": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why <i>candles</i>?” objected Daisy, frowning. She snapped them out with her fingers. “In two weeks it’ll be the longest day in the year.” She looked at us all radiantly. “Do you always watch for the longest day of the year and then miss it? I always watch for the longest day in the year and then miss it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000174": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000175": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We ought to plan something,” yawned Miss Baker, sitting down at the table as if she were getting into bed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000176": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000177": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right,” said Daisy. “What’ll we plan?” She turned to me helplessly: “What do people plan?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000178": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000179": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Before I could answer her eyes fastened with an awed expression on her little finger.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000180": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000181": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look!” she complained; “I hurt it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000182": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000183": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We all looked—the knuckle was black and blue.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000184": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000185": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You did it, Tom,” she said accusingly. “I know you didn’t mean to, but you <i>did</i> do it. That’s what I get for marrying a brute of a man, a great, big, hulking physical specimen of a—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000186": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000187": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I hate that word ‘hulking,’ ” objected Tom crossly, “even in kidding.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000188": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000189": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hulking,” insisted Daisy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000190": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000191": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Sometimes she and Miss Baker talked at once, unobtrusively and with a bantering inconsequence that was never quite chatter, that was as cool as their white dresses and their impersonal eyes in the absence of all desire. They were here, and they accepted Tom and me, making only a polite pleasant effort to entertain or to be entertained. They knew that presently dinner would be over and a little later the evening too would be over and casually put away. It was sharply different from the West, where an evening was hurried from phase to phase towards its close, in a continually disappointed anticipation or else in sheer nervous dread of the moment itself.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000192": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000193": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You make me feel uncivilized, Daisy,” I confessed on my second glass of corky but rather impressive claret. “Can’t you talk about crops or something?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000194": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000195": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I meant nothing in particular by this remark, but it was taken up in an unexpected way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000196": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000197": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Civilization’s going to pieces,” broke out Tom violently. “I’ve gotten to be a terrible pessimist about things. Have you read <i>The Rise of the Coloured Empires</i> by this man Goddard?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000198": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000199": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why, no,” I answered, rather surprised by his tone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000200": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000201": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, it’s a fine book, and everybody ought to read it. The idea is if we don’t look out the white race will be—will be utterly submerged. It’s all scientific stuff; it’s been proved.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000202": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000203": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Tom’s getting very profound,” said Daisy, with an expression of unthoughtful sadness. “He reads deep books with long words in them. What was that word we—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000204": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000205": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, these books are all scientific,” insisted Tom, glancing at her impatiently. “This fellow has worked out the whole thing. It’s up to us, who are the dominant race, to watch out or these other races will have control of things.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000206": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000207": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ve got to beat them down,” whispered Daisy, winking ferociously toward the fervent sun.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000208": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000209": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You ought to live in California—” began Miss Baker, but Tom interrupted her by shifting heavily in his chair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000210": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000211": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This idea is that we’re Nordics. I am, and you are, and you are, and—” After an infinitesimal hesitation he included Daisy with a slight nod, and she winked at me again. “—And we’ve produced all the things that go to make civilization—oh, science and art, and all that. Do you see?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000212": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000213": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was something pathetic in his concentration, as if his complacency, more acute than of old, was not enough to him any more. When, almost immediately, the telephone rang inside and the butler left the porch Daisy seized upon the momentary interruption and leaned towards me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000214": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000215": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll tell you a family secret,” she whispered enthusiastically. “It’s about the butler’s nose. Do you want to hear about the butler’s nose?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000216": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000217": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s why I came over tonight.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000218": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000219": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, he wasn’t always a butler; he used to be the silver polisher for some people in New York that had a silver service for two hundred people. He had to polish it from morning till night, until finally it began to affect his nose—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000220": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000221": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Things went from bad to worse,” suggested Miss Baker.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000222": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000223": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes. Things went from bad to worse, until finally he had to give up his position.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000224": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000225": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For a moment the last sunshine fell with romantic affection upon her glowing face; her voice compelled me forward breathlessly as I listened—then the glow faded, each light deserting her with lingering regret, like children leaving a pleasant street at dusk.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000226": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000227": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The butler came back and murmured something close to Tom’s ear, whereupon Tom frowned, pushed back his chair, and without a word went inside. As if his absence quickened something within her, Daisy leaned forward again, her voice glowing and singing.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000228": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000229": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I love to see you at my table, Nick. You remind me of a—of a rose, an absolute rose. Doesn’t he?” She turned to Miss Baker for confirmation: “An absolute rose?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000230": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000231": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>This was untrue. I am not even faintly like a rose. She was only extemporizing, but a stirring warmth flowed from her, as if her heart was trying to come out to you concealed in one of those breathless, thrilling words. Then suddenly she threw her napkin on the table and excused herself and went into the house.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000232": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000233": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Miss Baker and I exchanged a short glance consciously devoid of meaning. I was about to speak when she sat up alertly and said “<i>Sh!</i>” in a warning voice. A subdued impassioned murmur was audible in the room beyond, and Miss Baker leaned forward unashamed, trying to hear. The murmur trembled on the verge of coherence, sank down, mounted excitedly, and then ceased altogether.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000234": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000235": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This Mr. Gatsby you spoke of is my neighbour—” I began.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000236": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000237": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t talk. I want to hear what happens.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000238": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000239": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is something happening?” I inquired innocently.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000240": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000241": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You mean to say you don’t know?” said Miss Baker, honestly surprised. “I thought everybody knew.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000242": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000243": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000244": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000245": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why—” she said hesitantly. “Tom’s got some woman in New York.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000246": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000247": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Got some woman?” I repeated blankly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000248": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000249": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Miss Baker nodded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000250": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000251": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She might have the decency not to telephone him at dinner time. Don’t you think?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000252": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000253": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Almost before I had grasped her meaning there was the flutter of a dress and the crunch of leather boots, and Tom and Daisy were back at the table.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000254": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000255": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It couldn’t be helped!” cried Daisy with tense gaiety.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000256": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000257": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She sat down, glanced searchingly at Miss Baker and then at me, and continued: “I looked outdoors for a minute, and it’s very romantic outdoors. There’s a bird on the lawn that I think must be a nightingale come over on the Cunard or White Star Line. He’s singing away—” Her voice sang: “It’s romantic, isn’t it, Tom?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000258": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000259": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Very romantic,” he said, and then miserably to me: “If it’s light enough after dinner, I want to take you down to the stables.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000260": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000261": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The telephone rang inside, startlingly, and as Daisy shook her head decisively at Tom the subject of the stables, in fact all subjects, vanished into air. Among the broken fragments of the last five minutes at table I remember the candles being lit again, pointlessly, and I was conscious of wanting to look squarely at everyone, and yet to avoid all eyes. I couldn’t guess what Daisy and Tom were thinking, but I doubt if even Miss Baker, who seemed to have mastered a certain hardy scepticism, was able utterly to put this fifth guest’s shrill metallic urgency out of mind. To a certain temperament the situation might have seemed intriguing—my own instinct was to telephone immediately for the police.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000262": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000263": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The horses, needless to say, were not mentioned again. Tom and Miss Baker, with several feet of twilight between them, strolled back into the library, as if to a vigil beside a perfectly tangible body, while, trying to look pleasantly interested and a little deaf, I followed Daisy around a chain of connecting verandas to the porch in front. In its deep gloom we sat down side by side on a wicker settee.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000264": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000265": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy took her face in her hands as if feeling its lovely shape, and her eyes moved gradually out into the velvet dusk. I saw that turbulent emotions possessed her, so I asked what I thought would be some sedative questions about her little girl.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000266": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000267": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We don’t know each other very well, Nick,” she said suddenly. “Even if we are cousins. You didn’t come to my wedding.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000268": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000269": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I wasn’t back from the war.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000270": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000271": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s true.” She hesitated. “Well, I’ve had a very bad time, Nick, and I’m pretty cynical about everything.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000272": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000273": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Evidently she had reason to be. I waited but she didn’t say any more, and after a moment I returned rather feebly to the subject of her daughter.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000274": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000275": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I suppose she talks, and—eats, and everything.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000276": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000277": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, yes.” She looked at me absently. “Listen, Nick; let me tell you what I said when she was born. Would you like to hear?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000278": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000279": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Very much.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000280": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000281": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’ll show you how I’ve gotten to feel about—things. Well, she was less than an hour old and Tom was God knows where. I woke up out of the ether with an utterly abandoned feeling, and asked the nurse right away if it was a boy or a girl. She told me it was a girl, and so I turned my head away and wept. ‘All right,’ I said, ‘I’m glad it’s a girl. And I hope she’ll be a fool—that’s the best thing a girl can be in this world, a beautiful little fool.’</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000282": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000283": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You see I think everything’s terrible anyhow,” she went on in a convinced way. “Everybody thinks so—the most advanced people. And I <i>know</i>. I’ve been everywhere and seen everything and done everything.” Her eyes flashed around her in a defiant way, rather like Tom’s, and she laughed with thrilling scorn. “Sophisticated—God, I’m sophisticated!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000284": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000285": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The instant her voice broke off, ceasing to compel my attention, my belief, I felt the basic insincerity of what she had said. It made me uneasy, as though the whole evening had been a trick of some sort to exact a contributory emotion from me. I waited, and sure enough, in a moment she looked at me with an absolute smirk on her lovely face, as if she had asserted her membership in a rather distinguished secret society to which she and Tom belonged.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000286": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000287": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Inside, the crimson room bloomed with light. Tom and Miss Baker sat at either end of the long couch and she read aloud to him from the <i>Saturday Evening Post</i>—the words, murmurous and uninflected, running together in a soothing tune. The lamplight, bright on his boots and dull on the autumn-leaf yellow of her hair, glinted along the paper as she turned a page with a flutter of slender muscles in her arms.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000288": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000289": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When we came in she held us silent for a moment with a lifted hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000290": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000291": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“To be continued,” she said, tossing the magazine on the table, “in our very next issue.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000292": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000293": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her body asserted itself with a restless movement of her knee, and she stood up.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000294": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000295": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Ten o’clock,” she remarked, apparently finding the time on the ceiling. “Time for this good girl to go to bed.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000296": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000297": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Jordan’s going to play in the tournament tomorrow,” explained Daisy, “over at Westchester.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000298": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000299": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh—you’re <i>Jor</i>dan Baker.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000300": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000301": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I knew now why her face was familiar—its pleasing contemptuous expression had looked out at me from many rotogravure pictures of the sporting life at Asheville and Hot Springs and Palm Beach. I had heard some story of her too, a critical, unpleasant story, but what it was I had forgotten long ago.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000302": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000303": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Good night,” she said softly. “Wake me at eight, won’t you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000304": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000305": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“If you’ll get up.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000306": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000307": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I will. Good night, Mr. Carraway. See you anon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000308": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000309": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course you will,” confirmed Daisy. “In fact I think I’ll arrange a marriage. Come over often, Nick, and I’ll sort of—oh—fling you together. You know—lock you up accidentally in linen closets and push you out to sea in a boat, and all that sort of thing—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000310": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000311": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Good night,” called Miss Baker from the stairs. “I haven’t heard a word.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000312": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000313": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s a nice girl,” said Tom after a moment. “They oughtn’t to let her run around the country this way.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000314": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000315": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who oughtn’t to?” inquired Daisy coldly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000316": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000317": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Her family.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000318": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000319": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Her family is one aunt about a thousand years old. Besides, Nick’s going to look after her, aren’t you, Nick? She’s going to spend lots of weekends out here this summer. I think the home influence will be very good for her.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000320": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000321": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy and Tom looked at each other for a moment in silence.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000322": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000323": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is she from New York?” I asked quickly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000324": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000325": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“From Louisville. Our white girlhood was passed together there. Our beautiful white—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000326": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000327": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you give Nick a little heart to heart talk on the veranda?” demanded Tom suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000328": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000329": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did I?” She looked at me. “I can’t seem to remember, but I think we talked about the Nordic race. Yes, I’m sure we did. It sort of crept up on us and first thing you know—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000330": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000331": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t believe everything you hear, Nick,” he advised me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000332": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000333": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I said lightly that I had heard nothing at all, and a few minutes later I got up to go home. They came to the door with me and stood side by side in a cheerful square of light. As I started my motor Daisy peremptorily called: “Wait!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000334": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000335": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I forgot to ask you something, and it’s important. We heard you were engaged to a girl out West.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000336": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000337": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s right,” corroborated Tom kindly. “We heard that you were engaged.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000338": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000339": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s a libel. I’m too poor.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000340": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000341": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But we heard it,” insisted Daisy, surprising me by opening up again in a flower-like way. “We heard it from three people, so it must be true.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000342": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000343": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Of course I knew what they were referring to, but I wasn’t even vaguely engaged. The fact that gossip had published the banns was one of the reasons I had come East. You can’t stop going with an old friend on account of rumours, and on the other hand I had no intention of being rumoured into marriage.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000344": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000345": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Their interest rather touched me and made them less remotely rich—nevertheless, I was confused and a little disgusted as I drove away. It seemed to me that the thing for Daisy to do was to rush out of the house, child in arms—but apparently there were no such intentions in her head. As for Tom, the fact that he “had some woman in New York” was really less surprising than that he had been depressed by a book. Something was making him nibble at the edge of stale ideas as if his sturdy physical egotism no longer nourished his peremptory heart.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000346": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000347": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Already it was deep summer on roadhouse roofs and in front of wayside garages, where new red petrol-pumps sat out in pools of light, and when I reached my estate at West Egg I ran the car under its shed and sat for a while on an abandoned grass roller in the yard. The wind had blown off, leaving a loud, bright night, with wings beating in the trees and a persistent organ sound as the full bellows of the earth blew the frogs full of life. The silhouette of a moving cat wavered across the moonlight, and, turning my head to watch it, I saw that I was not alone—fifty feet away a figure had emerged from the shadow of my neighbour’s mansion and was standing with his hands in his pockets regarding the silver pepper of the stars. Something in his leisurely movements and the secure position of his feet upon the lawn suggested that it was Mr. Gatsby himself, come out to determine what share was his of our local heavens.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000348": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000349": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I decided to call to him. Miss Baker had mentioned him at dinner, and that would do for an introduction. But I didn’t call to him, for he gave a sudden intimation that he was content to be alone—he stretched out his arms toward the dark water in a curious way, and, far as I was from him, I could have sworn he was trembling. Involuntarily I glanced seaward—and distinguished nothing except a single green light, minute and far away, that might have been the end of a dock. When I looked once more for Gatsby he had vanished, and I was alone again in the unquiet darkness.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000350": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000351": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000352": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>II</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000353": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000354": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>About halfway between West Egg and New York the motor road hastily joins the railroad and runs beside it for a quarter of a mile, so as to shrink away from a certain desolate area of land. This is a valley of ashes—a fantastic farm where ashes grow like wheat into ridges and hills and grotesque gardens; where ashes take the forms of houses and chimneys and rising smoke and, finally, with a transcendent effort, of ash-grey men, who move dimly and already crumbling through the powdery air. Occasionally a line of grey cars crawls along an invisible track, gives out a ghastly creak, and comes to rest, and immediately the ash-grey men swarm up with leaden spades and stir up an impenetrable cloud, which screens their obscure operations from your sight.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000355": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000356": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But above the grey land and the spasms of bleak dust which drift endlessly over it, you perceive, after a moment, the eyes of Doctor T. J. Eckleburg. The eyes of Doctor T. J. Eckleburg are blue and gigantic—their retinas are one yard high. They look out of no face, but, instead, from a pair of enormous yellow spectacles which pass over a nonexistent nose. Evidently some wild wag of an oculist set them there to fatten his practice in the borough of Queens, and then sank down himself into eternal blindness, or forgot them and moved away. But his eyes, dimmed a little by many paintless days, under sun and rain, brood on over the solemn dumping ground.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000357": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000358": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The valley of ashes is bounded on one side by a small foul river, and, when the drawbridge is up to let barges through, the passengers on waiting trains can stare at the dismal scene for as long as half an hour. There is always a halt there of at least a minute, and it was because of this that I first met Tom Buchanan’s mistress.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000359": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000360": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The fact that he had one was insisted upon wherever he was known. His acquaintances resented the fact that he turned up in popular cafés with her and, leaving her at a table, sauntered about, chatting with whomsoever he knew. Though I was curious to see her, I had no desire to meet her—but I did. I went up to New York with Tom on the train one afternoon, and when we stopped by the ash-heaps he jumped to his feet and, taking hold of my elbow, literally forced me from the car.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000361": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000362": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’re getting off,” he insisted. “I want you to meet my girl.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000363": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000364": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I think he’d tanked up a good deal at luncheon, and his determination to have my company bordered on violence. The supercilious assumption was that on Sunday afternoon I had nothing better to do.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000365": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000366": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I followed him over a low whitewashed railroad fence, and we walked back a hundred yards along the road under Doctor Eckleburg’s persistent stare. The only building in sight was a small block of yellow brick sitting on the edge of the waste land, a sort of compact Main Street ministering to it, and contiguous to absolutely nothing. One of the three shops it contained was for rent and another was an all-night restaurant, approached by a trail of ashes; the third was a garage—<i>Repairs.</i> <b>George B. Wilson.</b> <i>Cars bought and sold.</i>—and I followed Tom inside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000367": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000368": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The interior was unprosperous and bare; the only car visible was the dust-covered wreck of a Ford which crouched in a dim corner. It had occurred to me that this shadow of a garage must be a blind, and that sumptuous and romantic apartments were concealed overhead, when the proprietor himself appeared in the door of an office, wiping his hands on a piece of waste. He was a blond, spiritless man, anaemic, and faintly handsome. When he saw us a damp gleam of hope sprang into his light blue eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000369": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000370": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hello, Wilson, old man,” said Tom, slapping him jovially on the shoulder. “How’s business?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000371": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000372": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I can’t complain,” answered Wilson unconvincingly. “When are you going to sell me that car?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000373": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000374": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Next week; I’ve got my man working on it now.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000375": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000376": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Works pretty slow, don’t he?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000377": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000378": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, he doesn’t,” said Tom coldly. “And if you feel that way about it, maybe I’d better sell it somewhere else after all.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000379": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000380": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t mean that,” explained Wilson quickly. “I just meant—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000381": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000382": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His voice faded off and Tom glanced impatiently around the garage. Then I heard footsteps on a stairs, and in a moment the thickish figure of a woman blocked out the light from the office door. She was in the middle thirties, and faintly stout, but she carried her flesh sensuously as some women can. Her face, above a spotted dress of dark blue crêpe-de-chine, contained no facet or gleam of beauty, but there was an immediately perceptible vitality about her as if the nerves of her body were continually smouldering. She smiled slowly and, walking through her husband as if he were a ghost, shook hands with Tom, looking him flush in the eye. Then she wet her lips, and without turning around spoke to her husband in a soft, coarse voice:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000383": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000384": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Get some chairs, why don’t you, so somebody can sit down.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000385": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000386": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, sure,” agreed Wilson hurriedly, and went toward the little office, mingling immediately with the cement colour of the walls. A white ashen dust veiled his dark suit and his pale hair as it veiled everything in the vicinity—except his wife, who moved close to Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000387": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000388": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want to see you,” said Tom intently. “Get on the next train.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000389": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000390": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000391": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000392": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll meet you by the newsstand on the lower level.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000393": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000394": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She nodded and moved away from him just as George Wilson emerged with two chairs from his office door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000395": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000396": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We waited for her down the road and out of sight. It was a few days before the Fourth of July, and a grey, scrawny Italian child was setting torpedoes in a row along the railroad track.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000397": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000398": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Terrible place, isn’t it,” said Tom, exchanging a frown with Doctor Eckleburg.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000399": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000400": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Awful.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000401": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000402": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It does her good to get away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000403": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000404": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Doesn’t her husband object?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000405": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000406": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wilson? He thinks she goes to see her sister in New York. He’s so dumb he doesn’t know he’s alive.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000407": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000408": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>So Tom Buchanan and his girl and I went up together to New York—or not quite together, for Mrs. Wilson sat discreetly in another car. Tom deferred that much to the sensibilities of those East Eggers who might be on the train.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000409": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000410": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She had changed her dress to a brown figured muslin, which stretched tight over her rather wide hips as Tom helped her to the platform in New York. At the newsstand she bought a copy of <i>Town Tattle</i> and a moving-picture magazine, and in the station drugstore some cold cream and a small flask of perfume. Upstairs, in the solemn echoing drive she let four taxicabs drive away before she selected a new one, lavender-coloured with grey upholstery, and in this we slid out from the mass of the station into the glowing sunshine. But immediately she turned sharply from the window and, leaning forward, tapped on the front glass.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000411": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000412": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want to get one of those dogs,” she said earnestly. “I want to get one for the apartment. They’re nice to have—a dog.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000413": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000414": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We backed up to a grey old man who bore an absurd resemblance to John D. Rockefeller. In a basket swung from his neck cowered a dozen very recent puppies of an indeterminate breed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000415": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000416": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What kind are they?” asked Mrs. Wilson eagerly, as he came to the taxi-window.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000417": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000418": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All kinds. What kind do you want, lady?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000419": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000420": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’d like to get one of those police dogs; I don’t suppose you got that kind?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000421": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000422": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The man peered doubtfully into the basket, plunged in his hand and drew one up, wriggling, by the back of the neck.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000423": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000424": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s no police dog,” said Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000425": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000426": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, it’s not exactly a police dog,” said the man with disappointment in his voice. “It’s more of an Airedale.” He passed his hand over the brown washrag of a back. “Look at that coat. Some coat. That’s a dog that’ll never bother you with catching cold.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000427": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000428": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I think it’s cute,” said Mrs. Wilson enthusiastically. “How much is it?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000429": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000430": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That dog?” He looked at it admiringly. “That dog will cost you ten dollars.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000431": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000432": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The Airedale—undoubtedly there was an Airedale concerned in it somewhere, though its feet were startlingly white—changed hands and settled down into Mrs. Wilson’s lap, where she fondled the weatherproof coat with rapture.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000433": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000434": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is it a boy or a girl?” she asked delicately.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000435": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000436": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That dog? That dog’s a boy.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000437": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000438": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s a bitch,” said Tom decisively. “Here’s your money. Go and buy ten more dogs with it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000439": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000440": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We drove over to Fifth Avenue, warm and soft, almost pastoral, on the summer Sunday afternoon. I wouldn’t have been surprised to see a great flock of white sheep turn the corner.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000441": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000442": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hold on,” I said, “I have to leave you here.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000443": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000444": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No you don’t,” interposed Tom quickly. “Myrtle’ll be hurt if you don’t come up to the apartment. Won’t you, Myrtle?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000445": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000446": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come on,” she urged. “I’ll telephone my sister Catherine. She’s said to be very beautiful by people who ought to know.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000447": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000448": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I’d like to, but—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000449": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000450": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We went on, cutting back again over the Park toward the West Hundreds. At 158th Street the cab stopped at one slice in a long white cake of apartment-houses. Throwing a regal homecoming glance around the neighbourhood, Mrs. Wilson gathered up her dog and her other purchases, and went haughtily in.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000451": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000452": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m going to have the McKees come up,” she announced as we rose in the elevator. “And, of course, I got to call up my sister, too.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000453": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000454": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The apartment was on the top floor—a small living-room, a small dining-room, a small bedroom, and a bath. The living-room was crowded to the doors with a set of tapestried furniture entirely too large for it, so that to move about was to stumble continually over scenes of ladies swinging in the gardens of Versailles. The only picture was an over-enlarged photograph, apparently a hen sitting on a blurred rock. Looked at from a distance, however, the hen resolved itself into a bonnet, and the countenance of a stout old lady beamed down into the room. Several old copies of <i>Town Tattle</i> lay on the table together with a copy of <i>Simon Called Peter</i>, and some of the small scandal magazines of Broadway. Mrs. Wilson was first concerned with the dog. A reluctant elevator boy went for a box full of straw and some milk, to which he added on his own initiative a tin of large, hard dog biscuits—one of which decomposed apathetically in the saucer of milk all afternoon. Meanwhile Tom brought out a bottle of whisky from a locked bureau door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000455": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000456": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I have been drunk just twice in my life, and the second time was that afternoon; so everything that happened has a dim, hazy cast over it, although until after eight o’clock the apartment was full of cheerful sun. Sitting on Tom’s lap Mrs. Wilson called up several people on the telephone; then there were no cigarettes, and I went out to buy some at the drugstore on the corner. When I came back they had both disappeared, so I sat down discreetly in the living-room and read a chapter of <i>Simon Called Peter</i>—either it was terrible stuff or the whisky distorted things, because it didn’t make any sense to me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000457": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000458": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Just as Tom and Myrtle (after the first drink Mrs. Wilson and I called each other by our first names) reappeared, company commenced to arrive at the apartment door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000459": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000460": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The sister, Catherine, was a slender, worldly girl of about thirty, with a solid, sticky bob of red hair, and a complexion powdered milky white. Her eyebrows had been plucked and then drawn on again at a more rakish angle, but the efforts of nature toward the restoration of the old alignment gave a blurred air to her face. When she moved about there was an incessant clicking as innumerable pottery bracelets jingled up and down upon her arms. She came in with such a proprietary haste, and looked around so possessively at the furniture that I wondered if she lived here. But when I asked her she laughed immoderately, repeated my question aloud, and told me she lived with a girl friend at a hotel.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000461": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000462": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Mr. McKee was a pale, feminine man from the flat below. He had just shaved, for there was a white spot of lather on his cheekbone, and he was most respectful in his greeting to everyone in the room. He informed me that he was in the “artistic game,” and I gathered later that he was a photographer and had made the dim enlargement of Mrs. Wilson’s mother which hovered like an ectoplasm on the wall. His wife was shrill, languid, handsome, and horrible. She told me with pride that her husband had photographed her a hundred and twenty-seven times since they had been married.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000463": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000464": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Mrs. Wilson had changed her costume some time before, and was now attired in an elaborate afternoon dress of cream-coloured chiffon, which gave out a continual rustle as she swept about the room. With the influence of the dress her personality had also undergone a change. The intense vitality that had been so remarkable in the garage was converted into impressive hauteur. Her laughter, her gestures, her assertions became more violently affected moment by moment, and as she expanded the room grew smaller around her, until she seemed to be revolving on a noisy, creaking pivot through the smoky air.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000465": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000466": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“My dear,” she told her sister in a high, mincing shout, “most of these fellas will cheat you every time. All they think of is money. I had a woman up here last week to look at my feet, and when she gave me the bill you’d of thought she had my appendicitis out.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000467": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000468": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What was the name of the woman?” asked Mrs. McKee.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000469": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000470": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Mrs. Eberhardt. She goes around looking at people’s feet in their own homes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000471": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000472": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I like your dress,” remarked Mrs. McKee, “I think it’s adorable.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000473": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000474": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Mrs. Wilson rejected the compliment by raising her eyebrow in disdain.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000475": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000476": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s just a crazy old thing,” she said. “I just slip it on sometimes when I don’t care what I look like.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000477": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000478": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But it looks wonderful on you, if you know what I mean,” pursued Mrs. McKee. “If Chester could only get you in that pose I think he could make something of it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000479": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000480": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We all looked in silence at Mrs. Wilson, who removed a strand of hair from over her eyes and looked back at us with a brilliant smile. Mr. McKee regarded her intently with his head on one side, and then moved his hand back and forth slowly in front of his face.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000481": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000482": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I should change the light,” he said after a moment. “I’d like to bring out the modelling of the features. And I’d try to get hold of all the back hair.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000483": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000484": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I wouldn’t think of changing the light,” cried Mrs. McKee. “I think it’s—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000485": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000486": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her husband said “<i>Sh!</i>” and we all looked at the subject again, whereupon Tom Buchanan yawned audibly and got to his feet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000487": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000488": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You McKees have something to drink,” he said. “Get some more ice and mineral water, Myrtle, before everybody goes to sleep.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000489": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000490": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I told that boy about the ice.” Myrtle raised her eyebrows in despair at the shiftlessness of the lower orders. “These people! You have to keep after them all the time.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000491": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000492": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She looked at me and laughed pointlessly. Then she flounced over to the dog, kissed it with ecstasy, and swept into the kitchen, implying that a dozen chefs awaited her orders there.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000493": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000494": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve done some nice things out on Long Island,” asserted Mr. McKee.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000495": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000496": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom looked at him blankly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000497": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000498": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Two of them we have framed downstairs.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000499": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000500": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Two what?” demanded Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000501": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000502": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Two studies. One of them I call <i>Montauk Point—The Gulls</i>, and the other I call <i>Montauk Point—The Sea</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000503": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000504": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The sister Catherine sat down beside me on the couch.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000505": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000506": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do you live down on Long Island, too?” she inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000507": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000508": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I live at West Egg.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000509": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000510": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Really? I was down there at a party about a month ago. At a man named Gatsby’s. Do you know him?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000511": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000512": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I live next door to him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000513": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000514": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, they say he’s a nephew or a cousin of Kaiser Wilhelm’s. That’s where all his money comes from.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000515": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000516": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Really?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000517": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000518": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She nodded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000519": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000520": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m scared of him. I’d hate to have him get anything on me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000521": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000522": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>This absorbing information about my neighbour was interrupted by Mrs. McKee’s pointing suddenly at Catherine:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000523": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000524": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Chester, I think you could do something with <i>her</i>,” she broke out, but Mr. McKee only nodded in a bored way, and turned his attention to Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000525": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000526": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’d like to do more work on Long Island, if I could get the entry. All I ask is that they should give me a start.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000527": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000528": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Ask Myrtle,” said Tom, breaking into a short shout of laughter as Mrs. Wilson entered with a tray. “She’ll give you a letter of introduction, won’t you, Myrtle?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000529": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000530": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do what?” she asked, startled.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000531": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000532": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’ll give McKee a letter of introduction to your husband, so he can do some studies of him.” His lips moved silently for a moment as he invented, “ ‘George B. Wilson at the Gasoline Pump,’ or something like that.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000533": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000534": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Catherine leaned close to me and whispered in my ear:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000535": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000536": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Neither of them can stand the person they’re married to.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000537": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000538": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Can’t they?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000539": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000540": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Can’t <i>stand</i> them.” She looked at Myrtle and then at Tom. “What I say is, why go on living with them if they can’t stand them? If I was them I’d get a divorce and get married to each other right away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000541": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000542": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Doesn’t she like Wilson either?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000543": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000544": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The answer to this was unexpected. It came from Myrtle, who had overheard the question, and it was violent and obscene.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000545": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000546": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You see,” cried Catherine triumphantly. She lowered her voice again. “It’s really his wife that’s keeping them apart. She’s a Catholic, and they don’t believe in divorce.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000547": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000548": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy was not a Catholic, and I was a little shocked at the elaborateness of the lie.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000549": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000550": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“When they do get married,” continued Catherine, “they’re going West to live for a while until it blows over.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000551": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000552": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’d be more discreet to go to Europe.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000553": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000554": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, do you like Europe?” she exclaimed surprisingly. “I just got back from Monte Carlo.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000555": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000556": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Really.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000557": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000558": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Just last year. I went over there with another girl.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000559": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000560": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Stay long?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000561": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000562": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, we just went to Monte Carlo and back. We went by way of Marseilles. We had over twelve hundred dollars when we started, but we got gyped out of it all in two days in the private rooms. We had an awful time getting back, I can tell you. God, how I hated that town!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000563": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000564": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The late afternoon sky bloomed in the window for a moment like the blue honey of the Mediterranean—then the shrill voice of Mrs. McKee called me back into the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000565": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000566": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I almost made a mistake, too,” she declared vigorously. “I almost married a little kike who’d been after me for years. I knew he was below me. Everybody kept saying to me: ‘Lucille, that man’s way below you!’ But if I hadn’t met Chester, he’d of got me sure.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000567": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000568": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes, but listen,” said Myrtle Wilson, nodding her head up and down, “at least you didn’t marry him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000569": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000570": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I know I didn’t.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000571": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000572": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I married him,” said Myrtle, ambiguously. “And that’s the difference between your case and mine.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000573": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000574": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why did you, Myrtle?” demanded Catherine. “Nobody forced you to.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000575": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000576": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Myrtle considered.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000577": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000578": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I married him because I thought he was a gentleman,” she said finally. “I thought he knew something about breeding, but he wasn’t fit to lick my shoe.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000579": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000580": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You were crazy about him for a while,” said Catherine.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000581": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000582": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Crazy about him!” cried Myrtle incredulously. “Who said I was crazy about him? I never was any more crazy about him than I was about that man there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000583": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000584": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She pointed suddenly at me, and everyone looked at me accusingly. I tried to show by my expression that I expected no affection.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000585": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000586": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The only <i>crazy</i> I was was when I married him. I knew right away I made a mistake. He borrowed somebody’s best suit to get married in, and never even told me about it, and the man came after it one day when he was out: ‘Oh, is that your suit?’ I said. ‘This is the first I ever heard about it.’ But I gave it to him and then I lay down and cried to beat the band all afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000587": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000588": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She really ought to get away from him,” resumed Catherine to me. “They’ve been living over that garage for eleven years. And Tom’s the first sweetie she ever had.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000589": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000590": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The bottle of whisky—a second one—was now in constant demand by all present, excepting Catherine, who “felt just as good on nothing at all.” Tom rang for the janitor and sent him for some celebrated sandwiches, which were a complete supper in themselves. I wanted to get out and walk eastward toward the park through the soft twilight, but each time I tried to go I became entangled in some wild, strident argument which pulled me back, as if with ropes, into my chair. Yet high over the city our line of yellow windows must have contributed their share of human secrecy to the casual watcher in the darkening streets, and I saw him too, looking up and wondering. I was within and without, simultaneously enchanted and repelled by the inexhaustible variety of life.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000591": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000592": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Myrtle pulled her chair close to mine, and suddenly her warm breath poured over me the story of her first meeting with Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000593": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000594": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was on the two little seats facing each other that are always the last ones left on the train. I was going up to New York to see my sister and spend the night. He had on a dress suit and patent leather shoes, and I couldn’t keep my eyes off him, but every time he looked at me I had to pretend to be looking at the advertisement over his head. When we came into the station he was next to me, and his white shirtfront pressed against my arm, and so I told him I’d have to call a policeman, but he knew I lied. I was so excited that when I got into a taxi with him I didn’t hardly know I wasn’t getting into a subway train. All I kept thinking about, over and over, was ‘You can’t live forever; you can’t live forever.’ ”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000595": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000596": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She turned to Mrs. McKee and the room rang full of her artificial laughter.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000597": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000598": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“My dear,” she cried, “I’m going to give you this dress as soon as I’m through with it. I’ve got to get another one tomorrow. I’m going to make a list of all the things I’ve got to get. A massage and a wave, and a collar for the dog, and one of those cute little ashtrays where you touch a spring, and a wreath with a black silk bow for mother’s grave that’ll last all summer. I got to write down a list so I won’t forget all the things I got to do.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000599": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000600": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was nine o’clock—almost immediately afterward I looked at my watch and found it was ten. Mr. McKee was asleep on a chair with his fists clenched in his lap, like a photograph of a man of action. Taking out my handkerchief I wiped from his cheek the spot of dried lather that had worried me all the afternoon.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000601": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000602": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The little dog was sitting on the table looking with blind eyes through the smoke, and from time to time groaning faintly. People disappeared, reappeared, made plans to go somewhere, and then lost each other, searched for each other, found each other a few feet away. Some time toward midnight Tom Buchanan and Mrs. Wilson stood face to face discussing, in impassioned voices, whether Mrs. Wilson had any right to mention Daisy’s name.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000603": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000604": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Daisy! Daisy! Daisy!” shouted Mrs. Wilson. “I’ll say it whenever I want to! Daisy! Dai—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000605": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000606": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Making a short deft movement, Tom Buchanan broke her nose with his open hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000607": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000608": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Then there were bloody towels upon the bathroom floor, and women’s voices scolding, and high over the confusion a long broken wail of pain. Mr. McKee awoke from his doze and started in a daze toward the door. When he had gone halfway he turned around and stared at the scene—his wife and Catherine scolding and consoling as they stumbled here and there among the crowded furniture with articles of aid, and the despairing figure on the couch, bleeding fluently, and trying to spread a copy of <i>Town Tattle</i> over the tapestry scenes of Versailles. Then Mr. McKee turned and continued on out the door. Taking my hat from the chandelier, I followed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000609": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000610": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come to lunch some day,” he suggested, as we groaned down in the elevator.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000611": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000612": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000613": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000614": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Anywhere.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000615": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000616": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Keep your hands off the lever,” snapped the elevator boy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000617": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000618": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I beg your pardon,” said Mr. McKee with dignity, “I didn’t know I was touching it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000619": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000620": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right,” I agreed, “I’ll be glad to.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000621": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000622": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>… I was standing beside his bed and he was sitting up between the sheets, clad in his underwear, with a great portfolio in his hands.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000623": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000624": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Beauty and the Beast… Loneliness… Old Grocery Horse… Brook’n Bridge…”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000625": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000626": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Then I was lying half asleep in the cold lower level of the Pennsylvania Station, staring at the morning <i>Tribune</i>, and waiting for the four o’clock train.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000627": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000628": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000629": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>III</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000630": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000631": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was music from my neighbour’s house through the summer nights. In his blue gardens men and girls came and went like moths among the whisperings and the champagne and the stars. At high tide in the afternoon I watched his guests diving from the tower of his raft, or taking the sun on the hot sand of his beach while his two motorboats slit the waters of the Sound, drawing aquaplanes over cataracts of foam. On weekends his Rolls-Royce became an omnibus, bearing parties to and from the city between nine in the morning and long past midnight, while his station wagon scampered like a brisk yellow bug to meet all trains. And on Mondays eight servants, including an extra gardener, toiled all day with mops and scrubbing-brushes and hammers and garden-shears, repairing the ravages of the night before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000632": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000633": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Every Friday five crates of oranges and lemons arrived from a fruiterer in New York—every Monday these same oranges and lemons left his back door in a pyramid of pulpless halves. There was a machine in the kitchen which could extract the juice of two hundred oranges in half an hour if a little button was pressed two hundred times by a butler’s thumb.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000634": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000635": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At least once a fortnight a corps of caterers came down with several hundred feet of canvas and enough coloured lights to make a Christmas tree of Gatsby’s enormous garden. On buffet tables, garnished with glistening hors-d’oeuvre, spiced baked hams crowded against salads of harlequin designs and pastry pigs and turkeys bewitched to a dark gold. In the main hall a bar with a real brass rail was set up, and stocked with gins and liquors and with cordials so long forgotten that most of his female guests were too young to know one from another.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000636": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000637": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>By seven o’clock the orchestra has arrived, no thin five-piece affair, but a whole pitful of oboes and trombones and saxophones and viols and cornets and piccolos, and low and high drums. The last swimmers have come in from the beach now and are dressing upstairs; the cars from New York are parked five deep in the drive, and already the halls and salons and verandas are gaudy with primary colours, and hair bobbed in strange new ways, and shawls beyond the dreams of Castile. The bar is in full swing, and floating rounds of cocktails permeate the garden outside, until the air is alive with chatter and laughter, and casual innuendo and introductions forgotten on the spot, and enthusiastic meetings between women who never knew each other’s names.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000638": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000639": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The lights grow brighter as the earth lurches away from the sun, and now the orchestra is playing yellow cocktail music, and the opera of voices pitches a key higher. Laughter is easier minute by minute, spilled with prodigality, tipped out at a cheerful word. The groups change more swiftly, swell with new arrivals, dissolve and form in the same breath; already there are wanderers, confident girls who weave here and there among the stouter and more stable, become for a sharp, joyous moment the centre of a group, and then, excited with triumph, glide on through the sea-change of faces and voices and colour under the constantly changing light.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000640": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000641": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Suddenly one of these gypsies, in trembling opal, seizes a cocktail out of the air, dumps it down for courage and, moving her hands like Frisco, dances out alone on the canvas platform. A momentary hush; the orchestra leader varies his rhythm obligingly for her, and there is a burst of chatter as the erroneous news goes around that she is Gilda Gray’s understudy from the Follies. The party has begun.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000642": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000643": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I believe that on the first night I went to Gatsby’s house I was one of the few guests who had actually been invited. People were not invited—they went there. They got into automobiles which bore them out to Long Island, and somehow they ended up at Gatsby’s door. Once there they were introduced by somebody who knew Gatsby, and after that they conducted themselves according to the rules of behaviour associated with an amusement park. Sometimes they came and went without having met Gatsby at all, came for the party with a simplicity of heart that was its own ticket of admission.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000644": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000645": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I had been actually invited. A chauffeur in a uniform of robin’s-egg blue crossed my lawn early that Saturday morning with a surprisingly formal note from his employer: the honour would be entirely Gatsby’s, it said, if I would attend his “little party” that night. He had seen me several times, and had intended to call on me long before, but a peculiar combination of circumstances had prevented it—signed Jay Gatsby, in a majestic hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000646": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000647": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Dressed up in white flannels I went over to his lawn a little after seven, and wandered around rather ill at ease among swirls and eddies of people I didn’t know—though here and there was a face I had noticed on the commuting train. I was immediately struck by the number of young Englishmen dotted about; all well dressed, all looking a little hungry, and all talking in low, earnest voices to solid and prosperous Americans. I was sure that they were selling something: bonds or insurance or automobiles. They were at least agonizingly aware of the easy money in the vicinity and convinced that it was theirs for a few words in the right key.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000648": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000648",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000649": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000649",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As soon as I arrived I made an attempt to find my host, but the two or three people of whom I asked his whereabouts stared at me in such an amazed way, and denied so vehemently any knowledge of his movements, that I slunk off in the direction of the cocktail table—the only place in the garden where a single man could linger without looking purposeless and alone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000650": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000650",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000651": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000651",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was on my way to get roaring drunk from sheer embarrassment when Jordan Baker came out of the house and stood at the head of the marble steps, leaning a little backward and looking with contemptuous interest down into the garden.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000652": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000652",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000653": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000653",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Welcome or not, I found it necessary to attach myself to someone before I should begin to address cordial remarks to the passersby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000654": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000654",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000655": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000655",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hello!” I roared, advancing toward her. My voice seemed unnaturally loud across the garden.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000656": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000656",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000657": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000657",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I thought you might be here,” she responded absently as I came up. “I remembered you lived next door to—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000658": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000658",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000659": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000659",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She held my hand impersonally, as a promise that she’d take care of me in a minute, and gave ear to two girls in twin yellow dresses, who stopped at the foot of the steps.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000660": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000660",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000661": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000661",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hello!” they cried together. “Sorry you didn’t win.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000662": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000662",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000663": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000663",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That was for the golf tournament. She had lost in the finals the week before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000664": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000664",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000665": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000665",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You don’t know who we are,” said one of the girls in yellow, “but we met you here about a month ago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000666": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000666",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000667": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000667",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’ve dyed your hair since then,” remarked Jordan, and I started, but the girls had moved casually on and her remark was addressed to the premature moon, produced like the supper, no doubt, out of a caterer’s basket. With Jordan’s slender golden arm resting in mine, we descended the steps and sauntered about the garden. A tray of cocktails floated at us through the twilight, and we sat down at a table with the two girls in yellow and three men, each one introduced to us as Mr. Mumble.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000668": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000668",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000669": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000669",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do you come to these parties often?” inquired Jordan of the girl beside her.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000670": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000670",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000671": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000671",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The last one was the one I met you at,” answered the girl, in an alert confident voice. She turned to her companion: “Wasn’t it for you, Lucille?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000672": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000672",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000673": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000673",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was for Lucille, too.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000674": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000674",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000675": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000675",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I like to come,” Lucille said. “I never care what I do, so I always have a good time. When I was here last I tore my gown on a chair, and he asked me my name and address—inside of a week I got a package from Croirier’s with a new evening gown in it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000676": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000676",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000677": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000677",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you keep it?” asked Jordan.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000678": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000678",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000679": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000679",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Sure I did. I was going to wear it tonight, but it was too big in the bust and had to be altered. It was gas blue with lavender beads. Two hundred and sixty-five dollars.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000680": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000680",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000681": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000681",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There’s something funny about a fellow that’ll do a thing like that,” said the other girl eagerly. “He doesn’t want any trouble with <i>any</i>body.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000682": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000682",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000683": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000683",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who doesn’t?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000684": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000684",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000685": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000685",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Gatsby. Somebody told me—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000686": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000686",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000687": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000687",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The two girls and Jordan leaned together confidentially.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000688": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000688",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000689": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000689",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Somebody told me they thought he killed a man once.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000690": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000690",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000691": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000691",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A thrill passed over all of us. The three Mr. Mumbles bent forward and listened eagerly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000692": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000692",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000693": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000693",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t think it’s so much <i>that</i>,” argued Lucille sceptically; “It’s more that he was a German spy during the war.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000694": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000694",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000695": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000695",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>One of the men nodded in confirmation.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000696": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000696",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000697": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000697",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I heard that from a man who knew all about him, grew up with him in Germany,” he assured us positively.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000698": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000698",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000699": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000699",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, no,” said the first girl, “it couldn’t be that, because he was in the American army during the war.” As our credulity switched back to her she leaned forward with enthusiasm. “You look at him sometimes when he thinks nobody’s looking at him. I’ll bet he killed a man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000700": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000700",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000701": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000701",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She narrowed her eyes and shivered. Lucille shivered. We all turned and looked around for Gatsby. It was testimony to the romantic speculation he inspired that there were whispers about him from those who had found little that it was necessary to whisper about in this world.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000702": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000702",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000703": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000703",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The first supper—there would be another one after midnight—was now being served, and Jordan invited me to join her own party, who were spread around a table on the other side of the garden. There were three married couples and Jordan’s escort, a persistent undergraduate given to violent innuendo, and obviously under the impression that sooner or later Jordan was going to yield him up her person to a greater or lesser degree. Instead of rambling, this party had preserved a dignified homogeneity, and assumed to itself the function of representing the staid nobility of the countryside—East Egg condescending to West Egg and carefully on guard against its spectroscopic gaiety.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000704": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000704",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000705": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000705",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Let’s get out,” whispered Jordan, after a somehow wasteful and inappropriate half-hour; “this is much too polite for me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000706": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000706",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000707": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000707",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We got up, and she explained that we were going to find the host: I had never met him, she said, and it was making me uneasy. The undergraduate nodded in a cynical, melancholy way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000708": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000708",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000709": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000709",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The bar, where we glanced first, was crowded, but Gatsby was not there. She couldn’t find him from the top of the steps, and he wasn’t on the veranda. On a chance we tried an important-looking door, and walked into a high Gothic library, panelled with carved English oak, and probably transported complete from some ruin overseas.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000710": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000710",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000711": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000711",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A stout, middle-aged man, with enormous owl-eyed spectacles, was sitting somewhat drunk on the edge of a great table, staring with unsteady concentration at the shelves of books. As we entered he wheeled excitedly around and examined Jordan from head to foot.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000712": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000712",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000713": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000713",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What do you think?” he demanded impetuously.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000714": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000714",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000715": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000715",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“About what?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000716": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000716",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000717": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000717",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He waved his hand toward the bookshelves.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000718": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000718",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000719": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000719",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“About that. As a matter of fact you needn’t bother to ascertain. I ascertained. They’re real.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000720": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000720",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000721": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000721",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The books?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000722": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000722",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000723": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000723",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He nodded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000724": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000724",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000725": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000725",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Absolutely real—have pages and everything. I thought they’d be a nice durable cardboard. Matter of fact, they’re absolutely real. Pages and—Here! Lemme show you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000726": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000726",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000727": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000727",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Taking our scepticism for granted, he rushed to the bookcases and returned with Volume One of the <i>Stoddard Lectures</i>.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000728": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000728",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000729": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000729",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“See!” he cried triumphantly. “It’s a bona-fide piece of printed matter. It fooled me. This fella’s a regular Belasco. It’s a triumph. What thoroughness! What realism! Knew when to stop, too—didn’t cut the pages. But what do you want? What do you expect?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000730": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000730",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000731": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000731",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He snatched the book from me and replaced it hastily on its shelf, muttering that if one brick was removed the whole library was liable to collapse.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000732": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000732",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000733": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000733",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who brought you?” he demanded. “Or did you just come? I was brought. Most people were brought.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000734": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000734",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000735": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000735",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Jordan looked at him alertly, cheerfully, without answering.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000736": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000736",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000737": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000737",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I was brought by a woman named Roosevelt,” he continued. “Mrs. Claud Roosevelt. Do you know her? I met her somewhere last night. I’ve been drunk for about a week now, and I thought it might sober me up to sit in a library.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000738": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000738",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000739": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000739",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Has it?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000740": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000740",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000741": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000741",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“A little bit, I think. I can’t tell yet. I’ve only been here an hour. Did I tell you about the books? They’re real. They’re—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000742": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000742",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000743": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000743",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You told us.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000744": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000744",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000745": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000745",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We shook hands with him gravely and went back outdoors.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000746": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000746",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000747": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000747",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was dancing now on the canvas in the garden; old men pushing young girls backward in eternal graceless circles, superior couples holding each other tortuously, fashionably, and keeping in the corners—and a great number of single girls dancing individually or relieving the orchestra for a moment of the burden of the banjo or the traps. By midnight the hilarity had increased. A celebrated tenor had sung in Italian, and a notorious contralto had sung in jazz, and between the numbers people were doing “stunts” all over the garden, while happy, vacuous bursts of laughter rose toward the summer sky. A pair of stage twins, who turned out to be the girls in yellow, did a baby act in costume, and champagne was served in glasses bigger than finger-bowls. The moon had risen higher, and floating in the Sound was a triangle of silver scales, trembling a little to the stiff, tinny drip of the banjoes on the lawn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000748": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000748",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000749": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000749",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was still with Jordan Baker. We were sitting at a table with a man of about my age and a rowdy little girl, who gave way upon the slightest provocation to uncontrollable laughter. I was enjoying myself now. I had taken two finger-bowls of champagne, and the scene had changed before my eyes into something significant, elemental, and profound.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000750": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000750",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000751": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000751",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At a lull in the entertainment the man looked at me and smiled.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000752": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000752",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000753": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000753",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Your face is familiar,” he said politely. “Weren’t you in the First Division during the war?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000754": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000754",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000755": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000755",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why yes. I was in the Twenty-eighth Infantry.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000756": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000756",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000757": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000757",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I was in the Sixteenth until June nineteen-eighteen. I knew I’d seen you somewhere before.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000758": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000758",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000759": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000759",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We talked for a moment about some wet, grey little villages in France. Evidently he lived in this vicinity, for he told me that he had just bought a hydroplane, and was going to try it out in the morning.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000760": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000760",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000761": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000761",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Want to go with me, old sport? Just near the shore along the Sound.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000762": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000762",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000763": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000763",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What time?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000764": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000764",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000765": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000765",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Any time that suits you best.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000766": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000766",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000767": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000767",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was on the tip of my tongue to ask his name when Jordan looked around and smiled.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000768": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000768",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000769": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000769",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Having a gay time now?” she inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000770": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000770",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000771": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000771",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Much better.” I turned again to my new acquaintance. “This is an unusual party for me. I haven’t even seen the host. I live over there—” I waved my hand at the invisible hedge in the distance, “and this man Gatsby sent over his chauffeur with an invitation.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000772": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000772",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000773": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000773",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For a moment he looked at me as if he failed to understand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000774": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000774",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000775": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000775",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m Gatsby,” he said suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000776": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000776",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000777": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000777",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What!” I exclaimed. “Oh, I beg your pardon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000778": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000778",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000779": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000779",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I thought you knew, old sport. I’m afraid I’m not a very good host.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000780": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000780",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000781": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000781",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He smiled understandingly—much more than understandingly. It was one of those rare smiles with a quality of eternal reassurance in it, that you may come across four or five times in life. It faced—or seemed to face—the whole eternal world for an instant, and then concentrated on <i>you</i> with an irresistible prejudice in your favour. It understood you just so far as you wanted to be understood, believed in you as you would like to believe in yourself, and assured you that it had precisely the impression of you that, at your best, you hoped to convey. Precisely at that point it vanished—and I was looking at an elegant young roughneck, a year or two over thirty, whose elaborate formality of speech just missed being absurd. Some time before he introduced himself I’d got a strong impression that he was picking his words with care.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000782": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000782",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000783": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000783",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Almost at the moment when Mr. Gatsby identified himself a butler hurried toward him with the information that Chicago was calling him on the wire. He excused himself with a small bow that included each of us in turn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000784": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000784",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000785": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000785",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“If you want anything just ask for it, old sport,” he urged me. “Excuse me. I will rejoin you later.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000786": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000786",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000787": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000787",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When he was gone I turned immediately to Jordan—constrained to assure her of my surprise. I had expected that Mr. Gatsby would be a florid and corpulent person in his middle years.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000788": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000788",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000789": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000789",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who is he?” I demanded. “Do you know?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000790": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000790",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000791": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000791",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He’s just a man named Gatsby.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000792": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000792",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000793": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000793",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where is he from, I mean? And what does he do?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000794": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000794",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000795": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000795",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Now <i>you</i>’re started on the subject,” she answered with a wan smile. “Well, he told me once he was an Oxford man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000796": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000796",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000797": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000797",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A dim background started to take shape behind him, but at her next remark it faded away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000798": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000798",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000799": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000799",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“However, I don’t believe it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000800": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000800",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000801": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000801",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why not?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000802": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000802",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000803": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000803",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t know,” she insisted, “I just don’t think he went there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000804": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000804",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000805": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000805",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Something in her tone reminded me of the other girl’s “I think he killed a man,” and had the effect of stimulating my curiosity. I would have accepted without question the information that Gatsby sprang from the swamps of Louisiana or from the lower East Side of New York. That was comprehensible. But young men didn’t—at least in my provincial inexperience I believed they didn’t—drift coolly out of nowhere and buy a palace on Long Island Sound.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000806": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000806",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000807": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000807",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Anyhow, he gives large parties,” said Jordan, changing the subject with an urban distaste for the concrete. “And I like large parties. They’re so intimate. At small parties there isn’t any privacy.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000808": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000808",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000809": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000809",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was the boom of a bass drum, and the voice of the orchestra leader rang out suddenly above the echolalia of the garden.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000810": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000810",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000811": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000811",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Ladies and gentlemen,” he cried. “At the request of Mr. Gatsby we are going to play for you Mr. Vladmir Tostoff’s latest work, which attracted so much attention at Carnegie Hall last May. If you read the papers you know there was a big sensation.” He smiled with jovial condescension, and added: “Some sensation!” Whereupon everybody laughed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000812": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000812",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000813": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000813",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The piece is known,” he concluded lustily, “as ‘Vladmir Tostoff’s Jazz History of the World!’ ”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000814": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000814",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000815": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000815",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The nature of Mr. Tostoff’s composition eluded me, because just as it began my eyes fell on Gatsby, standing alone on the marble steps and looking from one group to another with approving eyes. His tanned skin was drawn attractively tight on his face and his short hair looked as though it were trimmed every day. I could see nothing sinister about him. I wondered if the fact that he was not drinking helped to set him off from his guests, for it seemed to me that he grew more correct as the fraternal hilarity increased. When the “Jazz History of the World” was over, girls were putting their heads on men’s shoulders in a puppyish, convivial way, girls were swooning backward playfully into men’s arms, even into groups, knowing that someone would arrest their falls—but no one swooned backward on Gatsby, and no French bob touched Gatsby’s shoulder, and no singing quartets were formed with Gatsby’s head for one link.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000816": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000816",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000817": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000817",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I beg your pardon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000818": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000818",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000819": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000819",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby’s butler was suddenly standing beside us.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000820": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000820",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000821": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000821",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Miss Baker?” he inquired. “I beg your pardon, but Mr. Gatsby would like to speak to you alone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000822": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000822",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000823": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000823",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“With me?” she exclaimed in surprise.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000824": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000824",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000825": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000825",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes, madame.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000826": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000826",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000827": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000827",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She got up slowly, raising her eyebrows at me in astonishment, and followed the butler toward the house. I noticed that she wore her evening-dress, all her dresses, like sports clothes—there was a jauntiness about her movements as if she had first learned to walk upon golf courses on clean, crisp mornings.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000828": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000828",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000829": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000829",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was alone and it was almost two. For some time confused and intriguing sounds had issued from a long, many-windowed room which overhung the terrace. Eluding Jordan’s undergraduate, who was now engaged in an obstetrical conversation with two chorus girls, and who implored me to join him, I went inside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000830": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000830",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000831": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000831",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The large room was full of people. One of the girls in yellow was playing the piano, and beside her stood a tall, red-haired young lady from a famous chorus, engaged in song. She had drunk a quantity of champagne, and during the course of her song she had decided, ineptly, that everything was very, very sad—she was not only singing, she was weeping too. Whenever there was a pause in the song she filled it with gasping, broken sobs, and then took up the lyric again in a quavering soprano. The tears coursed down her cheeks—not freely, however, for when they came into contact with her heavily beaded eyelashes they assumed an inky colour, and pursued the rest of their way in slow black rivulets. A humorous suggestion was made that she sing the notes on her face, whereupon she threw up her hands, sank into a chair, and went off into a deep vinous sleep.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000832": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000832",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000833": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000833",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She had a fight with a man who says he’s her husband,” explained a girl at my elbow.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000834": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000834",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000835": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000835",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I looked around. Most of the remaining women were now having fights with men said to be their husbands. Even Jordan’s party, the quartet from East Egg, were rent asunder by dissension. One of the men was talking with curious intensity to a young actress, and his wife, after attempting to laugh at the situation in a dignified and indifferent way, broke down entirely and resorted to flank attacks—at intervals she appeared suddenly at his side like an angry diamond, and hissed: “You promised!” into his ear.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000836": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000836",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000837": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000837",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The reluctance to go home was not confined to wayward men. The hall was at present occupied by two deplorably sober men and their highly indignant wives. The wives were sympathizing with each other in slightly raised voices.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000838": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000838",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000839": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000839",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Whenever he sees I’m having a good time he wants to go home.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000840": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000840",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000841": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000841",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Never heard anything so selfish in my life.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000842": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000842",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000843": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000843",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’re always the first ones to leave.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000844": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000844",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000845": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000845",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“So are we.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000846": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000846",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000847": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000847",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, we’re almost the last tonight,” said one of the men sheepishly. “The orchestra left half an hour ago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000848": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000848",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000849": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000849",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>In spite of the wives’ agreement that such malevolence was beyond credibility, the dispute ended in a short struggle, and both wives were lifted, kicking, into the night.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000850": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000850",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000851": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000851",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As I waited for my hat in the hall the door of the library opened and Jordan Baker and Gatsby came out together. He was saying some last word to her, but the eagerness in his manner tightened abruptly into formality as several people approached him to say goodbye.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000852": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000852",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000853": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000853",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Jordan’s party were calling impatiently to her from the porch, but she lingered for a moment to shake hands.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000854": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000854",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000855": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000855",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve just heard the most amazing thing,” she whispered. “How long were we in there?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000856": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000856",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000857": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000857",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why, about an hour.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000858": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000858",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000859": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000859",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was… simply amazing,” she repeated abstractedly. “But I swore I wouldn’t tell it and here I am tantalizing you.” She yawned gracefully in my face. “Please come and see me… Phone book… Under the name of Mrs. Sigourney Howard… My aunt…” She was hurrying off as she talked—her brown hand waved a jaunty salute as she melted into her party at the door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000860": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000860",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000861": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000861",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Rather ashamed that on my first appearance I had stayed so late, I joined the last of Gatsby’s guests, who were clustered around him. I wanted to explain that I’d hunted for him early in the evening and to apologize for not having known him in the garden.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000862": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000862",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000863": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000863",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t mention it,” he enjoined me eagerly. “Don’t give it another thought, old sport.” The familiar expression held no more familiarity than the hand which reassuringly brushed my shoulder. “And don’t forget we’re going up in the hydroplane tomorrow morning, at nine o’clock.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000864": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000864",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000865": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000865",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Then the butler, behind his shoulder:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000866": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000866",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000867": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000867",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Philadelphia wants you on the phone, sir.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000868": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000868",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000869": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000869",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right, in a minute. Tell them I’ll be right there… Good night.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000870": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000870",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000871": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000871",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Good night.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000872": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000872",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000873": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000873",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Good night.” He smiled—and suddenly there seemed to be a pleasant significance in having been among the last to go, as if he had desired it all the time. “Good night, old sport… Good night.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000874": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000874",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000875": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000875",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But as I walked down the steps I saw that the evening was not quite over. Fifty feet from the door a dozen headlights illuminated a bizarre and tumultuous scene. In the ditch beside the road, right side up, but violently shorn of one wheel, rested a new coupé which had left Gatsby’s drive not two minutes before. The sharp jut of a wall accounted for the detachment of the wheel, which was now getting considerable attention from half a dozen curious chauffeurs. However, as they had left their cars blocking the road, a harsh, discordant din from those in the rear had been audible for some time, and added to the already violent confusion of the scene.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000876": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000876",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000877": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000877",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A man in a long duster had dismounted from the wreck and now stood in the middle of the road, looking from the car to the tyre and from the tyre to the observers in a pleasant, puzzled way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000878": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000878",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000879": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000879",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“See!” he explained. “It went in the ditch.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000880": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000880",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000881": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000881",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The fact was infinitely astonishing to him, and I recognized first the unusual quality of wonder, and then the man—it was the late patron of Gatsby’s library.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000882": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000882",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000883": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000883",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How’d it happen?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000884": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000884",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000885": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000885",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He shrugged his shoulders.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000886": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000886",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000887": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000887",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I know nothing whatever about mechanics,” he said decisively.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000888": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000888",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000889": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000889",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But how did it happen? Did you run into the wall?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000890": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000890",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000891": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000891",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t ask me,” said Owl Eyes, washing his hands of the whole matter. “I know very little about driving—next to nothing. It happened, and that’s all I know.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000892": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000892",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000893": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000893",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, if you’re a poor driver you oughtn’t to try driving at night.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000894": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000894",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000895": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000895",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But I wasn’t even trying,” he explained indignantly, “I wasn’t even trying.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000896": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000896",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000897": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000897",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>An awed hush fell upon the bystanders.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000898": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000898",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000899": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000899",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do you want to commit suicide?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000900": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000900",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000901": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000901",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re lucky it was just a wheel! A bad driver and not even <i>try</i>ing!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000902": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000902",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000903": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000903",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You don’t understand,” explained the criminal. “I wasn’t driving. There’s another man in the car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000904": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000904",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000905": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000905",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The shock that followed this declaration found voice in a sustained “Ah-h-h!” as the door of the coupé swung slowly open. The crowd—it was now a crowd—stepped back involuntarily, and when the door had opened wide there was a ghostly pause. Then, very gradually, part by part, a pale, dangling individual stepped out of the wreck, pawing tentatively at the ground with a large uncertain dancing shoe.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000906": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000906",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000907": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000907",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Blinded by the glare of the headlights and confused by the incessant groaning of the horns, the apparition stood swaying for a moment before he perceived the man in the duster.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000908": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000908",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000909": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000909",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wha’s matter?” he inquired calmly. “Did we run outa gas?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000910": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000910",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000911": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000911",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000912": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000912",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000913": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000913",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Half a dozen fingers pointed at the amputated wheel—he stared at it for a moment, and then looked upward as though he suspected that it had dropped from the sky.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000914": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000914",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000915": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000915",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It came off,” someone explained.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000916": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000916",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000917": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000917",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He nodded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000918": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000918",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000919": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000919",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“At first I din’ notice we’d stopped.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000920": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000920",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000921": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000921",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A pause. Then, taking a long breath and straightening his shoulders, he remarked in a determined voice:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000922": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000922",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000923": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000923",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wonder’ff tell me where there’s a gas’line station?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000924": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000924",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000925": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000925",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At least a dozen men, some of them a little better off than he was, explained to him that wheel and car were no longer joined by any physical bond.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000926": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000926",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000927": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000927",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Back out,” he suggested after a moment. “Put her in reverse.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000928": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000928",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000929": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000929",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But the <i>wheel</i>’s off!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000930": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000930",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000931": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000931",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He hesitated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000932": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000932",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000933": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000933",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No harm in trying,” he said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000934": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000934",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000935": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000935",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The caterwauling horns had reached a crescendo and I turned away and cut across the lawn toward home. I glanced back once. A wafer of a moon was shining over Gatsby’s house, making the night fine as before, and surviving the laughter and the sound of his still glowing garden. A sudden emptiness seemed to flow now from the windows and the great doors, endowing with complete isolation the figure of the host, who stood on the porch, his hand up in a formal gesture of farewell.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000936": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000936",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000937": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000937",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Reading over what I have written so far, I see I have given the impression that the events of three nights several weeks apart were all that absorbed me. On the contrary, they were merely casual events in a crowded summer, and, until much later, they absorbed me infinitely less than my personal affairs.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000938": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000938",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000939": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000939",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Most of the time I worked. In the early morning the sun threw my shadow westward as I hurried down the white chasms of lower New York to the Probity Trust. I knew the other clerks and young bond-salesmen by their first names, and lunched with them in dark, crowded restaurants on little pig sausages and mashed potatoes and coffee. I even had a short affair with a girl who lived in Jersey City and worked in the accounting department, but her brother began throwing mean looks in my direction, so when she went on her vacation in July I let it blow quietly away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000940": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000940",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000941": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000941",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I took dinner usually at the Yale Club—for some reason it was the gloomiest event of my day—and then I went upstairs to the library and studied investments and securities for a conscientious hour. There were generally a few rioters around, but they never came into the library, so it was a good place to work. After that, if the night was mellow, I strolled down Madison Avenue past the old Murray Hill Hotel, and over 33rd Street to the Pennsylvania Station.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000942": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000942",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000943": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000943",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I began to like New York, the racy, adventurous feel of it at night, and the satisfaction that the constant flicker of men and women and machines gives to the restless eye. I liked to walk up Fifth Avenue and pick out romantic women from the crowd and imagine that in a few minutes I was going to enter into their lives, and no one would ever know or disapprove. Sometimes, in my mind, I followed them to their apartments on the corners of hidden streets, and they turned and smiled back at me before they faded through a door into warm darkness. At the enchanted metropolitan twilight I felt a haunting loneliness sometimes, and felt it in others—poor young clerks who loitered in front of windows waiting until it was time for a solitary restaurant dinner—young clerks in the dusk, wasting the most poignant moments of night and life.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000944": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000944",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000945": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000945",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Again at eight o’clock, when the dark lanes of the Forties were lined five deep with throbbing taxicabs, bound for the theatre district, I felt a sinking in my heart. Forms leaned together in the taxis as they waited, and voices sang, and there was laughter from unheard jokes, and lighted cigarettes made unintelligible circles inside. Imagining that I, too, was hurrying towards gaiety and sharing their intimate excitement, I wished them well.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000946": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000946",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000947": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000947",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For a while I lost sight of Jordan Baker, and then in midsummer I found her again. At first I was flattered to go places with her, because she was a golf champion, and everyone knew her name. Then it was something more. I wasn’t actually in love, but I felt a sort of tender curiosity. The bored haughty face that she turned to the world concealed something—most affectations conceal something eventually, even though they don’t in the beginning—and one day I found what it was. When we were on a house-party together up in Warwick, she left a borrowed car out in the rain with the top down, and then lied about it—and suddenly I remembered the story about her that had eluded me that night at Daisy’s. At her first big golf tournament there was a row that nearly reached the newspapers—a suggestion that she had moved her ball from a bad lie in the semifinal round. The thing approached the proportions of a scandal—then died away. A caddy retracted his statement, and the only other witness admitted that he might have been mistaken. The incident and the name had remained together in my mind.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000948": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000948",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000949": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000949",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Jordan Baker instinctively avoided clever, shrewd men, and now I saw that this was because she felt safer on a plane where any divergence from a code would be thought impossible. She was incurably dishonest. She wasn’t able to endure being at a disadvantage and, given this unwillingness, I suppose she had begun dealing in subterfuges when she was very young in order to keep that cool, insolent smile turned to the world and yet satisfy the demands of her hard, jaunty body.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000950": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000950",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000951": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000951",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It made no difference to me. Dishonesty in a woman is a thing you never blame deeply—I was casually sorry, and then I forgot. It was on that same house-party that we had a curious conversation about driving a car. It started because she passed so close to some workmen that our fender flicked a button on one man’s coat.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000952": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000952",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000953": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000953",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re a rotten driver,” I protested. “Either you ought to be more careful, or you oughtn’t to drive at all.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000954": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000954",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000955": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000955",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I am careful.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000956": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000956",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000957": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000957",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, you’re not.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000958": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000958",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000959": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000959",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, other people are,” she said lightly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000960": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000960",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000961": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000961",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s that got to do with it?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000962": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000962",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000963": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000963",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They’ll keep out of my way,” she insisted. “It takes two to make an accident.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000964": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000964",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000965": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000965",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Suppose you met somebody just as careless as yourself.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000966": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000966",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000967": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000967",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I hope I never will,” she answered. “I hate careless people. That’s why I like you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000968": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000968",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000969": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000969",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her grey, sun-strained eyes stared straight ahead, but she had deliberately shifted our relations, and for a moment I thought I loved her. But I am slow-thinking and full of interior rules that act as brakes on my desires, and I knew that first I had to get myself definitely out of that tangle back home. I’d been writing letters once a week and signing them: “Love, Nick,” and all I could think of was how, when that certain girl played tennis, a faint moustache of perspiration appeared on her upper lip. Nevertheless there was a vague understanding that had to be tactfully broken off before I was free.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000970": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000970",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000971": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000971",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Everyone suspects himself of at least one of the cardinal virtues, and this is mine: I am one of the few honest people that I have ever known.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000972": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000972",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000973": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000973",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000974": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000974",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>IV</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000975": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000975",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000976": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000976",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>On Sunday morning while church bells rang in the villages alongshore, the world and its mistress returned to Gatsby’s house and twinkled hilariously on his lawn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000977": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000977",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000978": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000978",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He’s a bootlegger,” said the young ladies, moving somewhere between his cocktails and his flowers. “One time he killed a man who had found out that he was nephew to Von Hindenburg and second cousin to the devil. Reach me a rose, honey, and pour me a last drop into that there crystal glass.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000979": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000979",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000980": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000980",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Once I wrote down on the empty spaces of a timetable the names of those who came to Gatsby’s house that summer. It is an old timetable now, disintegrating at its folds, and headed “This schedule in effect July 5th, 1922.” But I can still read the grey names, and they will give you a better impression than my generalities of those who accepted Gatsby’s hospitality and paid him the subtle tribute of knowing nothing whatever about him.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000981": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000981",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000982": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000982",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>From East Egg, then, came the Chester Beckers and the Leeches, and a man named Bunsen, whom I knew at Yale, and Doctor Webster Civet, who was drowned last summer up in Maine. And the Hornbeams and the Willie Voltaires, and a whole clan named Blackbuck, who always gathered in a corner and flipped up their noses like goats at whosoever came near. And the Ismays and the Chrysties (or rather Hubert Auerbach and Mr. Chrystie’s wife), and Edgar Beaver, whose hair, they say, turned cotton-white one winter afternoon for no good reason at all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000983": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000983",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000984": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000984",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Clarence Endive was from East Egg, as I remember. He came only once, in white knickerbockers, and had a fight with a bum named Etty in the garden. From farther out on the Island came the Cheadles and the O. R. P. Schraeders, and the Stonewall Jackson Abrams of Georgia, and the Fishguards and the Ripley Snells. Snell was there three days before he went to the penitentiary, so drunk out on the gravel drive that Mrs. Ulysses Swett’s automobile ran over his right hand. The Dancies came, too, and S. B. Whitebait, who was well over sixty, and Maurice A. Flink, and the Hammerheads, and Beluga the tobacco importer, and Beluga’s girls.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000985": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000985",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000986": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000986",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>From West Egg came the Poles and the Mulreadys and Cecil Roebuck and Cecil Schoen and Gulick the State senator and Newton Orchid, who controlled Films Par Excellence, and Eckhaust and Clyde Cohen and Don S. Schwartz (the son) and Arthur McCarty, all connected with the movies in one way or another. And the Catlips and the Bembergs and G. Earl Muldoon, brother to that Muldoon who afterward strangled his wife. Da Fontano the promoter came there, and Ed Legros and James B. (“Rot-Gut”) Ferret and the De Jongs and Ernest Lilly—they came to gamble, and when Ferret wandered into the garden it meant he was cleaned out and Associated Traction would have to fluctuate profitably next day.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000987": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000987",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000988": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000988",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A man named Klipspringer was there so often that he became known as “the boarder”—I doubt if he had any other home. Of theatrical people there were Gus Waize and Horace O’Donavan and Lester Myer and George Duckweed and Francis Bull. Also from New York were the Chromes and the Backhyssons and the Dennickers and Russel Betty and the Corrigans and the Kellehers and the Dewars and the Scullys and S. W. Belcher and the Smirkes and the young Quinns, divorced now, and Henry L. Palmetto, who killed himself by jumping in front of a subway train in Times Square.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000989": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000989",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000990": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000990",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Benny McClenahan arrived always with four girls. They were never quite the same ones in physical person, but they were so identical one with another that it inevitably seemed they had been there before. I have forgotten their names—Jaqueline, I think, or else Consuela, or Gloria or Judy or June, and their last names were either the melodious names of flowers and months or the sterner ones of the great American capitalists whose cousins, if pressed, they would confess themselves to be.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000991": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000991",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000992": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000992",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>In addition to all these I can remember that Faustina O’Brien came there at least once and the Baedeker girls and young Brewer, who had his nose shot off in the war, and Mr. Albrucksburger and Miss Haag, his fiancée, and Ardita Fitz-Peters and Mr. P. Jewett, once head of the American Legion, and Miss Claudia Hip, with a man reputed to be her chauffeur, and a prince of something, whom we called Duke, and whose name, if I ever knew it, I have forgotten.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000993": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000993",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000994": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000994",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>All these people came to Gatsby’s house in the summer.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000995": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000995",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000996": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000996",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At nine o’clock, one morning late in July, Gatsby’s gorgeous car lurched up the rocky drive to my door and gave out a burst of melody from its three-noted horn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000997": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000997",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000998": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000998",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was the first time he had called on me, though I had gone to two of his parties, mounted in his hydroplane, and, at his urgent invitation, made frequent use of his beach.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000000999": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000000999",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001000": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001000",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Good morning, old sport. You’re having lunch with me today and I thought we’d ride up together.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001001": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001001",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001002": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001002",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He was balancing himself on the dashboard of his car with that resourcefulness of movement that is so peculiarly American—that comes, I suppose, with the absence of lifting work in youth and, even more, with the formless grace of our nervous, sporadic games. This quality was continually breaking through his punctilious manner in the shape of restlessness. He was never quite still; there was always a tapping foot somewhere or the impatient opening and closing of a hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001003": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001003",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001004": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001004",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He saw me looking with admiration at his car.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001005": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001005",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001006": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001006",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s pretty, isn’t it, old sport?” He jumped off to give me a better view. “Haven’t you ever seen it before?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001007": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001008": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001008",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I’d seen it. Everybody had seen it. It was a rich cream colour, bright with nickel, swollen here and there in its monstrous length with triumphant hatboxes and supper-boxes and toolboxes, and terraced with a labyrinth of windshields that mirrored a dozen suns. Sitting down behind many layers of glass in a sort of green leather conservatory, we started to town.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001009": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001010": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I had talked with him perhaps half a dozen times in the past month and found, to my disappointment, that he had little to say. So my first impression, that he was a person of some undefined consequence, had gradually faded and he had become simply the proprietor of an elaborate roadhouse next door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001011": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001012": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>And then came that disconcerting ride. We hadn’t reached West Egg village before Gatsby began leaving his elegant sentences unfinished and slapping himself indecisively on the knee of his caramel-coloured suit.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001013": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001014": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look here, old sport,” he broke out surprisingly, “what’s your opinion of me, anyhow?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001015": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001016": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A little overwhelmed, I began the generalized evasions which that question deserves.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001017": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001018": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I’m going to tell you something about my life,” he interrupted. “I don’t want you to get a wrong idea of me from all these stories you hear.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001019": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001020": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>So he was aware of the bizarre accusations that flavoured conversation in his halls.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001021": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001022": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll tell you God’s truth.” His right hand suddenly ordered divine retribution to stand by. “I am the son of some wealthy people in the Middle West—all dead now. I was brought up in America but educated at Oxford, because all my ancestors have been educated there for many years. It is a family tradition.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001023": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001024": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He looked at me sideways—and I knew why Jordan Baker had believed he was lying. He hurried the phrase “educated at Oxford,” or swallowed it, or choked on it, as though it had bothered him before. And with this doubt, his whole statement fell to pieces, and I wondered if there wasn’t something a little sinister about him, after all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001025": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001026": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What part of the Middle West?” I inquired casually.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001027": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001028": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“San Francisco.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001029": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001030": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I see.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001031": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001032": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“My family all died and I came into a good deal of money.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001033": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001034": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His voice was solemn, as if the memory of that sudden extinction of a clan still haunted him. For a moment I suspected that he was pulling my leg, but a glance at him convinced me otherwise.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001035": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001036": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“After that I lived like a young rajah in all the capitals of Europe—Paris, Venice, Rome—collecting jewels, chiefly rubies, hunting big game, painting a little, things for myself only, and trying to forget something very sad that had happened to me long ago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001037": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001038": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>With an effort I managed to restrain my incredulous laughter. The very phrases were worn so threadbare that they evoked no image except that of a turbaned “character” leaking sawdust at every pore as he pursued a tiger through the Bois de Boulogne.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001039": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001040": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Then came the war, old sport. It was a great relief, and I tried very hard to die, but I seemed to bear an enchanted life. I accepted a commission as first lieutenant when it began. In the Argonne Forest I took the remains of my machine-gun battalion so far forward that there was a half mile gap on either side of us where the infantry couldn’t advance. We stayed there two days and two nights, a hundred and thirty men with sixteen Lewis guns, and when the infantry came up at last they found the insignia of three German divisions among the piles of dead. I was promoted to be a major, and every Allied government gave me a decoration—even Montenegro, little Montenegro down on the Adriatic Sea!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001041": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001042": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Little Montenegro! He lifted up the words and nodded at them—with his smile. The smile comprehended Montenegro’s troubled history and sympathized with the brave struggles of the Montenegrin people. It appreciated fully the chain of national circumstances which had elicited this tribute from Montenegro’s warm little heart. My incredulity was submerged in fascination now; it was like skimming hastily through a dozen magazines.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001043": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001044": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He reached in his pocket, and a piece of metal, slung on a ribbon, fell into my palm.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001045": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001046": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s the one from Montenegro.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001047": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001048": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>To my astonishment, the thing had an authentic look. “Orderi di Danilo,” ran the circular legend, “Montenegro, Nicolas Rex.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001049": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001050": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Turn it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001051": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001052": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Major Jay Gatsby,” I read, “For Valour Extraordinary.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001053": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001054": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Here’s another thing I always carry. A souvenir of Oxford days. It was taken in Trinity Quad—the man on my left is now the Earl of Doncaster.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001055": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001056": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was a photograph of half a dozen young men in blazers loafing in an archway through which were visible a host of spires. There was Gatsby, looking a little, not much, younger—with a cricket bat in his hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001057": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001058": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Then it was all true. I saw the skins of tigers flaming in his palace on the Grand Canal; I saw him opening a chest of rubies to ease, with their crimson-lighted depths, the gnawings of his broken heart.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001059": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001060": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m going to make a big request of you today,” he said, pocketing his souvenirs with satisfaction, “so I thought you ought to know something about me. I didn’t want you to think I was just some nobody. You see, I usually find myself among strangers because I drift here and there trying to forget the sad things that happened to me.” He hesitated. “You’ll hear about it this afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001061": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001062": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“At lunch?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001063": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001064": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, this afternoon. I happened to find out that you’re taking Miss Baker to tea.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001065": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001066": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do you mean you’re in love with Miss Baker?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001067": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001068": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, old sport, I’m not. But Miss Baker has kindly consented to speak to you about this matter.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001069": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001070": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I hadn’t the faintest idea what “this matter” was, but I was more annoyed than interested. I hadn’t asked Jordan to tea in order to discuss Mr. Jay Gatsby. I was sure the request would be something utterly fantastic, and for a moment I was sorry I’d ever set foot upon his overpopulated lawn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001071": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001072": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He wouldn’t say another word. His correctness grew on him as we neared the city. We passed Port Roosevelt, where there was a glimpse of red-belted oceangoing ships, and sped along a cobbled slum lined with the dark, undeserted saloons of the faded-gilt nineteen-hundreds. Then the valley of ashes opened out on both sides of us, and I had a glimpse of Mrs. Wilson straining at the garage pump with panting vitality as we went by.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001073": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001074": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>With fenders spread like wings we scattered light through half Astoria—only half, for as we twisted among the pillars of the elevated I heard the familiar “jug-jug-<i>spat</i>!” of a motorcycle, and a frantic policeman rode alongside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001075": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001076": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right, old sport,” called Gatsby. We slowed down. Taking a white card from his wallet, he waved it before the man’s eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001077": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001078": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Right you are,” agreed the policeman, tipping his cap. “Know you next time, Mr. Gatsby. Excuse <i>me</i>!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001079": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001080": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What was that?” I inquired. “The picture of Oxford?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001081": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001082": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I was able to do the commissioner a favour once, and he sends me a Christmas card every year.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001083": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001084": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Over the great bridge, with the sunlight through the girders making a constant flicker upon the moving cars, with the city rising up across the river in white heaps and sugar lumps all built with a wish out of nonolfactory money. The city seen from the Queensboro Bridge is always the city seen for the first time, in its first wild promise of all the mystery and the beauty in the world.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001085": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001086": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A dead man passed us in a hearse heaped with blooms, followed by two carriages with drawn blinds, and by more cheerful carriages for friends. The friends looked out at us with the tragic eyes and short upper lips of southeastern Europe, and I was glad that the sight of Gatsby’s splendid car was included in their sombre holiday. As we crossed Blackwell’s Island a limousine passed us, driven by a white chauffeur, in which sat three modish negroes, two bucks and a girl. I laughed aloud as the yolks of their eyeballs rolled toward us in haughty rivalry.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001087": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001088": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Anything can happen now that we’ve slid over this bridge,” I thought; “anything at all…”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001089": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001090": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Even Gatsby could happen, without any particular wonder.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001091": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001092": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Roaring noon. In a well-fanned Forty-second Street cellar I met Gatsby for lunch. Blinking away the brightness of the street outside, my eyes picked him out obscurely in the anteroom, talking to another man.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001093": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001094": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Mr. Carraway, this is my friend Mr. Wolfshiem.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001095": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001096": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A small, flat-nosed Jew raised his large head and regarded me with two fine growths of hair which luxuriated in either nostril. After a moment I discovered his tiny eyes in the half-darkness.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001097": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001098": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“—So I took one look at him,” said Mr. Wolfshiem, shaking my hand earnestly, “and what do you think I did?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001099": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001100": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What?” I inquired politely.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001101": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001102": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But evidently he was not addressing me, for he dropped my hand and covered Gatsby with his expressive nose.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001103": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001104": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I handed the money to Katspaugh and I said: ‘All right, Katspaugh, don’t pay him a penny till he shuts his mouth.’ He shut it then and there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001105": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001106": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby took an arm of each of us and moved forward into the restaurant, whereupon Mr. Wolfshiem swallowed a new sentence he was starting and lapsed into a somnambulatory abstraction.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001107": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001108": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Highballs?” asked the head waiter.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001109": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001110": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This is a nice restaurant here,” said Mr. Wolfshiem, looking at the presbyterian nymphs on the ceiling. “But I like across the street better!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001111": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001112": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes, highballs,” agreed Gatsby, and then to Mr. Wolfshiem: “It’s too hot over there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001113": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001114": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hot and small—yes,” said Mr. Wolfshiem, “but full of memories.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001115": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001116": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What place is that?” I asked.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001117": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001118": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The old Metropole.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001119": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001120": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The old Metropole,” brooded Mr. Wolfshiem gloomily. “Filled with faces dead and gone. Filled with friends gone now forever. I can’t forget so long as I live the night they shot Rosy Rosenthal there. It was six of us at the table, and Rosy had eat and drunk a lot all evening. When it was almost morning the waiter came up to him with a funny look and says somebody wants to speak to him outside. ‘All right,’ says Rosy, and begins to get up, and I pulled him down in his chair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001121": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001122": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“ ‘Let the bastards come in here if they want you, Rosy, but don’t you, so help me, move outside this room.’</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001123": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001124": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was four o’clock in the morning then, and if we’d of raised the blinds we’d of seen daylight.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001125": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001126": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did he go?” I asked innocently.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001127": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001128": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Sure he went.” Mr. Wolfshiem’s nose flashed at me indignantly. “He turned around in the door and says: ‘Don’t let that waiter take away my coffee!’ Then he went out on the sidewalk, and they shot him three times in his full belly and drove away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001129": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001130": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Four of them were electrocuted,” I said, remembering.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001131": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001132": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Five, with Becker.” His nostrils turned to me in an interested way. “I understand you’re looking for a business gonnegtion.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001133": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001134": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The juxtaposition of these two remarks was startling. Gatsby answered for me:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001135": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001136": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, no,” he exclaimed, “this isn’t the man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001137": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001138": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No?” Mr. Wolfshiem seemed disappointed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001139": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001140": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This is just a friend. I told you we’d talk about that some other time.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001141": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001142": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I beg your pardon,” said Mr. Wolfshiem, “I had a wrong man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001143": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001144": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A succulent hash arrived, and Mr. Wolfshiem, forgetting the more sentimental atmosphere of the old Metropole, began to eat with ferocious delicacy. His eyes, meanwhile, roved very slowly all around the room—he completed the arc by turning to inspect the people directly behind. I think that, except for my presence, he would have taken one short glance beneath our own table.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001145": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001146": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look here, old sport,” said Gatsby, leaning toward me, “I’m afraid I made you a little angry this morning in the car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001147": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001148": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was the smile again, but this time I held out against it.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001149": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001150": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t like mysteries,” I answered, “and I don’t understand why you won’t come out frankly and tell me what you want. Why has it all got to come through Miss Baker?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001151": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001152": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, it’s nothing underhand,” he assured me. “Miss Baker’s a great sportswoman, you know, and she’d never do anything that wasn’t all right.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001153": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001154": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Suddenly he looked at his watch, jumped up, and hurried from the room, leaving me with Mr. Wolfshiem at the table.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001155": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001156": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He has to telephone,” said Mr. Wolfshiem, following him with his eyes. “Fine fellow, isn’t he? Handsome to look at and a perfect gentleman.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001157": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001158": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001159": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001160": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He’s an Oggsford man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001161": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001162": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001163": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001164": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He went to Oggsford College in England. You know Oggsford College?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001165": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001166": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve heard of it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001167": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001168": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s one of the most famous colleges in the world.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001169": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001170": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Have you known Gatsby for a long time?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001171": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001172": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Several years,” he answered in a gratified way. “I made the pleasure of his acquaintance just after the war. But I knew I had discovered a man of fine breeding after I talked with him an hour. I said to myself: ‘There’s the kind of man you’d like to take home and introduce to your mother and sister.’ ” He paused. “I see you’re looking at my cuff buttons.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001173": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001174": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I hadn’t been looking at them, but I did now. They were composed of oddly familiar pieces of ivory.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001175": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001176": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Finest specimens of human molars,” he informed me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001177": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001178": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well!” I inspected them. “That’s a very interesting idea.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001179": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001180": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yeah.” He flipped his sleeves up under his coat. “Yeah, Gatsby’s very careful about women. He would never so much as look at a friend’s wife.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001181": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001182": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When the subject of this instinctive trust returned to the table and sat down Mr. Wolfshiem drank his coffee with a jerk and got to his feet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001183": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001184": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I have enjoyed my lunch,” he said, “and I’m going to run off from you two young men before I outstay my welcome.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001185": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001186": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t hurry Meyer,” said Gatsby, without enthusiasm. Mr. Wolfshiem raised his hand in a sort of benediction.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001187": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001188": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re very polite, but I belong to another generation,” he announced solemnly. “You sit here and discuss your sports and your young ladies and your—” He supplied an imaginary noun with another wave of his hand. “As for me, I am fifty years old, and I won’t impose myself on you any longer.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001189": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001190": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As he shook hands and turned away his tragic nose was trembling. I wondered if I had said anything to offend him.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001191": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001192": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He becomes very sentimental sometimes,” explained Gatsby. “This is one of his sentimental days. He’s quite a character around New York—a denizen of Broadway.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001193": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001194": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who is he, anyhow, an actor?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001195": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001196": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001197": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001198": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“A dentist?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001199": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001200": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Meyer Wolfshiem? No, he’s a gambler.” Gatsby hesitated, then added, coolly: “He’s the man who fixed the World’s Series back in 1919.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001201": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001202": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Fixed the World’s Series?” I repeated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001203": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001204": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The idea staggered me. I remembered, of course, that the World’s Series had been fixed in 1919, but if I had thought of it at all I would have thought of it as a thing that merely <i>happened</i>, the end of some inevitable chain. It never occurred to me that one man could start to play with the faith of fifty million people—with the single-mindedness of a burglar blowing a safe.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001205": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001206": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How did he happen to do that?” I asked after a minute.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001207": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001208": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He just saw the opportunity.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001209": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001210": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why isn’t he in jail?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001211": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001212": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They can’t get him, old sport. He’s a smart man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001213": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001214": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I insisted on paying the check. As the waiter brought my change I caught sight of Tom Buchanan across the crowded room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001215": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001216": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come along with me for a minute,” I said; “I’ve got to say hello to someone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001217": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001218": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When he saw us Tom jumped up and took half a dozen steps in our direction.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001219": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001220": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where’ve you been?” he demanded eagerly. “Daisy’s furious because you haven’t called up.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001221": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001222": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This is Mr. Gatsby, Mr. Buchanan.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001223": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001224": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They shook hands briefly, and a strained, unfamiliar look of embarrassment came over Gatsby’s face.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001225": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001226": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How’ve you been, anyhow?” demanded Tom of me. “How’d you happen to come up this far to eat?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001227": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001228": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve been having lunch with Mr. Gatsby.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001229": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001230": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I turned toward Mr. Gatsby, but he was no longer there.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001231": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001232": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>One October day in nineteen-seventeen—</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001233": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001234": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>(said Jordan Baker that afternoon, sitting up very straight on a straight chair in the tea-garden at the Plaza Hotel)</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001235": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001236": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>—I was walking along from one place to another, half on the sidewalks and half on the lawns. I was happier on the lawns because I had on shoes from England with rubber knobs on the soles that bit into the soft ground. I had on a new plaid skirt also that blew a little in the wind, and whenever this happened the red, white, and blue banners in front of all the houses stretched out stiff and said <i>tut-tut-tut-tut</i>, in a disapproving way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001237": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001238": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The largest of the banners and the largest of the lawns belonged to Daisy Fay’s house. She was just eighteen, two years older than me, and by far the most popular of all the young girls in Louisville. She dressed in white, and had a little white roadster, and all day long the telephone rang in her house and excited young officers from Camp Taylor demanded the privilege of monopolizing her that night. “Anyways, for an hour!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001239": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001240": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When I came opposite her house that morning her white roadster was beside the kerb, and she was sitting in it with a lieutenant I had never seen before. They were so engrossed in each other that she didn’t see me until I was five feet away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001241": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001242": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hello, Jordan,” she called unexpectedly. “Please come here.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001243": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001244": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was flattered that she wanted to speak to me, because of all the older girls I admired her most. She asked me if I was going to the Red Cross to make bandages. I was. Well, then, would I tell them that she couldn’t come that day? The officer looked at Daisy while she was speaking, in a way that every young girl wants to be looked at sometime, and because it seemed romantic to me I have remembered the incident ever since. His name was Jay Gatsby, and I didn’t lay eyes on him again for over four years—even after I’d met him on Long Island I didn’t realize it was the same man.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001245": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001246": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That was nineteen-seventeen. By the next year I had a few beaux myself, and I began to play in tournaments, so I didn’t see Daisy very often. She went with a slightly older crowd—when she went with anyone at all. Wild rumours were circulating about her—how her mother had found her packing her bag one winter night to go to New York and say goodbye to a soldier who was going overseas. She was effectually prevented, but she wasn’t on speaking terms with her family for several weeks. After that she didn’t play around with the soldiers any more, but only with a few flat-footed, shortsighted young men in town, who couldn’t get into the army at all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001247": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001248": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>By the next autumn she was gay again, gay as ever. She had a début after the armistice, and in February she was presumably engaged to a man from New Orleans. In June she married Tom Buchanan of Chicago, with more pomp and circumstance than Louisville ever knew before. He came down with a hundred people in four private cars, and hired a whole floor of the Muhlbach Hotel, and the day before the wedding he gave her a string of pearls valued at three hundred and fifty thousand dollars.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001249": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001250": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was a bridesmaid. I came into her room half an hour before the bridal dinner, and found her lying on her bed as lovely as the June night in her flowered dress—and as drunk as a monkey. She had a bottle of Sauterne in one hand and a letter in the other.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001251": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001252": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“ ’Gratulate me,” she muttered. “Never had a drink before, but oh how I do enjoy it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001253": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001254": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s the matter, Daisy?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001255": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001256": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was scared, I can tell you; I’d never seen a girl like that before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001257": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001258": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Here, dearies.” She groped around in a wastebasket she had with her on the bed and pulled out the string of pearls. “Take ’em downstairs and give ’em back to whoever they belong to. Tell ’em all Daisy’s change’ her mine. Say: ‘Daisy’s change’ her mine!’ ”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001259": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001260": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She began to cry—she cried and cried. I rushed out and found her mother’s maid, and we locked the door and got her into a cold bath. She wouldn’t let go of the letter. She took it into the tub with her and squeezed it up in a wet ball, and only let me leave it in the soap-dish when she saw that it was coming to pieces like snow.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001261": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001262": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But she didn’t say another word. We gave her spirits of ammonia and put ice on her forehead and hooked her back into her dress, and half an hour later, when we walked out of the room, the pearls were around her neck and the incident was over. Next day at five o’clock she married Tom Buchanan without so much as a shiver, and started off on a three months’ trip to the South Seas.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001263": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001264": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I saw them in Santa Barbara when they came back, and I thought I’d never seen a girl so mad about her husband. If he left the room for a minute she’d look around uneasily, and say: “Where’s Tom gone?” and wear the most abstracted expression until she saw him coming in the door. She used to sit on the sand with his head in her lap by the hour, rubbing her fingers over his eyes and looking at him with unfathomable delight. It was touching to see them together—it made you laugh in a hushed, fascinated way. That was in August. A week after I left Santa Barbara Tom ran into a wagon on the Ventura road one night, and ripped a front wheel off his car. The girl who was with him got into the papers, too, because her arm was broken—she was one of the chambermaids in the Santa Barbara Hotel.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001265": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001266": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The next April Daisy had her little girl, and they went to France for a year. I saw them one spring in Cannes, and later in Deauville, and then they came back to Chicago to settle down. Daisy was popular in Chicago, as you know. They moved with a fast crowd, all of them young and rich and wild, but she came out with an absolutely perfect reputation. Perhaps because she doesn’t drink. It’s a great advantage not to drink among hard-drinking people. You can hold your tongue and, moreover, you can time any little irregularity of your own so that everybody else is so blind that they don’t see or care. Perhaps Daisy never went in for amour at all—and yet there’s something in that voice of hers…</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001267": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001268": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Well, about six weeks ago, she heard the name Gatsby for the first time in years. It was when I asked you—do you remember?—if you knew Gatsby in West Egg. After you had gone home she came into my room and woke me up, and said: “What Gatsby?” and when I described him—I was half asleep—she said in the strangest voice that it must be the man she used to know. It wasn’t until then that I connected this Gatsby with the officer in her white car.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001269": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001270": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When Jordan Baker had finished telling all this we had left the Plaza for half an hour and were driving in a victoria through Central Park. The sun had gone down behind the tall apartments of the movie stars in the West Fifties, and the clear voices of children, already gathered like crickets on the grass, rose through the hot twilight:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001271": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001272": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001273": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div><p><span>“I’m the Sheik of Araby.</span><br>\n<span>Your love belongs to me.</span><br>\n<span>At night when you’re asleep</span><br>\n<span>Into your tent I’ll creep—”</span></p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001274": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001275": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001276": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was a strange coincidence,” I said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001277": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001278": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But it wasn’t a coincidence at all.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001279": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001280": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why not?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001281": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001282": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Gatsby bought that house so that Daisy would be just across the bay.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001283": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001284": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Then it had not been merely the stars to which he had aspired on that June night. He came alive to me, delivered suddenly from the womb of his purposeless splendour.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001285": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001286": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He wants to know,” continued Jordan, “if you’ll invite Daisy to your house some afternoon and then let him come over.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001287": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001288": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The modesty of the demand shook me. He had waited five years and bought a mansion where he dispensed starlight to casual moths—so that he could “come over” some afternoon to a stranger’s garden.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001289": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001290": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did I have to know all this before he could ask such a little thing?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001291": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001292": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He’s afraid, he’s waited so long. He thought you might be offended. You see, he’s regular tough underneath it all.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001293": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001294": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Something worried me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001295": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001296": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why didn’t he ask you to arrange a meeting?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001297": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001298": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He wants her to see his house,” she explained. “And your house is right next door.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001299": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001300": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001301": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001302": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I think he half expected her to wander into one of his parties, some night,” went on Jordan, “but she never did. Then he began asking people casually if they knew her, and I was the first one he found. It was that night he sent for me at his dance, and you should have heard the elaborate way he worked up to it. Of course, I immediately suggested a luncheon in New York—and I thought he’d go mad:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001303": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001304": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“ ‘I don’t want to do anything out of the way!’ he kept saying. ‘I want to see her right next door.’</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001305": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001306": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“When I said you were a particular friend of Tom’s, he started to abandon the whole idea. He doesn’t know very much about Tom, though he says he’s read a Chicago paper for years just on the chance of catching a glimpse of Daisy’s name.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001307": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001308": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was dark now, and as we dipped under a little bridge I put my arm around Jordan’s golden shoulder and drew her toward me and asked her to dinner. Suddenly I wasn’t thinking of Daisy and Gatsby any more, but of this clean, hard, limited person, who dealt in universal scepticism, and who leaned back jauntily just within the circle of my arm. A phrase began to beat in my ears with a sort of heady excitement: “There are only the pursued, the pursuing, the busy, and the tired.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001309": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001310": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“And Daisy ought to have something in her life,” murmured Jordan to me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001311": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001312": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Does she want to see Gatsby?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001313": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001314": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s not to know about it. Gatsby doesn’t want her to know. You’re just supposed to invite her to tea.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001315": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001316": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We passed a barrier of dark trees, and then the façade of Fifty-Ninth Street, a block of delicate pale light, beamed down into the park. Unlike Gatsby and Tom Buchanan, I had no girl whose disembodied face floated along the dark cornices and blinding signs, and so I drew up the girl beside me, tightening my arms. Her wan, scornful mouth smiled, and so I drew her up again closer, this time to my face.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001317": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001318": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001319": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>V</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001320": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001321": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When I came home to West Egg that night I was afraid for a moment that my house was on fire. Two o’clock and the whole corner of the peninsula was blazing with light, which fell unreal on the shrubbery and made thin elongating glints upon the roadside wires. Turning a corner, I saw that it was Gatsby’s house, lit from tower to cellar.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001322": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001323": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At first I thought it was another party, a wild rout that had resolved itself into “hide-and-go-seek” or “sardines-in-the-box” with all the house thrown open to the game. But there wasn’t a sound. Only wind in the trees, which blew the wires and made the lights go off and on again as if the house had winked into the darkness. As my taxi groaned away I saw Gatsby walking toward me across his lawn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001324": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001325": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Your place looks like the World’s Fair,” I said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001326": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001327": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Does it?” He turned his eyes toward it absently. “I have been glancing into some of the rooms. Let’s go to Coney Island, old sport. In my car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001328": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001329": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s too late.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001330": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001331": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, suppose we take a plunge in the swimming pool? I haven’t made use of it all summer.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001332": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001333": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got to go to bed.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001334": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001335": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001336": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001337": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He waited, looking at me with suppressed eagerness.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001338": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001339": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I talked with Miss Baker,” I said after a moment. “I’m going to call up Daisy tomorrow and invite her over here to tea.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001340": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001341": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, that’s all right,” he said carelessly. “I don’t want to put you to any trouble.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001342": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001343": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What day would suit you?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001344": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001345": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What day would suit <i>you</i>?” he corrected me quickly. “I don’t want to put you to any trouble, you see.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001346": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001347": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How about the day after tomorrow?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001348": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001349": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He considered for a moment. Then, with reluctance: “I want to get the grass cut,” he said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001350": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001351": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We both looked down at the grass—there was a sharp line where my ragged lawn ended and the darker, well-kept expanse of his began. I suspected that he meant my grass.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001352": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001353": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There’s another little thing,” he said uncertainly, and hesitated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001354": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001355": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Would you rather put it off for a few days?” I asked.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001356": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001357": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, it isn’t about that. At least—” He fumbled with a series of beginnings. “Why, I thought—why, look here, old sport, you don’t make much money, do you?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001358": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001359": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Not very much.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001360": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001361": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>This seemed to reassure him and he continued more confidently.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001362": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001363": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I thought you didn’t, if you’ll pardon my—you see, I carry on a little business on the side, a sort of side line, you understand. And I thought that if you don’t make very much—You’re selling bonds, aren’t you, old sport?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001364": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001365": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Trying to.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001366": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001367": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, this would interest you. It wouldn’t take up much of your time and you might pick up a nice bit of money. It happens to be a rather confidential sort of thing.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001368": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001369": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I realize now that under different circumstances that conversation might have been one of the crises of my life. But, because the offer was obviously and tactlessly for a service to be rendered, I had no choice except to cut him off there.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001370": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001371": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got my hands full,” I said. “I’m much obliged but I couldn’t take on any more work.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001372": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001373": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You wouldn’t have to do any business with Wolfshiem.” Evidently he thought that I was shying away from the “gonnegtion” mentioned at lunch, but I assured him he was wrong. He waited a moment longer, hoping I’d begin a conversation, but I was too absorbed to be responsive, so he went unwillingly home.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001374": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001375": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The evening had made me lightheaded and happy; I think I walked into a deep sleep as I entered my front door. So I don’t know whether or not Gatsby went to Coney Island, or for how many hours he “glanced into rooms” while his house blazed gaudily on. I called up Daisy from the office next morning, and invited her to come to tea.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001376": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001377": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t bring Tom,” I warned her.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001378": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001379": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001380": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001381": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t bring Tom.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001382": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001383": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who is ‘Tom’?” she asked innocently.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001384": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001385": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The day agreed upon was pouring rain. At eleven o’clock a man in a raincoat, dragging a lawn-mower, tapped at my front door and said that Mr. Gatsby had sent him over to cut my grass. This reminded me that I had forgotten to tell my Finn to come back, so I drove into West Egg Village to search for her among soggy whitewashed alleys and to buy some cups and lemons and flowers.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001386": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001387": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The flowers were unnecessary, for at two o’clock a greenhouse arrived from Gatsby’s, with innumerable receptacles to contain it. An hour later the front door opened nervously, and Gatsby in a white flannel suit, silver shirt, and gold-coloured tie, hurried in. He was pale, and there were dark signs of sleeplessness beneath his eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001388": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001389": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is everything all right?” he asked immediately.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001390": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001391": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The grass looks fine, if that’s what you mean.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001392": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001393": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What grass?” he inquired blankly. “Oh, the grass in the yard.” He looked out the window at it, but, judging from his expression, I don’t believe he saw a thing.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001394": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001395": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Looks very good,” he remarked vaguely. “One of the papers said they thought the rain would stop about four. I think it was <i>The Journal</i>. Have you got everything you need in the shape of—of tea?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001396": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001397": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I took him into the pantry, where he looked a little reproachfully at the Finn. Together we scrutinized the twelve lemon cakes from the delicatessen shop.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001398": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001399": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Will they do?” I asked.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001400": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001401": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course, of course! They’re fine!” and he added hollowly, “… old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001402": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001403": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The rain cooled about half-past three to a damp mist, through which occasional thin drops swam like dew. Gatsby looked with vacant eyes through a copy of Clay’s <i>Economics</i>, starting at the Finnish tread that shook the kitchen floor, and peering towards the bleared windows from time to time as if a series of invisible but alarming happenings were taking place outside. Finally he got up and informed me, in an uncertain voice, that he was going home.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001404": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001405": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why’s that?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001406": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001407": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nobody’s coming to tea. It’s too late!” He looked at his watch as if there was some pressing demand on his time elsewhere. “I can’t wait all day.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001408": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001409": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t be silly; it’s just two minutes to four.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001410": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001411": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He sat down miserably, as if I had pushed him, and simultaneously there was the sound of a motor turning into my lane. We both jumped up, and, a little harrowed myself, I went out into the yard.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001412": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001413": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Under the dripping bare lilac-trees a large open car was coming up the drive. It stopped. Daisy’s face, tipped sideways beneath a three-cornered lavender hat, looked out at me with a bright ecstatic smile.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001414": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001415": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is this absolutely where you live, my dearest one?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001416": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001417": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The exhilarating ripple of her voice was a wild tonic in the rain. I had to follow the sound of it for a moment, up and down, with my ear alone, before any words came through. A damp streak of hair lay like a dash of blue paint across her cheek, and her hand was wet with glistening drops as I took it to help her from the car.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001418": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001419": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Are you in love with me,” she said low in my ear, “or why did I have to come alone?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001420": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001421": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s the secret of Castle Rackrent. Tell your chauffeur to go far away and spend an hour.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001422": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001423": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come back in an hour, Ferdie.” Then in a grave murmur: “His name is Ferdie.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001424": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001425": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Does the gasoline affect his nose?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001426": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001427": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t think so,” she said innocently. “Why?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001428": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001429": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We went in. To my overwhelming surprise the living-room was deserted.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001430": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001431": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, that’s funny,” I exclaimed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001432": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001433": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s funny?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001434": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001435": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She turned her head as there was a light dignified knocking at the front door. I went out and opened it. Gatsby, pale as death, with his hands plunged like weights in his coat pockets, was standing in a puddle of water glaring tragically into my eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001436": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001437": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>With his hands still in his coat pockets he stalked by me into the hall, turned sharply as if he were on a wire, and disappeared into the living-room. It wasn’t a bit funny. Aware of the loud beating of my own heart I pulled the door to against the increasing rain.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001438": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001439": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For half a minute there wasn’t a sound. Then from the living-room I heard a sort of choking murmur and part of a laugh, followed by Daisy’s voice on a clear artificial note:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001440": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001441": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I certainly am awfully glad to see you again.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001442": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001443": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A pause; it endured horribly. I had nothing to do in the hall, so I went into the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001444": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001445": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby, his hands still in his pockets, was reclining against the mantelpiece in a strained counterfeit of perfect ease, even of boredom. His head leaned back so far that it rested against the face of a defunct mantelpiece clock, and from this position his distraught eyes stared down at Daisy, who was sitting, frightened but graceful, on the edge of a stiff chair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001446": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001447": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ve met before,” muttered Gatsby. His eyes glanced momentarily at me, and his lips parted with an abortive attempt at a laugh. Luckily the clock took this moment to tilt dangerously at the pressure of his head, whereupon he turned and caught it with trembling fingers, and set it back in place. Then he sat down, rigidly, his elbow on the arm of the sofa and his chin in his hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001448": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001449": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m sorry about the clock,” he said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001450": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001451": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>My own face had now assumed a deep tropical burn. I couldn’t muster up a single commonplace out of the thousand in my head.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001452": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001453": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s an old clock,” I told them idiotically.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001454": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001455": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I think we all believed for a moment that it had smashed in pieces on the floor.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001456": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001457": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We haven’t met for many years,” said Daisy, her voice as matter-of-fact as it could ever be.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001458": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001459": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Five years next November.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001460": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001461": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The automatic quality of Gatsby’s answer set us all back at least another minute. I had them both on their feet with the desperate suggestion that they help me make tea in the kitchen when the demoniac Finn brought it in on a tray.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001462": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001463": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Amid the welcome confusion of cups and cakes a certain physical decency established itself. Gatsby got himself into a shadow and, while Daisy and I talked, looked conscientiously from one to the other of us with tense, unhappy eyes. However, as calmness wasn’t an end in itself, I made an excuse at the first possible moment, and got to my feet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001464": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001465": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where are you going?” demanded Gatsby in immediate alarm.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001466": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001467": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll be back.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001468": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001469": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got to speak to you about something before you go.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001470": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001471": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He followed me wildly into the kitchen, closed the door, and whispered: “Oh, God!” in a miserable way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001472": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001473": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s the matter?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001474": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001475": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This is a terrible mistake,” he said, shaking his head from side to side, “a terrible, terrible mistake.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001476": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001477": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re just embarrassed, that’s all,” and luckily I added: “Daisy’s embarrassed too.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001478": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001479": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s embarrassed?” he repeated incredulously.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001480": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001481": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Just as much as you are.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001482": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001483": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t talk so loud.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001484": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001485": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re acting like a little boy,” I broke out impatiently. “Not only that, but you’re rude. Daisy’s sitting in there all alone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001486": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001487": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He raised his hand to stop my words, looked at me with unforgettable reproach, and, opening the door cautiously, went back into the other room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001488": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001489": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I walked out the back way—just as Gatsby had when he had made his nervous circuit of the house half an hour before—and ran for a huge black knotted tree, whose massed leaves made a fabric against the rain. Once more it was pouring, and my irregular lawn, well-shaved by Gatsby’s gardener, abounded in small muddy swamps and prehistoric marshes. There was nothing to look at from under the tree except Gatsby’s enormous house, so I stared at it, like Kant at his church steeple, for half an hour. A brewer had built it early in the “period” craze, a decade before, and there was a story that he’d agreed to pay five years’ taxes on all the neighbouring cottages if the owners would have their roofs thatched with straw. Perhaps their refusal took the heart out of his plan to Found a Family—he went into an immediate decline. His children sold his house with the black wreath still on the door. Americans, while willing, even eager, to be serfs, have always been obstinate about being peasantry.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001490": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001491": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>After half an hour, the sun shone again, and the grocer’s automobile rounded Gatsby’s drive with the raw material for his servants’ dinner—I felt sure he wouldn’t eat a spoonful. A maid began opening the upper windows of his house, appeared momentarily in each, and, leaning from the large central bay, spat meditatively into the garden. It was time I went back. While the rain continued it had seemed like the murmur of their voices, rising and swelling a little now and then with gusts of emotion. But in the new silence I felt that silence had fallen within the house too.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001492": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001493": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I went in—after making every possible noise in the kitchen, short of pushing over the stove—but I don’t believe they heard a sound. They were sitting at either end of the couch, looking at each other as if some question had been asked, or was in the air, and every vestige of embarrassment was gone. Daisy’s face was smeared with tears, and when I came in she jumped up and began wiping at it with her handkerchief before a mirror. But there was a change in Gatsby that was simply confounding. He literally glowed; without a word or a gesture of exultation a new well-being radiated from him and filled the little room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001494": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001495": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, hello, old sport,” he said, as if he hadn’t seen me for years. I thought for a moment he was going to shake hands.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001496": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001497": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s stopped raining.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001498": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001499": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Has it?” When he realized what I was talking about, that there were twinkle-bells of sunshine in the room, he smiled like a weather man, like an ecstatic patron of recurrent light, and repeated the news to Daisy. “What do you think of that? It’s stopped raining.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001500": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001501": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m glad, Jay.” Her throat, full of aching, grieving beauty, told only of her unexpected joy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001502": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001503": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want you and Daisy to come over to my house,” he said, “I’d like to show her around.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001504": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001505": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re sure you want me to come?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001506": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001507": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Absolutely, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001508": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001509": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy went upstairs to wash her face—too late I thought with humiliation of my towels—while Gatsby and I waited on the lawn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001510": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001511": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“My house looks well, doesn’t it?” he demanded. “See how the whole front of it catches the light.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001512": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001513": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I agreed that it was splendid.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001514": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001515": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes.” His eyes went over it, every arched door and square tower. “It took me just three years to earn the money that bought it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001516": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001517": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I thought you inherited your money.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001518": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001519": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I did, old sport,” he said automatically, “but I lost most of it in the big panic—the panic of the war.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001520": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001521": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I think he hardly knew what he was saying, for when I asked him what business he was in he answered: “That’s my affair,” before he realized that it wasn’t an appropriate reply.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001522": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001523": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, I’ve been in several things,” he corrected himself. “I was in the drug business and then I was in the oil business. But I’m not in either one now.” He looked at me with more attention. “Do you mean you’ve been thinking over what I proposed the other night?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001524": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001525": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Before I could answer, Daisy came out of the house and two rows of brass buttons on her dress gleamed in the sunlight.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001526": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001527": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That huge place <i>there</i>?” she cried pointing.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001528": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001529": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do you like it?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001530": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001531": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I love it, but I don’t see how you live there all alone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001532": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001533": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I keep it always full of interesting people, night and day. People who do interesting things. Celebrated people.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001534": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001535": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Instead of taking the shortcut along the Sound we went down to the road and entered by the big postern. With enchanting murmurs Daisy admired this aspect or that of the feudal silhouette against the sky, admired the gardens, the sparkling odour of jonquils and the frothy odour of hawthorn and plum blossoms and the pale gold odour of kiss-me-at-the-gate. It was strange to reach the marble steps and find no stir of bright dresses in and out the door, and hear no sound but bird voices in the trees.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001536": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001537": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>And inside, as we wandered through Marie Antoinette music-rooms and Restoration Salons, I felt that there were guests concealed behind every couch and table, under orders to be breathlessly silent until we had passed through. As Gatsby closed the door of “the Merton College Library” I could have sworn I heard the owl-eyed man break into ghostly laughter.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001538": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001539": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We went upstairs, through period bedrooms swathed in rose and lavender silk and vivid with new flowers, through dressing-rooms and poolrooms, and bathrooms with sunken baths—intruding into one chamber where a dishevelled man in pyjamas was doing liver exercises on the floor. It was Mr. Klipspringer, the “boarder.” I had seen him wandering hungrily about the beach that morning. Finally we came to Gatsby’s own apartment, a bedroom and a bath, and an Adam’s study, where we sat down and drank a glass of some Chartreuse he took from a cupboard in the wall.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001540": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001541": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He hadn’t once ceased looking at Daisy, and I think he revalued everything in his house according to the measure of response it drew from her well-loved eyes. Sometimes too, he stared around at his possessions in a dazed way, as though in her actual and astounding presence none of it was any longer real. Once he nearly toppled down a flight of stairs.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001542": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001543": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His bedroom was the simplest room of all—except where the dresser was garnished with a toilet set of pure dull gold. Daisy took the brush with delight, and smoothed her hair, whereupon Gatsby sat down and shaded his eyes and began to laugh.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001544": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001545": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s the funniest thing, old sport,” he said hilariously. “I can’t—When I try to—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001546": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001547": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He had passed visibly through two states and was entering upon a third. After his embarrassment and his unreasoning joy he was consumed with wonder at her presence. He had been full of the idea so long, dreamed it right through to the end, waited with his teeth set, so to speak, at an inconceivable pitch of intensity. Now, in the reaction, he was running down like an over-wound clock.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001548": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001549": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Recovering himself in a minute he opened for us two hulking patent cabinets which held his massed suits and dressing-gowns and ties, and his shirts, piled like bricks in stacks a dozen high.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001550": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001551": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got a man in England who buys me clothes. He sends over a selection of things at the beginning of each season, spring and fall.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001552": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001553": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He took out a pile of shirts and began throwing them, one by one, before us, shirts of sheer linen and thick silk and fine flannel, which lost their folds as they fell and covered the table in many-coloured disarray. While we admired he brought more and the soft rich heap mounted higher—shirts with stripes and scrolls and plaids in coral and apple-green and lavender and faint orange, with monograms of indian blue. Suddenly, with a strained sound, Daisy bent her head into the shirts and began to cry stormily.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001554": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001555": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They’re such beautiful shirts,” she sobbed, her voice muffled in the thick folds. “It makes me sad because I’ve never seen such—such beautiful shirts before.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001556": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001557": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>After the house, we were to see the grounds and the swimming pool, and the hydroplane, and the midsummer flowers—but outside Gatsby’s window it began to rain again, so we stood in a row looking at the corrugated surface of the Sound.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001558": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001559": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“If it wasn’t for the mist we could see your home across the bay,” said Gatsby. “You always have a green light that burns all night at the end of your dock.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001560": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001561": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy put her arm through his abruptly, but he seemed absorbed in what he had just said. Possibly it had occurred to him that the colossal significance of that light had now vanished forever. Compared to the great distance that had separated him from Daisy it had seemed very near to her, almost touching her. It had seemed as close as a star to the moon. Now it was again a green light on a dock. His count of enchanted objects had diminished by one.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001562": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001563": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I began to walk about the room, examining various indefinite objects in the half darkness. A large photograph of an elderly man in yachting costume attracted me, hung on the wall over his desk.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001564": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001565": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who’s this?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001566": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001567": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That? That’s Mr. Dan Cody, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001568": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001569": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The name sounded faintly familiar.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001570": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001571": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He’s dead now. He used to be my best friend years ago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001572": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001573": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was a small picture of Gatsby, also in yachting costume, on the bureau—Gatsby with his head thrown back defiantly—taken apparently when he was about eighteen.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001574": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001575": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I adore it,” exclaimed Daisy. “The pompadour! You never told me you had a pompadour—or a yacht.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001576": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001577": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look at this,” said Gatsby quickly. “Here’s a lot of clippings—about you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001578": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001579": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They stood side by side examining it. I was going to ask to see the rubies when the phone rang, and Gatsby took up the receiver.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001580": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001581": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes… Well, I can’t talk now… I can’t talk now, old sport… I said a <i>small</i> town… He must know what a small town is… Well, he’s no use to us if Detroit is his idea of a small town…”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001582": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001583": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He rang off.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001584": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001585": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come here <i>quick</i>!” cried Daisy at the window.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001586": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001587": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The rain was still falling, but the darkness had parted in the west, and there was a pink and golden billow of foamy clouds above the sea.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001588": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001589": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look at that,” she whispered, and then after a moment: “I’d like to just get one of those pink clouds and put you in it and push you around.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001590": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001591": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I tried to go then, but they wouldn’t hear of it; perhaps my presence made them feel more satisfactorily alone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001592": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001593": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I know what we’ll do,” said Gatsby, “we’ll have Klipspringer play the piano.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001594": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001595": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He went out of the room calling “Ewing!” and returned in a few minutes accompanied by an embarrassed, slightly worn young man, with shell-rimmed glasses and scanty blond hair. He was now decently clothed in a “sport shirt,” open at the neck, sneakers, and duck trousers of a nebulous hue.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001596": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001597": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did we interrupt your exercise?” inquired Daisy politely.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001598": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001599": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I was asleep,” cried Mr. Klipspringer, in a spasm of embarrassment. “That is, I’d <i>been</i> asleep. Then I got up…”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001600": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001601": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Klipspringer plays the piano,” said Gatsby, cutting him off. “Don’t you, Ewing, old sport?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001602": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001603": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t play well. I don’t—hardly play at all. I’m all out of prac—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001604": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001605": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ll go downstairs,” interrupted Gatsby. He flipped a switch. The grey windows disappeared as the house glowed full of light.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001606": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001607": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>In the music-room Gatsby turned on a solitary lamp beside the piano. He lit Daisy’s cigarette from a trembling match, and sat down with her on a couch far across the room, where there was no light save what the gleaming floor bounced in from the hall.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001608": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001609": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When Klipspringer had played “The Love Nest” he turned around on the bench and searched unhappily for Gatsby in the gloom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001610": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001611": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m all out of practice, you see. I told you I couldn’t play. I’m all out of prac—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001612": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001613": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t talk so much, old sport,” commanded Gatsby. “Play!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001614": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001615": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001616": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div><p><span>“In the morning,</span><br>\n<span>In the evening,</span><br>\n<span class=\"i1\">Ain’t we got fun—”</span></p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001617": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001618": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001619": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Outside the wind was loud and there was a faint flow of thunder along the Sound. All the lights were going on in West Egg now; the electric trains, men-carrying, were plunging home through the rain from New York. It was the hour of a profound human change, and excitement was generating on the air.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001620": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001621": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001622": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div><p><span>“One thing’s sure and nothing’s surer</span><br>\n<span>The rich get richer and the poor get—children.</span><br>\n<span class=\"i2\">In the meantime,</span><br>\n<span class=\"i2\">In between time—”</span></p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001623": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote class=\"verse\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001624": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001625": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As I went over to say goodbye I saw that the expression of bewilderment had come back into Gatsby’s face, as though a faint doubt had occurred to him as to the quality of his present happiness. Almost five years! There must have been moments even that afternoon when Daisy tumbled short of his dreams—not through her own fault, but because of the colossal vitality of his illusion. It had gone beyond her, beyond everything. He had thrown himself into it with a creative passion, adding to it all the time, decking it out with every bright feather that drifted his way. No amount of fire or freshness can challenge what a man can store up in his ghostly heart.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001626": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001627": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As I watched him he adjusted himself a little, visibly. His hand took hold of hers, and as she said something low in his ear he turned toward her with a rush of emotion. I think that voice held him most, with its fluctuating, feverish warmth, because it couldn’t be over-dreamed—that voice was a deathless song.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001628": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001629": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They had forgotten me, but Daisy glanced up and held out her hand; Gatsby didn’t know me now at all. I looked once more at them and they looked back at me, remotely, possessed by intense life. Then I went out of the room and down the marble steps into the rain, leaving them there together.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001630": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001631": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001632": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>VI</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001633": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001634": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>About this time an ambitious young reporter from New York arrived one morning at Gatsby’s door and asked him if he had anything to say.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001635": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001636": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Anything to say about what?” inquired Gatsby politely.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001637": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001638": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why—any statement to give out.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001639": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001640": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It transpired after a confused five minutes that the man had heard Gatsby’s name around his office in a connection which he either wouldn’t reveal or didn’t fully understand. This was his day off and with laudable initiative he had hurried out “to see.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001641": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001642": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was a random shot, and yet the reporter’s instinct was right. Gatsby’s notoriety, spread about by the hundreds who had accepted his hospitality and so become authorities upon his past, had increased all summer until he fell just short of being news. Contemporary legends such as the “underground pipeline to Canada” attached themselves to him, and there was one persistent story that he didn’t live in a house at all, but in a boat that looked like a house and was moved secretly up and down the Long Island shore. Just why these inventions were a source of satisfaction to James Gatz of North Dakota, isn’t easy to say.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001643": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001644": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>James Gatz—that was really, or at least legally, his name. He had changed it at the age of seventeen and at the specific moment that witnessed the beginning of his career—when he saw Dan Cody’s yacht drop anchor over the most insidious flat on Lake Superior. It was James Gatz who had been loafing along the beach that afternoon in a torn green jersey and a pair of canvas pants, but it was already Jay Gatsby who borrowed a rowboat, pulled out to the <i>Tuolomee</i>, and informed Cody that a wind might catch him and break him up in half an hour.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001645": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001646": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I suppose he’d had the name ready for a long time, even then. His parents were shiftless and unsuccessful farm people—his imagination had never really accepted them as his parents at all. The truth was that Jay Gatsby of West Egg, Long Island, sprang from his Platonic conception of himself. He was a son of God—a phrase which, if it means anything, means just that—and he must be about His Father’s business, the service of a vast, vulgar, and meretricious beauty. So he invented just the sort of Jay Gatsby that a seventeen-year-old boy would be likely to invent, and to this conception he was faithful to the end.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001647": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001648": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001648",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For over a year he had been beating his way along the south shore of Lake Superior as a clam-digger and a salmon-fisher or in any other capacity that brought him food and bed. His brown, hardening body lived naturally through the half-fierce, half-lazy work of the bracing days. He knew women early, and since they spoiled him he became contemptuous of them, of young virgins because they were ignorant, of the others because they were hysterical about things which in his overwhelming self-absorption he took for granted.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001649": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001649",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001650": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001650",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But his heart was in a constant, turbulent riot. The most grotesque and fantastic conceits haunted him in his bed at night. A universe of ineffable gaudiness spun itself out in his brain while the clock ticked on the washstand and the moon soaked with wet light his tangled clothes upon the floor. Each night he added to the pattern of his fancies until drowsiness closed down upon some vivid scene with an oblivious embrace. For a while these reveries provided an outlet for his imagination; they were a satisfactory hint of the unreality of reality, a promise that the rock of the world was founded securely on a fairy’s wing.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001651": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001651",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001652": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001652",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>An instinct toward his future glory had led him, some months before, to the small Lutheran College of St. Olaf’s in southern Minnesota. He stayed there two weeks, dismayed at its ferocious indifference to the drums of his destiny, to destiny itself, and despising the janitor’s work with which he was to pay his way through. Then he drifted back to Lake Superior, and he was still searching for something to do on the day that Dan Cody’s yacht dropped anchor in the shallows alongshore.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001653": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001653",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001654": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001654",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Cody was fifty years old then, a product of the Nevada silver fields, of the Yukon, of every rush for metal since seventy-five. The transactions in Montana copper that made him many times a millionaire found him physically robust but on the verge of soft-mindedness, and, suspecting this, an infinite number of women tried to separate him from his money. The none too savoury ramifications by which Ella Kaye, the newspaper woman, played Madame de Maintenon to his weakness and sent him to sea in a yacht, were common property of the turgid journalism in 1902. He had been coasting along all too hospitable shores for five years when he turned up as James Gatz’s destiny in Little Girl Bay.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001655": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001655",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001656": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001656",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>To young Gatz, resting on his oars and looking up at the railed deck, that yacht represented all the beauty and glamour in the world. I suppose he smiled at Cody—he had probably discovered that people liked him when he smiled. At any rate Cody asked him a few questions (one of them elicited the brand new name) and found that he was quick and extravagantly ambitious. A few days later he took him to Duluth and bought him a blue coat, six pairs of white duck trousers, and a yachting cap. And when the <i>Tuolomee</i> left for the West Indies and the Barbary Coast, Gatsby left too.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001657": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001657",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001658": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001658",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He was employed in a vague personal capacity—while he remained with Cody he was in turn steward, mate, skipper, secretary, and even jailor, for Dan Cody sober knew what lavish doings Dan Cody drunk might soon be about, and he provided for such contingencies by reposing more and more trust in Gatsby. The arrangement lasted five years, during which the boat went three times around the Continent. It might have lasted indefinitely except for the fact that Ella Kaye came on board one night in Boston and a week later Dan Cody inhospitably died.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001659": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001659",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001660": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001660",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I remember the portrait of him up in Gatsby’s bedroom, a grey, florid man with a hard, empty face—the pioneer debauchee, who during one phase of American life brought back to the Eastern seaboard the savage violence of the frontier brothel and saloon. It was indirectly due to Cody that Gatsby drank so little. Sometimes in the course of gay parties women used to rub champagne into his hair; for himself he formed the habit of letting liquor alone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001661": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001661",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001662": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001662",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>And it was from Cody that he inherited money—a legacy of twenty-five thousand dollars. He didn’t get it. He never understood the legal device that was used against him, but what remained of the millions went intact to Ella Kaye. He was left with his singularly appropriate education; the vague contour of Jay Gatsby had filled out to the substantiality of a man.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001663": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001663",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001664": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001664",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He told me all this very much later, but I’ve put it down here with the idea of exploding those first wild rumours about his antecedents, which weren’t even faintly true. Moreover he told it to me at a time of confusion, when I had reached the point of believing everything and nothing about him. So I take advantage of this short halt, while Gatsby, so to speak, caught his breath, to clear this set of misconceptions away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001665": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001665",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001666": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001666",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was a halt, too, in my association with his affairs. For several weeks I didn’t see him or hear his voice on the phone—mostly I was in New York, trotting around with Jordan and trying to ingratiate myself with her senile aunt—but finally I went over to his house one Sunday afternoon. I hadn’t been there two minutes when somebody brought Tom Buchanan in for a drink. I was startled, naturally, but the really surprising thing was that it hadn’t happened before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001667": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001667",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001668": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001668",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They were a party of three on horseback—Tom and a man named Sloane and a pretty woman in a brown riding-habit, who had been there previously.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001669": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001669",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001670": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001670",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m delighted to see you,” said Gatsby, standing on his porch. “I’m delighted that you dropped in.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001671": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001671",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001672": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001672",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As though they cared!</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001673": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001673",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001674": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001674",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Sit right down. Have a cigarette or a cigar.” He walked around the room quickly, ringing bells. “I’ll have something to drink for you in just a minute.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001675": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001675",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001676": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001676",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He was profoundly affected by the fact that Tom was there. But he would be uneasy anyhow until he had given them something, realizing in a vague way that that was all they came for. Mr. Sloane wanted nothing. A lemonade? No, thanks. A little champagne? Nothing at all, thanks… I’m sorry—</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001677": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001677",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001678": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001678",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you have a nice ride?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001679": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001679",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001680": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001680",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Very good roads around here.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001681": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001681",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001682": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001682",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I suppose the automobiles—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001683": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001683",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001684": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001684",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yeah.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001685": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001685",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001686": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001686",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Moved by an irresistible impulse, Gatsby turned to Tom, who had accepted the introduction as a stranger.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001687": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001687",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001688": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001688",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I believe we’ve met somewhere before, Mr. Buchanan.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001689": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001689",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001690": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001690",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, yes,” said Tom, gruffly polite, but obviously not remembering. “So we did. I remember very well.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001691": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001691",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001692": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001692",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“About two weeks ago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001693": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001693",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001694": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001694",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s right. You were with Nick here.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001695": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001695",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001696": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001696",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I know your wife,” continued Gatsby, almost aggressively.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001697": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001697",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001698": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001698",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That so?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001699": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001699",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001700": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001700",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom turned to me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001701": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001701",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001702": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001702",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You live near here, Nick?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001703": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001703",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001704": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001704",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Next door.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001705": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001705",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001706": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001706",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That so?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001707": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001707",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001708": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001708",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Mr. Sloane didn’t enter into the conversation, but lounged back haughtily in his chair; the woman said nothing either—until unexpectedly, after two highballs, she became cordial.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001709": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001709",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001710": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001710",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ll all come over to your next party, Mr. Gatsby,” she suggested. “What do you say?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001711": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001711",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001712": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001712",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Certainly; I’d be delighted to have you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001713": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001713",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001714": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001714",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Be ver’ nice,” said Mr. Sloane, without gratitude. “Well—think ought to be starting home.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001715": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001715",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001716": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001716",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Please don’t hurry,” Gatsby urged them. He had control of himself now, and he wanted to see more of Tom. “Why don’t you—why don’t you stay for supper? I wouldn’t be surprised if some other people dropped in from New York.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001717": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001717",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001718": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001718",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You come to supper with <i>me</i>,” said the lady enthusiastically. “Both of you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001719": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001719",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001720": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001720",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>This included me. Mr. Sloane got to his feet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001721": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001721",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001722": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001722",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come along,” he said—but to her only.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001723": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001723",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001724": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001724",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I mean it,” she insisted. “I’d love to have you. Lots of room.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001725": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001725",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001726": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001726",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby looked at me questioningly. He wanted to go and he didn’t see that Mr. Sloane had determined he shouldn’t.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001727": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001727",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001728": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001728",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m afraid I won’t be able to,” I said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001729": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001729",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001730": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001730",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, you come,” she urged, concentrating on Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001731": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001731",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001732": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001732",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Mr. Sloane murmured something close to her ear.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001733": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001733",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001734": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001734",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We won’t be late if we start now,” she insisted aloud.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001735": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001735",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001736": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001736",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I haven’t got a horse,” said Gatsby. “I used to ride in the army, but I’ve never bought a horse. I’ll have to follow you in my car. Excuse me for just a minute.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001737": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001737",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001738": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001738",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The rest of us walked out on the porch, where Sloane and the lady began an impassioned conversation aside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001739": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001739",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001740": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001740",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“My God, I believe the man’s coming,” said Tom. “Doesn’t he know she doesn’t want him?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001741": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001741",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001742": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001742",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She says she does want him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001743": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001743",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001744": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001744",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She has a big dinner party and he won’t know a soul there.” He frowned. “I wonder where in the devil he met Daisy. By God, I may be old-fashioned in my ideas, but women run around too much these days to suit me. They meet all kinds of crazy fish.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001745": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001745",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001746": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001746",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Suddenly Mr. Sloane and the lady walked down the steps and mounted their horses.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001747": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001747",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001748": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001748",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come on,” said Mr. Sloane to Tom, “we’re late. We’ve got to go.” And then to me: “Tell him we couldn’t wait, will you?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001749": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001749",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001750": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001750",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom and I shook hands, the rest of us exchanged a cool nod, and they trotted quickly down the drive, disappearing under the August foliage just as Gatsby, with hat and light overcoat in hand, came out the front door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001751": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001751",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001752": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001752",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom was evidently perturbed at Daisy’s running around alone, for on the following Saturday night he came with her to Gatsby’s party. Perhaps his presence gave the evening its peculiar quality of oppressiveness—it stands out in my memory from Gatsby’s other parties that summer. There were the same people, or at least the same sort of people, the same profusion of champagne, the same many-coloured, many-keyed commotion, but I felt an unpleasantness in the air, a pervading harshness that hadn’t been there before. Or perhaps I had merely grown used to it, grown to accept West Egg as a world complete in itself, with its own standards and its own great figures, second to nothing because it had no consciousness of being so, and now I was looking at it again, through Daisy’s eyes. It is invariably saddening to look through new eyes at things upon which you have expended your own powers of adjustment.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001753": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001753",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001754": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001754",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They arrived at twilight, and, as we strolled out among the sparkling hundreds, Daisy’s voice was playing murmurous tricks in her throat.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001755": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001755",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001756": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001756",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“These things excite me <i>so</i>,” she whispered. “If you want to kiss me any time during the evening, Nick, just let me know and I’ll be glad to arrange it for you. Just mention my name. Or present a green card. I’m giving out green—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001757": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001757",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001758": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001758",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look around,” suggested Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001759": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001759",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001760": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001760",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m looking around. I’m having a marvellous—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001761": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001761",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001762": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001762",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You must see the faces of many people you’ve heard about.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001763": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001763",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001764": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001764",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom’s arrogant eyes roamed the crowd.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001765": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001765",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001766": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001766",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We don’t go around very much,” he said; “in fact, I was just thinking I don’t know a soul here.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001767": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001767",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001768": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001768",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Perhaps you know that lady.” Gatsby indicated a gorgeous, scarcely human orchid of a woman who sat in state under a white-plum tree. Tom and Daisy stared, with that peculiarly unreal feeling that accompanies the recognition of a hitherto ghostly celebrity of the movies.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001769": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001769",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001770": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001770",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s lovely,” said Daisy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001771": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001771",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001772": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001772",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The man bending over her is her director.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001773": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001773",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001774": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001774",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He took them ceremoniously from group to group:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001775": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001775",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001776": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001776",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Mrs. Buchanan… and Mr. Buchanan—” After an instant’s hesitation he added: “the polo player.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001777": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001777",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001778": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001778",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh no,” objected Tom quickly, “not me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001779": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001779",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001780": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001780",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But evidently the sound of it pleased Gatsby for Tom remained “the polo player” for the rest of the evening.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001781": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001781",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001782": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001782",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve never met so many celebrities,” Daisy exclaimed. “I liked that man—what was his name?—with the sort of blue nose.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001783": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001783",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001784": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001784",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby identified him, adding that he was a small producer.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001785": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001785",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001786": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001786",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I liked him anyhow.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001787": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001787",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001788": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001788",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’d a little rather not be the polo player,” said Tom pleasantly, “I’d rather look at all these famous people in—in oblivion.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001789": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001789",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001790": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001790",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy and Gatsby danced. I remember being surprised by his graceful, conservative foxtrot—I had never seen him dance before. Then they sauntered over to my house and sat on the steps for half an hour, while at her request I remained watchfully in the garden. “In case there’s a fire or a flood,” she explained, “or any act of God.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001791": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001791",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001792": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001792",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom appeared from his oblivion as we were sitting down to supper together. “Do you mind if I eat with some people over here?” he said. “A fellow’s getting off some funny stuff.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001793": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001793",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001794": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001794",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Go ahead,” answered Daisy genially, “and if you want to take down any addresses here’s my little gold pencil.”… She looked around after a moment and told me the girl was “common but pretty,” and I knew that except for the half-hour she’d been alone with Gatsby she wasn’t having a good time.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001795": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001795",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001796": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001796",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We were at a particularly tipsy table. That was my fault—Gatsby had been called to the phone, and I’d enjoyed these same people only two weeks before. But what had amused me then turned septic on the air now.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001797": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001797",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001798": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001798",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How do you feel, Miss Baedeker?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001799": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001799",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001800": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001800",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The girl addressed was trying, unsuccessfully, to slump against my shoulder. At this inquiry she sat up and opened her eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001801": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001801",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001802": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001802",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wha’?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001803": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001803",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001804": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001804",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A massive and lethargic woman, who had been urging Daisy to play golf with her at the local club tomorrow, spoke in Miss Baedeker’s defence:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001805": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001805",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001806": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001806",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, she’s all right now. When she’s had five or six cocktails she always starts screaming like that. I tell her she ought to leave it alone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001807": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001807",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001808": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001808",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I do leave it alone,” affirmed the accused hollowly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001809": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001809",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001810": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001810",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We heard you yelling, so I said to Doc Civet here: ‘There’s somebody that needs your help, Doc.’ ”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001811": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001811",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001812": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001812",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s much obliged, I’m sure,” said another friend, without gratitude, “but you got her dress all wet when you stuck her head in the pool.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001813": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001813",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001814": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001814",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Anything I hate is to get my head stuck in a pool,” mumbled Miss Baedeker. “They almost drowned me once over in New Jersey.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001815": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001815",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001816": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001816",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Then you ought to leave it alone,” countered Doctor Civet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001817": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001817",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001818": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001818",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Speak for yourself!” cried Miss Baedeker violently. “Your hand shakes. I wouldn’t let you operate on me!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001819": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001819",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001820": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001820",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was like that. Almost the last thing I remember was standing with Daisy and watching the moving-picture director and his Star. They were still under the white-plum tree and their faces were touching except for a pale, thin ray of moonlight between. It occurred to me that he had been very slowly bending toward her all evening to attain this proximity, and even while I watched I saw him stoop one ultimate degree and kiss at her cheek.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001821": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001821",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001822": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001822",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I like her,” said Daisy, “I think she’s lovely.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001823": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001823",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001824": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001824",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But the rest offended her—and inarguably because it wasn’t a gesture but an emotion. She was appalled by West Egg, this unprecedented “place” that Broadway had begotten upon a Long Island fishing village—appalled by its raw vigour that chafed under the old euphemisms and by the too obtrusive fate that herded its inhabitants along a shortcut from nothing to nothing. She saw something awful in the very simplicity she failed to understand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001825": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001825",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001826": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001826",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I sat on the front steps with them while they waited for their car. It was dark here in front; only the bright door sent ten square feet of light volleying out into the soft black morning. Sometimes a shadow moved against a dressing-room blind above, gave way to another shadow, an indefinite procession of shadows, who rouged and powdered in an invisible glass.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001827": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001827",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001828": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001828",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who is this Gatsby anyhow?” demanded Tom suddenly. “Some big bootlegger?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001829": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001829",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001830": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001830",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where’d you hear that?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001831": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001831",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001832": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001832",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I didn’t hear it. I imagined it. A lot of these newly rich people are just big bootleggers, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001833": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001833",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001834": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001834",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Not Gatsby,” I said shortly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001835": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001835",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001836": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001836",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He was silent for a moment. The pebbles of the drive crunched under his feet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001837": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001837",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001838": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001838",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, he certainly must have strained himself to get this menagerie together.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001839": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001839",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001840": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001840",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A breeze stirred the grey haze of Daisy’s fur collar.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001841": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001841",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001842": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001842",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“At least they are more interesting than the people we know,” she said with an effort.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001843": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001843",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001844": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001844",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You didn’t look so interested.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001845": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001845",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001846": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001846",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I was.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001847": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001847",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001848": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001848",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom laughed and turned to me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001849": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001849",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001850": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001850",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you notice Daisy’s face when that girl asked her to put her under a cold shower?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001851": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001851",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001852": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001852",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy began to sing with the music in a husky, rhythmic whisper, bringing out a meaning in each word that it had never had before and would never have again. When the melody rose her voice broke up sweetly, following it, in a way contralto voices have, and each change tipped out a little of her warm human magic upon the air.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001853": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001853",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001854": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001854",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Lots of people come who haven’t been invited,” she said suddenly. “That girl hadn’t been invited. They simply force their way in and he’s too polite to object.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001855": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001855",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001856": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001856",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’d like to know who he is and what he does,” insisted Tom. “And I think I’ll make a point of finding out.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001857": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001857",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001858": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001858",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I can tell you right now,” she answered. “He owned some drugstores, a lot of drugstores. He built them up himself.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001859": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001859",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001860": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001860",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The dilatory limousine came rolling up the drive.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001861": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001861",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001862": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001862",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Good night, Nick,” said Daisy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001863": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001863",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001864": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001864",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her glance left me and sought the lighted top of the steps, where “Three O’Clock in the Morning,” a neat, sad little waltz of that year, was drifting out the open door. After all, in the very casualness of Gatsby’s party there were romantic possibilities totally absent from her world. What was it up there in the song that seemed to be calling her back inside? What would happen now in the dim, incalculable hours? Perhaps some unbelievable guest would arrive, a person infinitely rare and to be marvelled at, some authentically radiant young girl who with one fresh glance at Gatsby, one moment of magical encounter, would blot out those five years of unwavering devotion.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001865": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001865",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001866": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001866",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I stayed late that night. Gatsby asked me to wait until he was free, and I lingered in the garden until the inevitable swimming party had run up, chilled and exalted, from the black beach, until the lights were extinguished in the guestrooms overhead. When he came down the steps at last the tanned skin was drawn unusually tight on his face, and his eyes were bright and tired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001867": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001867",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001868": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001868",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She didn’t like it,” he said immediately.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001869": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001869",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001870": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001870",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course she did.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001871": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001871",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001872": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001872",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She didn’t like it,” he insisted. “She didn’t have a good time.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001873": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001873",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001874": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001874",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He was silent, and I guessed at his unutterable depression.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001875": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001875",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001876": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001876",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I feel far away from her,” he said. “It’s hard to make her understand.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001877": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001877",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001878": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001878",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You mean about the dance?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001879": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001879",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001880": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001880",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The dance?” He dismissed all the dances he had given with a snap of his fingers. “Old sport, the dance is unimportant.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001881": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001881",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001882": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001882",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He wanted nothing less of Daisy than that she should go to Tom and say: “I never loved you.” After she had obliterated four years with that sentence they could decide upon the more practical measures to be taken. One of them was that, after she was free, they were to go back to Louisville and be married from her house—just as if it were five years ago.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001883": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001883",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001884": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001884",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“And she doesn’t understand,” he said. “She used to be able to understand. We’d sit for hours—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001885": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001885",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001886": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001886",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He broke off and began to walk up and down a desolate path of fruit rinds and discarded favours and crushed flowers.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001887": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001887",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001888": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001888",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I wouldn’t ask too much of her,” I ventured. “You can’t repeat the past.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001889": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001889",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001890": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001890",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Can’t repeat the past?” he cried incredulously. “Why of course you can!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001891": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001891",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001892": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001892",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He looked around him wildly, as if the past were lurking here in the shadow of his house, just out of reach of his hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001893": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001893",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001894": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001894",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m going to fix everything just the way it was before,” he said, nodding determinedly. “She’ll see.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001895": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001895",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001896": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001896",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He talked a lot about the past, and I gathered that he wanted to recover something, some idea of himself perhaps, that had gone into loving Daisy. His life had been confused and disordered since then, but if he could once return to a certain starting place and go over it all slowly, he could find out what that thing was…</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001897": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001897",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001898": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001898",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>… One autumn night, five years before, they had been walking down the street when the leaves were falling, and they came to a place where there were no trees and the sidewalk was white with moonlight. They stopped here and turned toward each other. Now it was a cool night with that mysterious excitement in it which comes at the two changes of the year. The quiet lights in the houses were humming out into the darkness and there was a stir and bustle among the stars. Out of the corner of his eye Gatsby saw that the blocks of the sidewalks really formed a ladder and mounted to a secret place above the trees—he could climb to it, if he climbed alone, and once there he could suck on the pap of life, gulp down the incomparable milk of wonder.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001899": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001899",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001900": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001900",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His heart beat faster as Daisy’s white face came up to his own. He knew that when he kissed this girl, and forever wed his unutterable visions to her perishable breath, his mind would never romp again like the mind of God. So he waited, listening for a moment longer to the tuning-fork that had been struck upon a star. Then he kissed her. At his lips’ touch she blossomed for him like a flower and the incarnation was complete.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001901": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001901",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001902": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001902",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Through all he said, even through his appalling sentimentality, I was reminded of something—an elusive rhythm, a fragment of lost words, that I had heard somewhere a long time ago. For a moment a phrase tried to take shape in my mouth and my lips parted like a dumb man’s, as though there was more struggling upon them than a wisp of startled air. But they made no sound, and what I had almost remembered was uncommunicable forever.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001903": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001903",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001904": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001904",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001905": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001905",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>VII</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001906": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001906",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001907": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001907",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was when curiosity about Gatsby was at its highest that the lights in his house failed to go on one Saturday night—and, as obscurely as it had begun, his career as Trimalchio was over. Only gradually did I become aware that the automobiles which turned expectantly into his drive stayed for just a minute and then drove sulkily away. Wondering if he were sick I went over to find out—an unfamiliar butler with a villainous face squinted at me suspiciously from the door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001908": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001908",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001909": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001909",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is Mr. Gatsby sick?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001910": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001910",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001911": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001911",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nope.” After a pause he added “sir” in a dilatory, grudging way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001912": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001912",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001913": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001913",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I hadn’t seen him around, and I was rather worried. Tell him Mr. Carraway came over.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001914": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001914",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001915": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001915",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who?” he demanded rudely.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001916": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001916",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001917": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001917",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Carraway.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001918": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001918",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001919": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001919",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Carraway. All right, I’ll tell him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001920": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001920",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001921": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001921",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Abruptly he slammed the door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001922": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001922",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001923": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001923",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>My Finn informed me that Gatsby had dismissed every servant in his house a week ago and replaced them with half a dozen others, who never went into West Egg village to be bribed by the tradesmen, but ordered moderate supplies over the telephone. The grocery boy reported that the kitchen looked like a pigsty, and the general opinion in the village was that the new people weren’t servants at all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001924": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001924",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001925": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001925",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Next day Gatsby called me on the phone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001926": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001926",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001927": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001927",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Going away?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001928": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001928",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001929": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001929",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001930": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001930",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001931": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001931",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I hear you fired all your servants.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001932": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001932",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001933": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001933",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I wanted somebody who wouldn’t gossip. Daisy comes over quite often—in the afternoons.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001934": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001934",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001935": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001935",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>So the whole caravansary had fallen in like a card house at the disapproval in her eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001936": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001936",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001937": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001937",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They’re some people Wolfshiem wanted to do something for. They’re all brothers and sisters. They used to run a small hotel.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001938": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001938",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001939": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001939",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I see.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001940": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001940",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001941": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001941",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He was calling up at Daisy’s request—would I come to lunch at her house tomorrow? Miss Baker would be there. Half an hour later Daisy herself telephoned and seemed relieved to find that I was coming. Something was up. And yet I couldn’t believe that they would choose this occasion for a scene—especially for the rather harrowing scene that Gatsby had outlined in the garden.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001942": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001942",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001943": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001943",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The next day was broiling, almost the last, certainly the warmest, of the summer. As my train emerged from the tunnel into sunlight, only the hot whistles of the National Biscuit Company broke the simmering hush at noon. The straw seats of the car hovered on the edge of combustion; the woman next to me perspired delicately for a while into her white shirtwaist, and then, as her newspaper dampened under her fingers, lapsed despairingly into deep heat with a desolate cry. Her pocketbook slapped to the floor.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001944": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001944",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001945": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001945",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, my!” she gasped.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001946": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001946",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001947": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001947",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I picked it up with a weary bend and handed it back to her, holding it at arm’s length and by the extreme tip of the corners to indicate that I had no designs upon it—but everyone near by, including the woman, suspected me just the same.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001948": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001948",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001949": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001949",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hot!” said the conductor to familiar faces. “Some weather!… Hot!… Hot!… Hot!… Is it hot enough for you? Is it hot? Is it… ?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001950": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001950",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001951": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001951",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>My commutation ticket came back to me with a dark stain from his hand. That anyone should care in this heat whose flushed lips he kissed, whose head made damp the pyjama pocket over his heart!</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001952": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001952",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001953": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001953",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>… Through the hall of the Buchanans’ house blew a faint wind, carrying the sound of the telephone bell out to Gatsby and me as we waited at the door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001954": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001954",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001955": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001955",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The master’s body?” roared the butler into the mouthpiece. “I’m sorry, madame, but we can’t furnish it—it’s far too hot to touch this noon!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001956": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001956",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001957": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001957",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>What he really said was: “Yes… Yes… I’ll see.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001958": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001958",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001959": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001959",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He set down the receiver and came toward us, glistening slightly, to take our stiff straw hats.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001960": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001960",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001961": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001961",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Madame expects you in the salon!” he cried, needlessly indicating the direction. In this heat every extra gesture was an affront to the common store of life.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001962": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001962",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001963": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001963",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The room, shadowed well with awnings, was dark and cool. Daisy and Jordan lay upon an enormous couch, like silver idols weighing down their own white dresses against the singing breeze of the fans.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001964": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001964",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001965": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001965",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We can’t move,” they said together.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001966": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001966",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001967": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001967",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Jordan’s fingers, powdered white over their tan, rested for a moment in mine.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001968": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001968",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001969": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001969",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“And Mr. Thomas Buchanan, the athlete?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001970": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001970",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001971": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001971",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Simultaneously I heard his voice, gruff, muffled, husky, at the hall telephone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001972": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001972",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001973": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001973",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby stood in the centre of the crimson carpet and gazed around with fascinated eyes. Daisy watched him and laughed, her sweet, exciting laugh; a tiny gust of powder rose from her bosom into the air.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001974": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001974",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001975": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001975",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The rumour is,” whispered Jordan, “that that’s Tom’s girl on the telephone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001976": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001976",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001977": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001977",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We were silent. The voice in the hall rose high with annoyance: “Very well, then, I won’t sell you the car at all… I’m under no obligations to you at all… and as for your bothering me about it at lunch time, I won’t stand that at all!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001978": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001978",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001979": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001979",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Holding down the receiver,” said Daisy cynically.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001980": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001980",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001981": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001981",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, he’s not,” I assured her. “It’s a bona-fide deal. I happen to know about it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001982": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001982",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001983": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001983",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom flung open the door, blocked out its space for a moment with his thick body, and hurried into the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001984": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001984",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001985": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001985",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Mr. Gatsby!” He put out his broad, flat hand with well-concealed dislike. “I’m glad to see you, sir… Nick…”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001986": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001986",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001987": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001987",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Make us a cold drink,” cried Daisy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001988": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001988",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001989": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001989",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As he left the room again she got up and went over to Gatsby and pulled his face down, kissing him on the mouth.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001990": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001990",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001991": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001991",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You know I love you,” she murmured.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001992": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001992",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001993": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001993",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You forget there’s a lady present,” said Jordan.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001994": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001994",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001995": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001995",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy looked around doubtfully.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001996": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001996",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001997": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001997",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You kiss Nick too.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001998": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001998",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000001999": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000001999",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What a low, vulgar girl!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002000": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002000",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002001": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002001",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t care!” cried Daisy, and began to clog on the brick fireplace. Then she remembered the heat and sat down guiltily on the couch just as a freshly laundered nurse leading a little girl came into the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002002": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002002",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002003": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002003",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Bles-sed pre-cious,” she crooned, holding out her arms. “Come to your own mother that loves you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002004": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002004",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002005": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002005",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The child, relinquished by the nurse, rushed across the room and rooted shyly into her mother’s dress.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002006": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002006",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002007": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The bles-sed pre-cious! Did mother get powder on your old yellowy hair? Stand up now, and say—How-de-do.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002008": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002008",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002009": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby and I in turn leaned down and took the small reluctant hand. Afterward he kept looking at the child with surprise. I don’t think he had ever really believed in its existence before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002010": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002011": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I got dressed before luncheon,” said the child, turning eagerly to Daisy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002012": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002013": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s because your mother wanted to show you off.” Her face bent into the single wrinkle of the small white neck. “You dream, you. You absolute little dream.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002014": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002015": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes,” admitted the child calmly. “Aunt Jordan’s got on a white dress too.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002016": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002017": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How do you like mother’s friends?” Daisy turned her around so that she faced Gatsby. “Do you think they’re pretty?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002018": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002019": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where’s Daddy?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002020": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002021": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She doesn’t look like her father,” explained Daisy. “She looks like me. She’s got my hair and shape of the face.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002022": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002023": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy sat back upon the couch. The nurse took a step forward and held out her hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002024": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002025": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come, Pammy.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002026": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002027": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Goodbye, sweetheart!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002028": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002029": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>With a reluctant backward glance the well-disciplined child held to her nurse’s hand and was pulled out the door, just as Tom came back, preceding four gin rickeys that clicked full of ice.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002030": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002031": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby took up his drink.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002032": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002033": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They certainly look cool,” he said, with visible tension.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002034": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002035": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We drank in long, greedy swallows.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002036": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002037": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I read somewhere that the sun’s getting hotter every year,” said Tom genially. “It seems that pretty soon the earth’s going to fall into the sun—or wait a minute—it’s just the opposite—the sun’s getting colder every year.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002038": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002039": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come outside,” he suggested to Gatsby, “I’d like you to have a look at the place.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002040": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002041": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I went with them out to the veranda. On the green Sound, stagnant in the heat, one small sail crawled slowly toward the fresher sea. Gatsby’s eyes followed it momentarily; he raised his hand and pointed across the bay.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002042": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002043": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m right across from you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002044": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002045": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“So you are.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002046": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002047": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Our eyes lifted over the rose-beds and the hot lawn and the weedy refuse of the dog-days alongshore. Slowly the white wings of the boat moved against the blue cool limit of the sky. Ahead lay the scalloped ocean and the abounding blessed isles.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002048": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002049": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There’s sport for you,” said Tom, nodding. “I’d like to be out there with him for about an hour.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002050": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002051": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We had luncheon in the dining-room, darkened too against the heat, and drank down nervous gaiety with the cold ale.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002052": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002053": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’ll we do with ourselves this afternoon?” cried Daisy, “and the day after that, and the next thirty years?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002054": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002055": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t be morbid,” Jordan said. “Life starts all over again when it gets crisp in the fall.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002056": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002057": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But it’s so hot,” insisted Daisy, on the verge of tears, “and everything’s so confused. Let’s all go to town!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002058": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002059": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her voice struggled on through the heat, beating against it, moulding its senselessness into forms.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002060": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002061": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve heard of making a garage out of a stable,” Tom was saying to Gatsby, “but I’m the first man who ever made a stable out of a garage.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002062": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002063": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who wants to go to town?” demanded Daisy insistently. Gatsby’s eyes floated toward her. “Ah,” she cried, “you look so cool.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002064": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002065": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Their eyes met, and they stared together at each other, alone in space. With an effort she glanced down at the table.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002066": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002067": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You always look so cool,” she repeated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002068": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002069": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She had told him that she loved him, and Tom Buchanan saw. He was astounded. His mouth opened a little, and he looked at Gatsby, and then back at Daisy as if he had just recognized her as someone he knew a long time ago.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002070": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002071": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You resemble the advertisement of the man,” she went on innocently. “You know the advertisement of the man—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002072": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002073": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All right,” broke in Tom quickly, “I’m perfectly willing to go to town. Come on—we’re all going to town.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002074": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002075": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He got up, his eyes still flashing between Gatsby and his wife. No one moved.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002076": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002077": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come on!” His temper cracked a little. “What’s the matter, anyhow? If we’re going to town, let’s start.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002078": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002079": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His hand, trembling with his effort at self-control, bore to his lips the last of his glass of ale. Daisy’s voice got us to our feet and out on to the blazing gravel drive.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002080": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002081": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Are we just going to go?” she objected. “Like this? Aren’t we going to let anyone smoke a cigarette first?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002082": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002083": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Everybody smoked all through lunch.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002084": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002085": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, let’s have fun,” she begged him. “It’s too hot to fuss.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002086": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002087": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He didn’t answer.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002088": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002089": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Have it your own way,” she said. “Come on, Jordan.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002090": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002091": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They went upstairs to get ready while we three men stood there shuffling the hot pebbles with our feet. A silver curve of the moon hovered already in the western sky. Gatsby started to speak, changed his mind, but not before Tom wheeled and faced him expectantly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002092": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002093": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Have you got your stables here?” asked Gatsby with an effort.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002094": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002095": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“About a quarter of a mile down the road.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002096": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002097": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002098": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002099": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A pause.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002100": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002101": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t see the idea of going to town,” broke out Tom savagely. “Women get these notions in their heads—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002102": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002103": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Shall we take anything to drink?” called Daisy from an upper window.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002104": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002105": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll get some whisky,” answered Tom. He went inside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002106": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002107": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby turned to me rigidly:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002108": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002109": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I can’t say anything in his house, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002110": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002111": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s got an indiscreet voice,” I remarked. “It’s full of—” I hesitated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002112": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002113": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Her voice is full of money,” he said suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002114": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002115": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That was it. I’d never understood before. It was full of money—that was the inexhaustible charm that rose and fell in it, the jingle of it, the cymbals’ song of it… High in a white palace the king’s daughter, the golden girl…</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002116": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002117": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom came out of the house wrapping a quart bottle in a towel, followed by Daisy and Jordan wearing small tight hats of metallic cloth and carrying light capes over their arms.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002118": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002119": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Shall we all go in my car?” suggested Gatsby. He felt the hot, green leather of the seat. “I ought to have left it in the shade.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002120": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002121": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is it standard shift?” demanded Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002122": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002123": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002124": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002125": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, you take my coupé and let me drive your car to town.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002126": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002127": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The suggestion was distasteful to Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002128": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002129": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t think there’s much gas,” he objected.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002130": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002131": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Plenty of gas,” said Tom boisterously. He looked at the gauge. “And if it runs out I can stop at a drugstore. You can buy anything at a drugstore nowadays.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002132": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002133": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A pause followed this apparently pointless remark. Daisy looked at Tom frowning, and an indefinable expression, at once definitely unfamiliar and vaguely recognizable, as if I had only heard it described in words, passed over Gatsby’s face.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002134": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002135": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come on, Daisy” said Tom, pressing her with his hand toward Gatsby’s car. “I’ll take you in this circus wagon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002136": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002137": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He opened the door, but she moved out from the circle of his arm.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002138": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002139": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You take Nick and Jordan. We’ll follow you in the coupé.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002140": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002141": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She walked close to Gatsby, touching his coat with her hand. Jordan and Tom and I got into the front seat of Gatsby’s car, Tom pushed the unfamiliar gears tentatively, and we shot off into the oppressive heat, leaving them out of sight behind.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002142": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002143": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you see that?” demanded Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002144": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002145": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“See what?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002146": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002147": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He looked at me keenly, realizing that Jordan and I must have known all along.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002148": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002149": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You think I’m pretty dumb, don’t you?” he suggested. “Perhaps I am, but I have a—almost a second sight, sometimes, that tells me what to do. Maybe you don’t believe that, but science—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002150": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002151": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He paused. The immediate contingency overtook him, pulled him back from the edge of theoretical abyss.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002152": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002153": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve made a small investigation of this fellow,” he continued. “I could have gone deeper if I’d known—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002154": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002155": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do you mean you’ve been to a medium?” inquired Jordan humorously.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002156": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002157": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What?” Confused, he stared at us as we laughed. “A medium?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002158": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002159": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“About Gatsby.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002160": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002161": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“About Gatsby! No, I haven’t. I said I’d been making a small investigation of his past.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002162": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002163": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“And you found he was an Oxford man,” said Jordan helpfully.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002164": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002165": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“An Oxford man!” He was incredulous. “Like hell he is! He wears a pink suit.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002166": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002167": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nevertheless he’s an Oxford man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002168": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002169": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oxford, New Mexico,” snorted Tom contemptuously, “or something like that.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002170": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002171": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Listen, Tom. If you’re such a snob, why did you invite him to lunch?” demanded Jordan crossly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002172": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002173": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Daisy invited him; she knew him before we were married—God knows where!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002174": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002175": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We were all irritable now with the fading ale, and aware of it we drove for a while in silence. Then as Doctor T. J. Eckleburg’s faded eyes came into sight down the road, I remembered Gatsby’s caution about gasoline.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002176": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002177": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ve got enough to get us to town,” said Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002178": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002179": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But there’s a garage right here,” objected Jordan. “I don’t want to get stalled in this baking heat.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002180": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002181": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom threw on both brakes impatiently, and we slid to an abrupt dusty stop under Wilson’s sign. After a moment the proprietor emerged from the interior of his establishment and gazed hollow-eyed at the car.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002182": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002183": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Let’s have some gas!” cried Tom roughly. “What do you think we stopped for—to admire the view?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002184": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002185": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m sick,” said Wilson without moving. “Been sick all day.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002186": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002187": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s the matter?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002188": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002189": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m all run down.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002190": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002191": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, shall I help myself?” Tom demanded. “You sounded well enough on the phone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002192": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002193": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>With an effort Wilson left the shade and support of the doorway and, breathing hard, unscrewed the cap of the tank. In the sunlight his face was green.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002194": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002195": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I didn’t mean to interrupt your lunch,” he said. “But I need money pretty bad, and I was wondering what you were going to do with your old car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002196": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002197": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How do you like this one?” inquired Tom. “I bought it last week.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002198": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002199": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s a nice yellow one,” said Wilson, as he strained at the handle.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002200": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002201": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Like to buy it?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002202": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002203": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Big chance,” Wilson smiled faintly. “No, but I could make some money on the other.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002204": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002205": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What do you want money for, all of a sudden?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002206": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002207": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve been here too long. I want to get away. My wife and I want to go West.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002208": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002209": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Your wife does,” exclaimed Tom, startled.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002210": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002211": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s been talking about it for ten years.” He rested for a moment against the pump, shading his eyes. “And now she’s going whether she wants to or not. I’m going to get her away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002212": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002213": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The coupé flashed by us with a flurry of dust and the flash of a waving hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002214": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002215": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What do I owe you?” demanded Tom harshly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002216": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002217": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I just got wised up to something funny the last two days,” remarked Wilson. “That’s why I want to get away. That’s why I been bothering you about the car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002218": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002219": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What do I owe you?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002220": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002221": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Dollar twenty.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002222": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002223": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The relentless beating heat was beginning to confuse me and I had a bad moment there before I realized that so far his suspicions hadn’t alighted on Tom. He had discovered that Myrtle had some sort of life apart from him in another world, and the shock had made him physically sick. I stared at him and then at Tom, who had made a parallel discovery less than an hour before—and it occurred to me that there was no difference between men, in intelligence or race, so profound as the difference between the sick and the well. Wilson was so sick that he looked guilty, unforgivably guilty—as if he had just got some poor girl with child.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002224": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002225": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll let you have that car,” said Tom. “I’ll send it over tomorrow afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002226": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002227": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That locality was always vaguely disquieting, even in the broad glare of afternoon, and now I turned my head as though I had been warned of something behind. Over the ash-heaps the giant eyes of Doctor T. J. Eckleburg kept their vigil, but I perceived, after a moment, that other eyes were regarding us with peculiar intensity from less than twenty feet away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002228": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002229": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>In one of the windows over the garage the curtains had been moved aside a little, and Myrtle Wilson was peering down at the car. So engrossed was she that she had no consciousness of being observed, and one emotion after another crept into her face like objects into a slowly developing picture. Her expression was curiously familiar—it was an expression I had often seen on women’s faces, but on Myrtle Wilson’s face it seemed purposeless and inexplicable until I realized that her eyes, wide with jealous terror, were fixed not on Tom, but on Jordan Baker, whom she took to be his wife.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002230": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002231": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There is no confusion like the confusion of a simple mind, and as we drove away Tom was feeling the hot whips of panic. His wife and his mistress, until an hour ago secure and inviolate, were slipping precipitately from his control. Instinct made him step on the accelerator with the double purpose of overtaking Daisy and leaving Wilson behind, and we sped along toward Astoria at fifty miles an hour, until, among the spidery girders of the elevated, we came in sight of the easygoing blue coupé.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002232": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002233": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Those big movies around Fiftieth Street are cool,” suggested Jordan. “I love New York on summer afternoons when everyone’s away. There’s something very sensuous about it—overripe, as if all sorts of funny fruits were going to fall into your hands.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002234": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002235": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The word “sensuous” had the effect of further disquieting Tom, but before he could invent a protest the coupé came to a stop, and Daisy signalled us to draw up alongside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002236": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002237": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Where are we going?” she cried.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002238": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002239": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How about the movies?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002240": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002241": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s so hot,” she complained. “You go. We’ll ride around and meet you after.” With an effort her wit rose faintly. “We’ll meet you on some corner. I’ll be the man smoking two cigarettes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002242": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002243": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We can’t argue about it here,” Tom said impatiently, as a truck gave out a cursing whistle behind us. “You follow me to the south side of Central Park, in front of the Plaza.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002244": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002245": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Several times he turned his head and looked back for their car, and if the traffic delayed them he slowed up until they came into sight. I think he was afraid they would dart down a side-street and out of his life forever.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002246": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002247": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But they didn’t. And we all took the less explicable step of engaging the parlour of a suite in the Plaza Hotel.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002248": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002249": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The prolonged and tumultuous argument that ended by herding us into that room eludes me, though I have a sharp physical memory that, in the course of it, my underwear kept climbing like a damp snake around my legs and intermittent beads of sweat raced cool across my back. The notion originated with Daisy’s suggestion that we hire five bathrooms and take cold baths, and then assumed more tangible form as “a place to have a mint julep.” Each of us said over and over that it was a “crazy idea”—we all talked at once to a baffled clerk and thought, or pretended to think, that we were being very funny…</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002250": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002251": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The room was large and stifling, and, though it was already four o’clock, opening the windows admitted only a gust of hot shrubbery from the Park. Daisy went to the mirror and stood with her back to us, fixing her hair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002252": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002253": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s a swell suite,” whispered Jordan respectfully, and everyone laughed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002254": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002255": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Open another window,” commanded Daisy, without turning around.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002256": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002257": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There aren’t any more.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002258": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002259": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, we’d better telephone for an axe—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002260": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002261": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The thing to do is to forget about the heat,” said Tom impatiently. “You make it ten times worse by crabbing about it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002262": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002263": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He unrolled the bottle of whisky from the towel and put it on the table.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002264": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002265": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Why not let her alone, old sport?” remarked Gatsby. “You’re the one that wanted to come to town.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002266": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002267": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was a moment of silence. The telephone book slipped from its nail and splashed to the floor, whereupon Jordan whispered, “Excuse me”—but this time no one laughed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002268": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002269": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll pick it up,” I offered.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002270": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002271": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got it.” Gatsby examined the parted string, muttered “Hum!” in an interested way, and tossed the book on a chair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002272": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002273": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s a great expression of yours, isn’t it?” said Tom sharply.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002274": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002275": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What is?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002276": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002277": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All this ‘old sport’ business. Where’d you pick that up?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002278": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002279": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Now see here, Tom,” said Daisy, turning around from the mirror, “if you’re going to make personal remarks I won’t stay here a minute. Call up and order some ice for the mint julep.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002280": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002281": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As Tom took up the receiver the compressed heat exploded into sound and we were listening to the portentous chords of Mendelssohn’s Wedding March from the ballroom below.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002282": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002283": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Imagine marrying anybody in this heat!” cried Jordan dismally.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002284": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002285": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Still—I was married in the middle of June,” Daisy remembered. “Louisville in June! Somebody fainted. Who was it fainted, Tom?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002286": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002287": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Biloxi,” he answered shortly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002288": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002289": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“A man named Biloxi. ‘Blocks’ Biloxi, and he made boxes—that’s a fact—and he was from Biloxi, Tennessee.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002290": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002291": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They carried him into my house,” appended Jordan, “because we lived just two doors from the church. And he stayed three weeks, until Daddy told him he had to get out. The day after he left Daddy died.” After a moment she added. “There wasn’t any connection.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002292": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002293": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I used to know a Bill Biloxi from Memphis,” I remarked.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002294": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002295": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That was his cousin. I knew his whole family history before he left. He gave me an aluminium putter that I use today.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002296": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002297": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The music had died down as the ceremony began and now a long cheer floated in at the window, followed by intermittent cries of “Yea—ea—ea!” and finally by a burst of jazz as the dancing began.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002298": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002299": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’re getting old,” said Daisy. “If we were young we’d rise and dance.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002300": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002301": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Remember Biloxi,” Jordan warned her. “Where’d you know him, Tom?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002302": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002303": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Biloxi?” He concentrated with an effort. “I didn’t know him. He was a friend of Daisy’s.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002304": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002305": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He was not,” she denied. “I’d never seen him before. He came down in the private car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002306": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002307": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, he said he knew you. He said he was raised in Louisville. Asa Bird brought him around at the last minute and asked if we had room for him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002308": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002309": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Jordan smiled.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002310": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002311": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He was probably bumming his way home. He told me he was president of your class at Yale.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002312": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002313": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom and I looked at each other blankly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002314": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002315": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Bil<i>oxi</i>?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002316": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002317": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“First place, we didn’t have any president—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002318": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002319": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby’s foot beat a short, restless tattoo and Tom eyed him suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002320": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002321": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“By the way, Mr. Gatsby, I understand you’re an Oxford man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002322": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002323": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Not exactly.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002324": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002325": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, yes, I understand you went to Oxford.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002326": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002327": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes—I went there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002328": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002329": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A pause. Then Tom’s voice, incredulous and insulting:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002330": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002331": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You must have gone there about the time Biloxi went to New Haven.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002332": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002333": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Another pause. A waiter knocked and came in with crushed mint and ice but the silence was unbroken by his “thank you” and the soft closing of the door. This tremendous detail was to be cleared up at last.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002334": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002335": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I told you I went there,” said Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002336": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002337": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I heard you, but I’d like to know when.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002338": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002339": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was in nineteen-nineteen, I only stayed five months. That’s why I can’t really call myself an Oxford man.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002340": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002341": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom glanced around to see if we mirrored his unbelief. But we were all looking at Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002342": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002343": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was an opportunity they gave to some of the officers after the armistice,” he continued. “We could go to any of the universities in England or France.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002344": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002345": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I wanted to get up and slap him on the back. I had one of those renewals of complete faith in him that I’d experienced before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002346": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002347": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy rose, smiling faintly, and went to the table.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002348": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002349": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Open the whisky, Tom,” she ordered, “and I’ll make you a mint julep. Then you won’t seem so stupid to yourself… Look at the mint!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002350": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002351": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wait a minute,” snapped Tom, “I want to ask Mr. Gatsby one more question.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002352": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002353": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Go on,” Gatsby said politely.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002354": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002355": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What kind of a row are you trying to cause in my house anyhow?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002356": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002357": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They were out in the open at last and Gatsby was content.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002358": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002359": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He isn’t causing a row,” Daisy looked desperately from one to the other. “You’re causing a row. Please have a little self-control.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002360": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002361": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Self-control!” repeated Tom incredulously. “I suppose the latest thing is to sit back and let Mr. Nobody from Nowhere make love to your wife. Well, if that’s the idea you can count me out… Nowadays people begin by sneering at family life and family institutions, and next they’ll throw everything overboard and have intermarriage between black and white.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002362": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002363": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Flushed with his impassioned gibberish, he saw himself standing alone on the last barrier of civilization.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002364": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002365": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’re all white here,” murmured Jordan.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002366": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002367": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I know I’m not very popular. I don’t give big parties. I suppose you’ve got to make your house into a pigsty in order to have any friends—in the modern world.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002368": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002369": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Angry as I was, as we all were, I was tempted to laugh whenever he opened his mouth. The transition from libertine to prig was so complete.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002370": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002371": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got something to tell <i>you</i>, old sport—” began Gatsby. But Daisy guessed at his intention.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002372": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002373": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Please don’t!” she interrupted helplessly. “Please let’s all go home. Why don’t we all go home?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002374": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002375": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s a good idea,” I got up. “Come on, Tom. Nobody wants a drink.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002376": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002377": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want to know what Mr. Gatsby has to tell me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002378": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002379": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Your wife doesn’t love you,” said Gatsby. “She’s never loved you. She loves me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002380": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002381": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You must be crazy!” exclaimed Tom automatically.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002382": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002383": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby sprang to his feet, vivid with excitement.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002384": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002385": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She never loved you, do you hear?” he cried. “She only married you because I was poor and she was tired of waiting for me. It was a terrible mistake, but in her heart she never loved anyone except me!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002386": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002387": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At this point Jordan and I tried to go, but Tom and Gatsby insisted with competitive firmness that we remain—as though neither of them had anything to conceal and it would be a privilege to partake vicariously of their emotions.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002388": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002389": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Sit down, Daisy,” Tom’s voice groped unsuccessfully for the paternal note. “What’s been going on? I want to hear all about it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002390": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002391": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I told you what’s been going on,” said Gatsby. “Going on for five years—and you didn’t know.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002392": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002393": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom turned to Daisy sharply.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002394": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002395": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’ve been seeing this fellow for five years?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002396": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002397": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Not seeing,” said Gatsby. “No, we couldn’t meet. But both of us loved each other all that time, old sport, and you didn’t know. I used to laugh sometimes”—but there was no laughter in his eyes—“to think that you didn’t know.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002398": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002399": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh—that’s all.” Tom tapped his thick fingers together like a clergyman and leaned back in his chair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002400": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002401": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re crazy!” he exploded. “I can’t speak about what happened five years ago, because I didn’t know Daisy then—and I’ll be damned if I see how you got within a mile of her unless you brought the groceries to the back door. But all the rest of that’s a God damned lie. Daisy loved me when she married me and she loves me now.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002402": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002403": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No,” said Gatsby, shaking his head.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002404": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002405": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She does, though. The trouble is that sometimes she gets foolish ideas in her head and doesn’t know what she’s doing.” He nodded sagely. “And what’s more, I love Daisy too. Once in a while I go off on a spree and make a fool of myself, but I always come back, and in my heart I love her all the time.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002406": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002407": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re revolting,” said Daisy. She turned to me, and her voice, dropping an octave lower, filled the room with thrilling scorn: “Do you know why we left Chicago? I’m surprised that they didn’t treat you to the story of that little spree.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002408": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002409": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby walked over and stood beside her.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002410": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002411": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Daisy, that’s all over now,” he said earnestly. “It doesn’t matter any more. Just tell him the truth—that you never loved him—and it’s all wiped out forever.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002412": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002413": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She looked at him blindly. “Why—how could I love him—possibly?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002414": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002415": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You never loved him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002416": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002417": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She hesitated. Her eyes fell on Jordan and me with a sort of appeal, as though she realized at last what she was doing—and as though she had never, all along, intended doing anything at all. But it was done now. It was too late.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002418": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002419": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I never loved him,” she said, with perceptible reluctance.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002420": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002421": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Not at Kapiolani?” demanded Tom suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002422": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002423": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002424": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002425": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>From the ballroom beneath, muffled and suffocating chords were drifting up on hot waves of air.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002426": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002427": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Not that day I carried you down from the Punch Bowl to keep your shoes dry?” There was a husky tenderness in his tone… “Daisy?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002428": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002429": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Please don’t.” Her voice was cold, but the rancour was gone from it. She looked at Gatsby. “There, Jay,” she said—but her hand as she tried to light a cigarette was trembling. Suddenly she threw the cigarette and the burning match on the carpet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002430": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002431": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, you want too much!” she cried to Gatsby. “I love you now—isn’t that enough? I can’t help what’s past.” She began to sob helplessly. “I did love him once—but I loved you too.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002432": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002433": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby’s eyes opened and closed.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002434": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002435": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You loved me <i>too</i>?” he repeated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002436": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002437": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Even that’s a lie,” said Tom savagely. “She didn’t know you were alive. Why—there’s things between Daisy and me that you’ll never know, things that neither of us can ever forget.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002438": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002439": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The words seemed to bite physically into Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002440": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002441": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want to speak to Daisy alone,” he insisted. “She’s all excited now—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002442": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002443": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Even alone I can’t say I never loved Tom,” she admitted in a pitiful voice. “It wouldn’t be true.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002444": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002445": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course it wouldn’t,” agreed Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002446": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002447": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She turned to her husband.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002448": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002449": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“As if it mattered to you,” she said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002450": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002451": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course it matters. I’m going to take better care of you from now on.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002452": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002453": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You don’t understand,” said Gatsby, with a touch of panic. “You’re not going to take care of her any more.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002454": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002455": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m not?” Tom opened his eyes wide and laughed. He could afford to control himself now. “Why’s that?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002456": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002457": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Daisy’s leaving you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002458": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002459": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nonsense.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002460": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002461": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I am, though,” she said with a visible effort.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002462": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002463": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s not leaving me!” Tom’s words suddenly leaned down over Gatsby. “Certainly not for a common swindler who’d have to steal the ring he put on her finger.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002464": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002465": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I won’t stand this!” cried Daisy. “Oh, please let’s get out.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002466": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002467": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who are you, anyhow?” broke out Tom. “You’re one of that bunch that hangs around with Meyer Wolfshiem—that much I happen to know. I’ve made a little investigation into your affairs—and I’ll carry it further tomorrow.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002468": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002469": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You can suit yourself about that, old sport,” said Gatsby steadily.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002470": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002471": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I found out what your ‘drugstores’ were.” He turned to us and spoke rapidly. “He and this Wolfshiem bought up a lot of side-street drugstores here and in Chicago and sold grain alcohol over the counter. That’s one of his little stunts. I picked him for a bootlegger the first time I saw him, and I wasn’t far wrong.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002472": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002473": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What about it?” said Gatsby politely. “I guess your friend Walter Chase wasn’t too proud to come in on it.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002474": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002475": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“And you left him in the lurch, didn’t you? You let him go to jail for a month over in New Jersey. God! You ought to hear Walter on the subject of <i>you</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002476": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002477": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He came to us dead broke. He was very glad to pick up some money, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002478": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002479": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t you call me ‘old sport’!” cried Tom. Gatsby said nothing. “Walter could have you up on the betting laws too, but Wolfshiem scared him into shutting his mouth.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002480": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002481": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That unfamiliar yet recognizable look was back again in Gatsby’s face.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002482": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002483": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That drugstore business was just small change,” continued Tom slowly, “but you’ve got something on now that Walter’s afraid to tell me about.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002484": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002485": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I glanced at Daisy, who was staring terrified between Gatsby and her husband, and at Jordan, who had begun to balance an invisible but absorbing object on the tip of her chin. Then I turned back to Gatsby—and was startled at his expression. He looked—and this is said in all contempt for the babbled slander of his garden—as if he had “killed a man.” For a moment the set of his face could be described in just that fantastic way.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002486": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002487": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It passed, and he began to talk excitedly to Daisy, denying everything, defending his name against accusations that had not been made. But with every word she was drawing further and further into herself, so he gave that up, and only the dead dream fought on as the afternoon slipped away, trying to touch what was no longer tangible, struggling unhappily, undespairingly, toward that lost voice across the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002488": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002489": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The voice begged again to go.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002490": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002491": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“<i>Please</i>, Tom! I can’t stand this any more.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002492": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002493": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Her frightened eyes told that whatever intentions, whatever courage she had had, were definitely gone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002494": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002495": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You two start on home, Daisy,” said Tom. “In Mr. Gatsby’s car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002496": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002497": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She looked at Tom, alarmed now, but he insisted with magnanimous scorn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002498": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002499": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Go on. He won’t annoy you. I think he realizes that his presumptuous little flirtation is over.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002500": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002501": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They were gone, without a word, snapped out, made accidental, isolated, like ghosts, even from our pity.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002502": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002503": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>After a moment Tom got up and began wrapping the unopened bottle of whisky in the towel.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002504": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002505": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Want any of this stuff? Jordan?… Nick?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002506": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002507": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I didn’t answer.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002508": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002509": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nick?” He asked again.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002510": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002511": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002512": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002513": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Want any?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002514": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002515": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No… I just remembered that today’s my birthday.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002516": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002517": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was thirty. Before me stretched the portentous, menacing road of a new decade.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002518": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002519": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was seven o’clock when we got into the coupé with him and started for Long Island. Tom talked incessantly, exulting and laughing, but his voice was as remote from Jordan and me as the foreign clamour on the sidewalk or the tumult of the elevated overhead. Human sympathy has its limits, and we were content to let all their tragic arguments fade with the city lights behind. Thirty—the promise of a decade of loneliness, a thinning list of single men to know, a thinning briefcase of enthusiasm, thinning hair. But there was Jordan beside me, who, unlike Daisy, was too wise ever to carry well-forgotten dreams from age to age. As we passed over the dark bridge her wan face fell lazily against my coat’s shoulder and the formidable stroke of thirty died away with the reassuring pressure of her hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002520": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002521": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>So we drove on toward death through the cooling twilight.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002522": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002523": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The young Greek, Michaelis, who ran the coffee joint beside the ash-heaps was the principal witness at the inquest. He had slept through the heat until after five, when he strolled over to the garage, and found George Wilson sick in his office—really sick, pale as his own pale hair and shaking all over. Michaelis advised him to go to bed, but Wilson refused, saying that he’d miss a lot of business if he did. While his neighbour was trying to persuade him a violent racket broke out overhead.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002524": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002525": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve got my wife locked in up there,” explained Wilson calmly. “She’s going to stay there till the day after tomorrow, and then we’re going to move away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002526": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002527": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Michaelis was astonished; they had been neighbours for four years, and Wilson had never seemed faintly capable of such a statement. Generally he was one of these worn-out men: when he wasn’t working, he sat on a chair in the doorway and stared at the people and the cars that passed along the road. When anyone spoke to him he invariably laughed in an agreeable, colourless way. He was his wife’s man and not his own.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002528": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002529": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>So naturally Michaelis tried to find out what had happened, but Wilson wouldn’t say a word—instead he began to throw curious, suspicious glances at his visitor and ask him what he’d been doing at certain times on certain days. Just as the latter was getting uneasy, some workmen came past the door bound for his restaurant, and Michaelis took the opportunity to get away, intending to come back later. But he didn’t. He supposed he forgot to, that’s all. When he came outside again, a little after seven, he was reminded of the conversation because he heard Mrs. Wilson’s voice, loud and scolding, downstairs in the garage.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002530": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002531": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Beat me!” he heard her cry. “Throw me down and beat me, you dirty little coward!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002532": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002533": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A moment later she rushed out into the dusk, waving her hands and shouting—before he could move from his door the business was over.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002534": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002535": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The “death car” as the newspapers called it, didn’t stop; it came out of the gathering darkness, wavered tragically for a moment, and then disappeared around the next bend. Mavro Michaelis wasn’t even sure of its colour—he told the first policeman that it was light green. The other car, the one going toward New York, came to rest a hundred yards beyond, and its driver hurried back to where Myrtle Wilson, her life violently extinguished, knelt in the road and mingled her thick dark blood with the dust.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002536": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002537": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Michaelis and this man reached her first, but when they had torn open her shirtwaist, still damp with perspiration, they saw that her left breast was swinging loose like a flap, and there was no need to listen for the heart beneath. The mouth was wide open and ripped a little at the corners, as though she had choked a little in giving up the tremendous vitality she had stored so long.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002538": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002539": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We saw the three or four automobiles and the crowd when we were still some distance away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002540": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002541": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wreck!” said Tom. “That’s good. Wilson’ll have a little business at last.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002542": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002543": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He slowed down, but still without any intention of stopping, until, as we came nearer, the hushed, intent faces of the people at the garage door made him automatically put on the brakes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002544": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002545": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ll take a look,” he said doubtfully, “just a look.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002546": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002547": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I became aware now of a hollow, wailing sound which issued incessantly from the garage, a sound which as we got out of the coupé and walked toward the door resolved itself into the words “Oh, my God!” uttered over and over in a gasping moan.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002548": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002549": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There’s some bad trouble here,” said Tom excitedly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002550": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002551": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He reached up on tiptoes and peered over a circle of heads into the garage, which was lit only by a yellow light in a swinging metal basket overhead. Then he made a harsh sound in his throat, and with a violent thrusting movement of his powerful arms pushed his way through.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002552": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002553": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The circle closed up again with a running murmur of expostulation; it was a minute before I could see anything at all. Then new arrivals deranged the line, and Jordan and I were pushed suddenly inside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002554": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002555": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Myrtle Wilson’s body, wrapped in a blanket, and then in another blanket, as though she suffered from a chill in the hot night, lay on a worktable by the wall, and Tom, with his back to us, was bending over it, motionless. Next to him stood a motorcycle policeman taking down names with much sweat and correction in a little book. At first I couldn’t find the source of the high, groaning words that echoed clamorously through the bare garage—then I saw Wilson standing on the raised threshold of his office, swaying back and forth and holding to the doorposts with both hands. Some man was talking to him in a low voice and attempting, from time to time, to lay a hand on his shoulder, but Wilson neither heard nor saw. His eyes would drop slowly from the swinging light to the laden table by the wall, and then jerk back to the light again, and he gave out incessantly his high, horrible call:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002556": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002557": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, my Ga-od! Oh, my Ga-od! Oh, Ga-od! Oh, my Ga-od!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002558": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002559": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Presently Tom lifted his head with a jerk and, after staring around the garage with glazed eyes, addressed a mumbled incoherent remark to the policeman.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002560": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002561": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“<i>M</i>-<i>a</i>-<i>v</i>—” the policeman was saying, “—<i>o</i>—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002562": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002563": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, <i>r</i>—” corrected the man, “<i>M</i>-<i>a</i>-<i>v</i>-<i>r</i>-<i>o</i>—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002564": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002565": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Listen to me!” muttered Tom fiercely.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002566": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002567": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“<i>r</i>—” said the policeman, “<i>o</i>—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002568": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002569": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“<i>g</i>—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002570": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002571": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“<i>g</i>—” He looked up as Tom’s broad hand fell sharply on his shoulder. “What you want, fella?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002572": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002573": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What happened?—that’s what I want to know.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002574": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002575": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Auto hit her. Ins’antly killed.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002576": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002577": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Instantly killed,” repeated Tom, staring.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002578": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002579": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She ran out ina road. Son-of-a-bitch didn’t even stopus car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002580": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002581": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There was two cars,” said Michaelis, “one comin’, one goin’, see?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002582": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002583": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Going where?” asked the policeman keenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002584": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002585": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“One goin’ each way. Well, she”—his hand rose toward the blankets but stopped halfway and fell to his side—“she ran out there an’ the one comin’ from N’York knock right into her, goin’ thirty or forty miles an hour.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002586": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002587": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s the name of this place here?” demanded the officer.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002588": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002589": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hasn’t got any name.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002590": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002591": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A pale well-dressed negro stepped near.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002592": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002593": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was a yellow car,” he said, “big yellow car. New.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002594": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002595": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“See the accident?” asked the policeman.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002596": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002597": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, but the car passed me down the road, going faster’n forty. Going fifty, sixty.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002598": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002599": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Come here and let’s have your name. Look out now. I want to get his name.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002600": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002601": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Some words of this conversation must have reached Wilson, swaying in the office door, for suddenly a new theme found voice among his grasping cries:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002602": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002603": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You don’t have to tell me what kind of car it was! I know what kind of car it was!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002604": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002605": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Watching Tom, I saw the wad of muscle back of his shoulder tighten under his coat. He walked quickly over to Wilson and, standing in front of him, seized him firmly by the upper arms.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002606": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002607": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’ve got to pull yourself together,” he said with soothing gruffness.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002608": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002609": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Wilson’s eyes fell upon Tom; he started up on his tiptoes and then would have collapsed to his knees had not Tom held him upright.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002610": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002611": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Listen,” said Tom, shaking him a little. “I just got here a minute ago, from New York. I was bringing you that coupé we’ve been talking about. That yellow car I was driving this afternoon wasn’t mine—do you hear? I haven’t seen it all afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002612": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002613": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Only the negro and I were near enough to hear what he said, but the policeman caught something in the tone and looked over with truculent eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002614": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002615": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What’s all that?” he demanded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002616": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002617": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m a friend of his.” Tom turned his head but kept his hands firm on Wilson’s body. “He says he knows the car that did it… It was a yellow car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002618": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002619": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Some dim impulse moved the policeman to look suspiciously at Tom.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002620": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002621": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“And what colour’s your car?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002622": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002623": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s a blue car, a coupé.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002624": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002625": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We’ve come straight from New York,” I said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002626": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002627": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Someone who had been driving a little behind us confirmed this, and the policeman turned away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002628": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002629": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Now, if you’ll let me have that name again correct—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002630": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002631": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Picking up Wilson like a doll, Tom carried him into the office, set him down in a chair, and came back.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002632": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002633": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“If somebody’ll come here and sit with him,” he snapped authoritatively. He watched while the two men standing closest glanced at each other and went unwillingly into the room. Then Tom shut the door on them and came down the single step, his eyes avoiding the table. As he passed close to me he whispered: “Let’s get out.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002634": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002635": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Self-consciously, with his authoritative arms breaking the way, we pushed through the still gathering crowd, passing a hurried doctor, case in hand, who had been sent for in wild hope half an hour ago.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002636": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002637": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Tom drove slowly until we were beyond the bend—then his foot came down hard, and the coupé raced along through the night. In a little while I heard a low husky sob, and saw that the tears were overflowing down his face.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002638": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002639": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The God damned coward!” he whimpered. “He didn’t even stop his car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002640": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002641": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The Buchanans’ house floated suddenly toward us through the dark rustling trees. Tom stopped beside the porch and looked up at the second floor, where two windows bloomed with light among the vines.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002642": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002643": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Daisy’s home,” he said. As we got out of the car he glanced at me and frowned slightly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002644": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002645": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I ought to have dropped you in West Egg, Nick. There’s nothing we can do tonight.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002646": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002647": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A change had come over him, and he spoke gravely, and with decision. As we walked across the moonlight gravel to the porch he disposed of the situation in a few brisk phrases.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002648": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002648",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002649": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002649",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll telephone for a taxi to take you home, and while you’re waiting you and Jordan better go in the kitchen and have them get you some supper—if you want any.” He opened the door. “Come in.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002650": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002650",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002651": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002651",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, thanks. But I’d be glad if you’d order me the taxi. I’ll wait outside.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002652": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002652",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002653": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002653",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Jordan put her hand on my arm.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002654": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002654",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002655": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002655",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Won’t you come in, Nick?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002656": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002656",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002657": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002657",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No, thanks.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002658": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002658",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002659": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002659",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was feeling a little sick and I wanted to be alone. But Jordan lingered for a moment more.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002660": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002660",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002661": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002661",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s only half-past nine,” she said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002662": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002662",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002663": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002663",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I’d be damned if I’d go in; I’d had enough of all of them for one day, and suddenly that included Jordan too. She must have seen something of this in my expression, for she turned abruptly away and ran up the porch steps into the house. I sat down for a few minutes with my head in my hands, until I heard the phone taken up inside and the butler’s voice calling a taxi. Then I walked slowly down the drive away from the house, intending to wait by the gate.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002664": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002664",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002665": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002665",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I hadn’t gone twenty yards when I heard my name and Gatsby stepped from between two bushes into the path. I must have felt pretty weird by that time, because I could think of nothing except the luminosity of his pink suit under the moon.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002666": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002666",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002667": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002667",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What are you doing?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002668": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002668",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002669": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002669",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Just standing here, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002670": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002670",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002671": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002671",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Somehow, that seemed a despicable occupation. For all I knew he was going to rob the house in a moment; I wouldn’t have been surprised to see sinister faces, the faces of “Wolfshiem’s people,” behind him in the dark shrubbery.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002672": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002672",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002673": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002673",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you see any trouble on the road?” he asked after a minute.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002674": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002674",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002675": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002675",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002676": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002676",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002677": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002677",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He hesitated.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002678": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002678",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002679": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002679",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Was she killed?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002680": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002680",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002681": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002681",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002682": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002682",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002683": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002683",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I thought so; I told Daisy I thought so. It’s better that the shock should all come at once. She stood it pretty well.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002684": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002684",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002685": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002685",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He spoke as if Daisy’s reaction was the only thing that mattered.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002686": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002686",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002687": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002687",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I got to West Egg by a side road,” he went on, “and left the car in my garage. I don’t think anybody saw us, but of course I can’t be sure.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002688": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002688",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002689": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002689",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I disliked him so much by this time that I didn’t find it necessary to tell him he was wrong.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002690": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002690",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002691": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002691",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who was the woman?” he inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002692": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002692",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002693": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002693",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Her name was Wilson. Her husband owns the garage. How the devil did it happen?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002694": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002694",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002695": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002695",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I tried to swing the wheel—” He broke off, and suddenly I guessed at the truth.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002696": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002696",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002697": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002697",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Was Daisy driving?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002698": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002698",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002699": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002699",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes,” he said after a moment, “but of course I’ll say I was. You see, when we left New York she was very nervous and she thought it would steady her to drive—and this woman rushed out at us just as we were passing a car coming the other way. It all happened in a minute, but it seemed to me that she wanted to speak to us, thought we were somebody she knew. Well, first Daisy turned away from the woman toward the other car, and then she lost her nerve and turned back. The second my hand reached the wheel I felt the shock—it must have killed her instantly.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002700": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002700",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002701": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002701",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It ripped her open—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002702": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002702",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002703": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002703",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t tell me, old sport.” He winced. “Anyhow—Daisy stepped on it. I tried to make her stop, but she couldn’t, so I pulled on the emergency brake. Then she fell over into my lap and I drove on.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002704": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002704",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002705": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002705",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’ll be all right tomorrow,” he said presently. “I’m just going to wait here and see if he tries to bother her about that unpleasantness this afternoon. She’s locked herself into her room, and if he tries any brutality she’s going to turn the light out and on again.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002706": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002706",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002707": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002707",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He won’t touch her,” I said. “He’s not thinking about her.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002708": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002708",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002709": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002709",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t trust him, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002710": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002710",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002711": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002711",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How long are you going to wait?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002712": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002712",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002713": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002713",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“All night, if necessary. Anyhow, till they all go to bed.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002714": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002714",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002715": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002715",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>A new point of view occurred to me. Suppose Tom found out that Daisy had been driving. He might think he saw a connection in it—he might think anything. I looked at the house; there were two or three bright windows downstairs and the pink glow from Daisy’s room on the ground floor.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002716": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002716",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002717": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002717",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You wait here,” I said. “I’ll see if there’s any sign of a commotion.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002718": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002718",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002719": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002719",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I walked back along the border of the lawn, traversed the gravel softly, and tiptoed up the veranda steps. The drawing-room curtains were open, and I saw that the room was empty. Crossing the porch where we had dined that June night three months before, I came to a small rectangle of light which I guessed was the pantry window. The blind was drawn, but I found a rift at the sill.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002720": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002720",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002721": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002721",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Daisy and Tom were sitting opposite each other at the kitchen table, with a plate of cold fried chicken between them, and two bottles of ale. He was talking intently across the table at her, and in his earnestness his hand had fallen upon and covered her own. Once in a while she looked up at him and nodded in agreement.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002722": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002722",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002723": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002723",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They weren’t happy, and neither of them had touched the chicken or the ale—and yet they weren’t unhappy either. There was an unmistakable air of natural intimacy about the picture, and anybody would have said that they were conspiring together.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002724": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002724",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002725": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002725",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>As I tiptoed from the porch I heard my taxi feeling its way along the dark road toward the house. Gatsby was waiting where I had left him in the drive.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002726": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002726",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002727": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002727",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Is it all quiet up there?” he asked anxiously.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002728": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002728",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002729": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002729",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes, it’s all quiet.” I hesitated. “You’d better come home and get some sleep.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002730": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002730",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002731": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002731",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He shook his head.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002732": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002732",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002733": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002733",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want to wait here till Daisy goes to bed. Good night, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002734": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002734",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002735": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002735",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He put his hands in his coat pockets and turned back eagerly to his scrutiny of the house, as though my presence marred the sacredness of the vigil. So I walked away and left him standing there in the moonlight—watching over nothing.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002736": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002736",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002737": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002737",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002738": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002738",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>VIII</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002739": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002739",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002740": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002740",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I couldn’t sleep all night; a foghorn was groaning incessantly on the Sound, and I tossed half-sick between grotesque reality and savage, frightening dreams. Toward dawn I heard a taxi go up Gatsby’s drive, and immediately I jumped out of bed and began to dress—I felt that I had something to tell him, something to warn him about, and morning would be too late.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002741": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002741",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002742": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002742",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Crossing his lawn, I saw that his front door was still open and he was leaning against a table in the hall, heavy with dejection or sleep.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002743": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002743",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002744": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002744",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nothing happened,” he said wanly. “I waited, and about four o’clock she came to the window and stood there for a minute and then turned out the light.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002745": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002745",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002746": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002746",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His house had never seemed so enormous to me as it did that night when we hunted through the great rooms for cigarettes. We pushed aside curtains that were like pavilions, and felt over innumerable feet of dark wall for electric light switches—once I tumbled with a sort of splash upon the keys of a ghostly piano. There was an inexplicable amount of dust everywhere, and the rooms were musty, as though they hadn’t been aired for many days. I found the humidor on an unfamiliar table, with two stale, dry cigarettes inside. Throwing open the French windows of the drawing-room, we sat smoking out into the darkness.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002747": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002747",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002748": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002748",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You ought to go away,” I said. “It’s pretty certain they’ll trace your car.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002749": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002749",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002750": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002750",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Go away <i>now</i>, old sport?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002751": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002751",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002752": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002752",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Go to Atlantic City for a week, or up to Montreal.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002753": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002753",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002754": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002754",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He wouldn’t consider it. He couldn’t possibly leave Daisy until he knew what she was going to do. He was clutching at some last hope and I couldn’t bear to shake him free.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002755": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002755",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002756": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002756",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was this night that he told me the strange story of his youth with Dan Cody—told it to me because “Jay Gatsby” had broken up like glass against Tom’s hard malice, and the long secret extravaganza was played out. I think that he would have acknowledged anything now, without reserve, but he wanted to talk about Daisy.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002757": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002757",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002758": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002758",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She was the first “nice” girl he had ever known. In various unrevealed capacities he had come in contact with such people, but always with indiscernible barbed wire between. He found her excitingly desirable. He went to her house, at first with other officers from Camp Taylor, then alone. It amazed him—he had never been in such a beautiful house before. But what gave it an air of breathless intensity, was that Daisy lived there—it was as casual a thing to her as his tent out at camp was to him. There was a ripe mystery about it, a hint of bedrooms upstairs more beautiful and cool than other bedrooms, of gay and radiant activities taking place through its corridors, and of romances that were not musty and laid away already in lavender but fresh and breathing and redolent of this year’s shining motorcars and of dances whose flowers were scarcely withered. It excited him, too, that many men had already loved Daisy—it increased her value in his eyes. He felt their presence all about the house, pervading the air with the shades and echoes of still vibrant emotions.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002759": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002759",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002760": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002760",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But he knew that he was in Daisy’s house by a colossal accident. However glorious might be his future as Jay Gatsby, he was at present a penniless young man without a past, and at any moment the invisible cloak of his uniform might slip from his shoulders. So he made the most of his time. He took what he could get, ravenously and unscrupulously—eventually he took Daisy one still October night, took her because he had no real right to touch her hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002761": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002761",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002762": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002762",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He might have despised himself, for he had certainly taken her under false pretences. I don’t mean that he had traded on his phantom millions, but he had deliberately given Daisy a sense of security; he let her believe that he was a person from much the same strata as herself—that he was fully able to take care of her. As a matter of fact, he had no such facilities—he had no comfortable family standing behind him, and he was liable at the whim of an impersonal government to be blown anywhere about the world.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002763": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002763",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002764": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002764",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But he didn’t despise himself and it didn’t turn out as he had imagined. He had intended, probably, to take what he could and go—but now he found that he had committed himself to the following of a grail. He knew that Daisy was extraordinary, but he didn’t realize just how extraordinary a “nice” girl could be. She vanished into her rich house, into her rich, full life, leaving Gatsby—nothing. He felt married to her, that was all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002765": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002765",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002766": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002766",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When they met again, two days later, it was Gatsby who was breathless, who was, somehow, betrayed. Her porch was bright with the bought luxury of star-shine; the wicker of the settee squeaked fashionably as she turned toward him and he kissed her curious and lovely mouth. She had caught a cold, and it made her voice huskier and more charming than ever, and Gatsby was overwhelmingly aware of the youth and mystery that wealth imprisons and preserves, of the freshness of many clothes, and of Daisy, gleaming like silver, safe and proud above the hot struggles of the poor.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002767": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002767",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002768": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002768",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I can’t describe to you how surprised I was to find out I loved her, old sport. I even hoped for a while that she’d throw me over, but she didn’t, because she was in love with me too. She thought I knew a lot because I knew different things from her… Well, there I was, way off my ambitions, getting deeper in love every minute, and all of a sudden I didn’t care. What was the use of doing great things if I could have a better time telling her what I was going to do?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002769": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002769",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002770": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002770",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>On the last afternoon before he went abroad, he sat with Daisy in his arms for a long, silent time. It was a cold fall day, with fire in the room and her cheeks flushed. Now and then she moved and he changed his arm a little, and once he kissed her dark shining hair. The afternoon had made them tranquil for a while, as if to give them a deep memory for the long parting the next day promised. They had never been closer in their month of love, nor communicated more profoundly one with another, than when she brushed silent lips against his coat’s shoulder or when he touched the end of her fingers, gently, as though she were asleep.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002771": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002771",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002772": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002772",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He did extraordinarily well in the war. He was a captain before he went to the front, and following the Argonne battles he got his majority and the command of the divisional machine-guns. After the armistice he tried frantically to get home, but some complication or misunderstanding sent him to Oxford instead. He was worried now—there was a quality of nervous despair in Daisy’s letters. She didn’t see why he couldn’t come. She was feeling the pressure of the world outside, and she wanted to see him and feel his presence beside her and be reassured that she was doing the right thing after all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002773": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002773",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002774": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002774",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For Daisy was young and her artificial world was redolent of orchids and pleasant, cheerful snobbery and orchestras which set the rhythm of the year, summing up the sadness and suggestiveness of life in new tunes. All night the saxophones wailed the hopeless comment of the “Beale Street Blues” while a hundred pairs of golden and silver slippers shuffled the shining dust. At the grey tea hour there were always rooms that throbbed incessantly with this low, sweet fever, while fresh faces drifted here and there like rose petals blown by the sad horns around the floor.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002775": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002775",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002776": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002776",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Through this twilight universe Daisy began to move again with the season; suddenly she was again keeping half a dozen dates a day with half a dozen men, and drowsing asleep at dawn with the beads and chiffon of an evening-dress tangled among dying orchids on the floor beside her bed. And all the time something within her was crying for a decision. She wanted her life shaped now, immediately—and the decision must be made by some force—of love, of money, of unquestionable practicality—that was close at hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002777": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002777",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002778": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002778",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That force took shape in the middle of spring with the arrival of Tom Buchanan. There was a wholesome bulkiness about his person and his position, and Daisy was flattered. Doubtless there was a certain struggle and a certain relief. The letter reached Gatsby while he was still at Oxford.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002779": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002779",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002780": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002780",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was dawn now on Long Island and we went about opening the rest of the windows downstairs, filling the house with grey-turning, gold-turning light. The shadow of a tree fell abruptly across the dew and ghostly birds began to sing among the blue leaves. There was a slow, pleasant movement in the air, scarcely a wind, promising a cool, lovely day.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002781": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002781",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002782": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002782",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t think she ever loved him.” Gatsby turned around from a window and looked at me challengingly. “You must remember, old sport, she was very excited this afternoon. He told her those things in a way that frightened her—that made it look as if I was some kind of cheap sharper. And the result was she hardly knew what she was saying.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002783": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002783",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002784": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002784",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He sat down gloomily.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002785": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002785",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002786": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002786",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course she might have loved him just for a minute, when they were first married—and loved me more even then, do you see?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002787": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002787",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002788": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002788",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Suddenly he came out with a curious remark.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002789": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002789",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002790": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002790",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“In any case,” he said, “it was just personal.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002791": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002791",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002792": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002792",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>What could you make of that, except to suspect some intensity in his conception of the affair that couldn’t be measured?</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002793": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002793",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002794": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002794",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He came back from France when Tom and Daisy were still on their wedding trip, and made a miserable but irresistible journey to Louisville on the last of his army pay. He stayed there a week, walking the streets where their footsteps had clicked together through the November night and revisiting the out-of-the-way places to which they had driven in her white car. Just as Daisy’s house had always seemed to him more mysterious and gay than other houses, so his idea of the city itself, even though she was gone from it, was pervaded with a melancholy beauty.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002795": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002795",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002796": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002796",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He left feeling that if he had searched harder, he might have found her—that he was leaving her behind. The day-coach—he was penniless now—was hot. He went out to the open vestibule and sat down on a folding-chair, and the station slid away and the backs of unfamiliar buildings moved by. Then out into the spring fields, where a yellow trolley raced them for a minute with people in it who might once have seen the pale magic of her face along the casual street.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002797": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002797",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002798": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002798",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The track curved and now it was going away from the sun, which, as it sank lower, seemed to spread itself in benediction over the vanishing city where she had drawn her breath. He stretched out his hand desperately as if to snatch only a wisp of air, to save a fragment of the spot that she had made lovely for him. But it was all going by too fast now for his blurred eyes and he knew that he had lost that part of it, the freshest and the best, forever.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002799": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002799",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002800": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002800",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was nine o’clock when we finished breakfast and went out on the porch. The night had made a sharp difference in the weather and there was an autumn flavour in the air. The gardener, the last one of Gatsby’s former servants, came to the foot of the steps.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002801": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002801",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002802": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002802",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’m going to drain the pool today, Mr. Gatsby. Leaves’ll start falling pretty soon, and then there’s always trouble with the pipes.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002803": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002803",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002804": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002804",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t do it today,” Gatsby answered. He turned to me apologetically. “You know, old sport, I’ve never used that pool all summer?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002805": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002805",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002806": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002806",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I looked at my watch and stood up.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002807": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002807",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002808": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002808",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Twelve minutes to my train.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002809": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002809",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002810": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002810",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I didn’t want to go to the city. I wasn’t worth a decent stroke of work, but it was more than that—I didn’t want to leave Gatsby. I missed that train, and then another, before I could get myself away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002811": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002811",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002812": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002812",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll call you up,” I said finally.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002813": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002813",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002814": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002814",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Do, old sport.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002815": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002815",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002816": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002816",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ll call you about noon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002817": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002817",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002818": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002818",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We walked slowly down the steps.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002819": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002819",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002820": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002820",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I suppose Daisy’ll call too.” He looked at me anxiously, as if he hoped I’d corroborate this.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002821": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002821",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002822": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002822",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I suppose so.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002823": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002823",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002824": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002824",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, goodbye.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002825": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002825",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002826": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002826",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We shook hands and I started away. Just before I reached the hedge I remembered something and turned around.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002827": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002827",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002828": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002828",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“They’re a rotten crowd,” I shouted across the lawn. “You’re worth the whole damn bunch put together.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002829": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002829",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002830": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002830",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I’ve always been glad I said that. It was the only compliment I ever gave him, because I disapproved of him from beginning to end. First he nodded politely, and then his face broke into that radiant and understanding smile, as if we’d been in ecstatic cahoots on that fact all the time. His gorgeous pink rag of a suit made a bright spot of colour against the white steps, and I thought of the night when I first came to his ancestral home, three months before. The lawn and drive had been crowded with the faces of those who guessed at his corruption—and he had stood on those steps, concealing his incorruptible dream, as he waved them goodbye.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002831": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002831",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002832": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002832",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I thanked him for his hospitality. We were always thanking him for that—I and the others.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002833": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002833",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002834": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002834",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Goodbye,” I called. “I enjoyed breakfast, Gatsby.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002835": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002835",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002836": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002836",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Up in the city, I tried for a while to list the quotations on an interminable amount of stock, then I fell asleep in my swivel-chair. Just before noon the phone woke me, and I started up with sweat breaking out on my forehead. It was Jordan Baker; she often called me up at this hour because the uncertainty of her own movements between hotels and clubs and private houses made her hard to find in any other way. Usually her voice came over the wire as something fresh and cool, as if a divot from a green golf-links had come sailing in at the office window, but this morning it seemed harsh and dry.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002837": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002837",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002838": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002838",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve left Daisy’s house,” she said. “I’m at Hempstead, and I’m going down to Southampton this afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002839": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002839",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002840": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002840",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Probably it had been tactful to leave Daisy’s house, but the act annoyed me, and her next remark made me rigid.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002841": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002841",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002842": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002842",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You weren’t so nice to me last night.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002843": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002843",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002844": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002844",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How could it have mattered then?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002845": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002845",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002846": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002846",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Silence for a moment. Then:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002847": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002847",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002848": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002848",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“However—I want to see you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002849": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002849",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002850": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002850",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I want to see you, too.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002851": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002851",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002852": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002852",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Suppose I don’t go to Southampton, and come into town this afternoon?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002853": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002853",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002854": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002854",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No—I don’t think this afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002855": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002855",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002856": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002856",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Very well.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002857": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002857",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002858": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002858",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s impossible this afternoon. Various—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002859": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002859",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002860": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002860",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>We talked like that for a while, and then abruptly we weren’t talking any longer. I don’t know which of us hung up with a sharp click, but I know I didn’t care. I couldn’t have talked to her across a tea-table that day if I never talked to her again in this world.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002861": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002861",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002862": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002862",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I called Gatsby’s house a few minutes later, but the line was busy. I tried four times; finally an exasperated central told me the wire was being kept open for long distance from Detroit. Taking out my timetable, I drew a small circle around the three-fifty train. Then I leaned back in my chair and tried to think. It was just noon.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002863": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002863",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002864": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002864",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When I passed the ash-heaps on the train that morning I had crossed deliberately to the other side of the car. I supposed there’d be a curious crowd around there all day with little boys searching for dark spots in the dust, and some garrulous man telling over and over what had happened, until it became less and less real even to him and he could tell it no longer, and Myrtle Wilson’s tragic achievement was forgotten. Now I want to go back a little and tell what happened at the garage after we left there the night before.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002865": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002865",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002866": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002866",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>They had difficulty in locating the sister, Catherine. She must have broken her rule against drinking that night, for when she arrived she was stupid with liquor and unable to understand that the ambulance had already gone to Flushing. When they convinced her of this, she immediately fainted, as if that was the intolerable part of the affair. Someone, kind or curious, took her in his car and drove her in the wake of her sister’s body.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002867": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002867",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002868": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002868",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Until long after midnight a changing crowd lapped up against the front of the garage, while George Wilson rocked himself back and forth on the couch inside. For a while the door of the office was open, and everyone who came into the garage glanced irresistibly through it. Finally someone said it was a shame, and closed the door. Michaelis and several other men were with him; first, four or five men, later two or three men. Still later Michaelis had to ask the last stranger to wait there fifteen minutes longer, while he went back to his own place and made a pot of coffee. After that, he stayed there alone with Wilson until dawn.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002869": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002869",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002870": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002870",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>About three o’clock the quality of Wilson’s incoherent muttering changed—he grew quieter and began to talk about the yellow car. He announced that he had a way of finding out whom the yellow car belonged to, and then he blurted out that a couple of months ago his wife had come from the city with her face bruised and her nose swollen.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002871": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002871",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002872": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002872",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But when he heard himself say this, he flinched and began to cry “Oh, my God!” again in his groaning voice. Michaelis made a clumsy attempt to distract him.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002873": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002873",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002874": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002874",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How long have you been married, George? Come on there, try and sit still a minute, and answer my question. How long have you been married?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002875": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002875",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002876": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002876",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Twelve years.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002877": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002877",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002878": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002878",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Ever had any children? Come on, George, sit still—I asked you a question. Did you ever have any children?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002879": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002879",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002880": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002880",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The hard brown beetles kept thudding against the dull light, and whenever Michaelis heard a car go tearing along the road outside it sounded to him like the car that hadn’t stopped a few hours before. He didn’t like to go into the garage, because the work bench was stained where the body had been lying, so he moved uncomfortably around the office—he knew every object in it before morning—and from time to time sat down beside Wilson trying to keep him more quiet.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002881": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002881",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002882": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002882",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Have you got a church you go to sometimes, George? Maybe even if you haven’t been there for a long time? Maybe I could call up the church and get a priest to come over and he could talk to you, see?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002883": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002883",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002884": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002884",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Don’t belong to any.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002885": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002885",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002886": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002886",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You ought to have a church, George, for times like this. You must have gone to church once. Didn’t you get married in a church? Listen, George, listen to me. Didn’t you get married in a church?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002887": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002887",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002888": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002888",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That was a long time ago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002889": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002889",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002890": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002890",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The effort of answering broke the rhythm of his rocking—for a moment he was silent. Then the same half-knowing, half-bewildered look came back into his faded eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002891": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002891",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002892": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002892",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look in the drawer there,” he said, pointing at the desk.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002893": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002893",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002894": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002894",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Which drawer?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002895": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002895",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002896": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002896",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That drawer—that one.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002897": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002897",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002898": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002898",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Michaelis opened the drawer nearest his hand. There was nothing in it but a small, expensive dog-leash, made of leather and braided silver. It was apparently new.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002899": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002899",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002900": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002900",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This?” he inquired, holding it up.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002901": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002901",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002902": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002902",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Wilson stared and nodded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002903": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002903",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002904": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002904",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I found it yesterday afternoon. She tried to tell me about it, but I knew it was something funny.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002905": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002905",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002906": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002906",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You mean your wife bought it?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002907": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002907",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002908": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002908",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She had it wrapped in tissue paper on her bureau.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002909": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002909",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002910": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002910",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Michaelis didn’t see anything odd in that, and he gave Wilson a dozen reasons why his wife might have bought the dog-leash. But conceivably Wilson had heard some of these same explanations before, from Myrtle, because he began saying “Oh, my God!” again in a whisper—his comforter left several explanations in the air.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002911": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002911",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002912": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002912",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Then he killed her,” said Wilson. His mouth dropped open suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002913": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002913",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002914": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002914",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Who did?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002915": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002915",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002916": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002916",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I have a way of finding out.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002917": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002917",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002918": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002918",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You’re morbid, George,” said his friend. “This has been a strain to you and you don’t know what you’re saying. You’d better try and sit quiet till morning.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002919": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002919",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002920": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002920",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He murdered her.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002921": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002921",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002922": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002922",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was an accident, George.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002923": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002923",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002924": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002924",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Wilson shook his head. His eyes narrowed and his mouth widened slightly with the ghost of a superior “Hm!”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002925": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002925",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002926": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002926",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I know,” he said definitely. “I’m one of these trusting fellas and I don’t think any harm to <i>no</i>body, but when I get to know a thing I know it. It was the man in that car. She ran out to speak to him and he wouldn’t stop.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002927": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002927",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002928": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002928",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Michaelis had seen this too, but it hadn’t occurred to him that there was any special significance in it. He believed that Mrs. Wilson had been running away from her husband, rather than trying to stop any particular car.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002929": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002929",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002930": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002930",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“How could she of been like that?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002931": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002931",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002932": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002932",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“She’s a deep one,” said Wilson, as if that answered the question. “Ah-h-h—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002933": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002933",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002934": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002934",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He began to rock again, and Michaelis stood twisting the leash in his hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002935": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002935",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002936": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002936",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Maybe you got some friend that I could telephone for, George?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002937": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002937",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002938": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002938",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>This was a forlorn hope—he was almost sure that Wilson had no friend: there was not enough of him for his wife. He was glad a little later when he noticed a change in the room, a blue quickening by the window, and realized that dawn wasn’t far off. About five o’clock it was blue enough outside to snap off the light.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002939": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002939",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002940": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002940",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Wilson’s glazed eyes turned out to the ash-heaps, where small grey clouds took on fantastic shapes and scurried here and there in the faint dawn wind.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002941": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002941",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002942": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002942",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I spoke to her,” he muttered, after a long silence. “I told her she might fool me but she couldn’t fool God. I took her to the window”—with an effort he got up and walked to the rear window and leaned with his face pressed against it—“and I said ‘God knows what you’ve been doing, everything you’ve been doing. You may fool me, but you can’t fool God!’ ”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002943": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002943",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002944": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002944",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Standing behind him, Michaelis saw with a shock that he was looking at the eyes of Doctor T. J. Eckleburg, which had just emerged, pale and enormous, from the dissolving night.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002945": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002945",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002946": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002946",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“God sees everything,” repeated Wilson.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002947": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002947",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002948": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002948",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s an advertisement,” Michaelis assured him. Something made him turn away from the window and look back into the room. But Wilson stood there a long time, his face close to the window pane, nodding into the twilight.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002949": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002949",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002950": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002950",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>By six o’clock Michaelis was worn out, and grateful for the sound of a car stopping outside. It was one of the watchers of the night before who had promised to come back, so he cooked breakfast for three, which he and the other man ate together. Wilson was quieter now, and Michaelis went home to sleep; when he awoke four hours later and hurried back to the garage, Wilson was gone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002951": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002951",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002952": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002952",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His movements—he was on foot all the time—were afterward traced to Port Roosevelt and then to Gad’s Hill, where he bought a sandwich that he didn’t eat, and a cup of coffee. He must have been tired and walking slowly, for he didn’t reach Gad’s Hill until noon. Thus far there was no difficulty in accounting for his time—there were boys who had seen a man “acting sort of crazy,” and motorists at whom he stared oddly from the side of the road. Then for three hours he disappeared from view. The police, on the strength of what he said to Michaelis, that he “had a way of finding out,” supposed that he spent that time going from garage to garage thereabout, inquiring for a yellow car. On the other hand, no garage man who had seen him ever came forward, and perhaps he had an easier, surer way of finding out what he wanted to know. By half-past two he was in West Egg, where he asked someone the way to Gatsby’s house. So by that time he knew Gatsby’s name.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002953": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002953",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002954": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002954",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At two o’clock Gatsby put on his bathing-suit and left word with the butler that if anyone phoned word was to be brought to him at the pool. He stopped at the garage for a pneumatic mattress that had amused his guests during the summer, and the chauffeur helped him to pump it up. Then he gave instructions that the open car wasn’t to be taken out under any circumstances—and this was strange, because the front right fender needed repair.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002955": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002955",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002956": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002956",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Gatsby shouldered the mattress and started for the pool. Once he stopped and shifted it a little, and the chauffeur asked him if he needed help, but he shook his head and in a moment disappeared among the yellowing trees.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002957": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002957",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002958": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002958",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>No telephone message arrived, but the butler went without his sleep and waited for it until four o’clock—until long after there was anyone to give it to if it came. I have an idea that Gatsby himself didn’t believe it would come, and perhaps he no longer cared. If that was true he must have felt that he had lost the old warm world, paid a high price for living too long with a single dream. He must have looked up at an unfamiliar sky through frightening leaves and shivered as he found what a grotesque thing a rose is and how raw the sunlight was upon the scarcely created grass. A new world, material without being real, where poor ghosts, breathing dreams like air, drifted fortuitously about… like that ashen, fantastic figure gliding toward him through the amorphous trees.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002959": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002959",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002960": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002960",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The chauffeur—he was one of Wolfshiem’s protégés—heard the shots—afterwards he could only say that he hadn’t thought anything much about them. I drove from the station directly to Gatsby’s house and my rushing anxiously up the front steps was the first thing that alarmed anyone. But they knew then, I firmly believe. With scarcely a word said, four of us, the chauffeur, butler, gardener, and I hurried down to the pool.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002961": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002961",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002962": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002962",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was a faint, barely perceptible movement of the water as the fresh flow from one end urged its way toward the drain at the other. With little ripples that were hardly the shadows of waves, the laden mattress moved irregularly down the pool. A small gust of wind that scarcely corrugated the surface was enough to disturb its accidental course with its accidental burden. The touch of a cluster of leaves revolved it slowly, tracing, like the leg of transit, a thin red circle in the water.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002963": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002963",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002964": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002964",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was after we started with Gatsby toward the house that the gardener saw Wilson’s body a little way off in the grass, and the holocaust was complete.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002965": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002965",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002966": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002966",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002967": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002967",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><h2>IX</h2></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002968": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002968",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002969": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002969",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>After two years I remember the rest of that day, and that night and the next day, only as an endless drill of police and photographers and newspaper men in and out of Gatsby’s front door. A rope stretched across the main gate and a policeman by it kept out the curious, but little boys soon discovered that they could enter through my yard, and there were always a few of them clustered open-mouthed about the pool. Someone with a positive manner, perhaps a detective, used the expression “madman” as he bent over Wilson’s body that afternoon, and the adventitious authority of his voice set the key for the newspaper reports next morning.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002970": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002970",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002971": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002971",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Most of those reports were a nightmare—grotesque, circumstantial, eager, and untrue. When Michaelis’s testimony at the inquest brought to light Wilson’s suspicions of his wife I thought the whole tale would shortly be served up in racy pasquinade—but Catherine, who might have said anything, didn’t say a word. She showed a surprising amount of character about it too—looked at the coroner with determined eyes under that corrected brow of hers, and swore that her sister had never seen Gatsby, that her sister was completely happy with her husband, that her sister had been into no mischief whatever. She convinced herself of it, and cried into her handkerchief, as if the very suggestion was more than she could endure. So Wilson was reduced to a man “deranged by grief” in order that the case might remain in its simplest form. And it rested there.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002972": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002972",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002973": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002973",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>But all this part of it seemed remote and unessential. I found myself on Gatsby’s side, and alone. From the moment I telephoned news of the catastrophe to West Egg village, every surmise about him, and every practical question, was referred to me. At first I was surprised and confused; then, as he lay in his house and didn’t move or breathe or speak, hour upon hour, it grew upon me that I was responsible, because no one else was interested—interested, I mean, with that intense personal interest to which everyone has some vague right at the end.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002974": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002974",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002975": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002975",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I called up Daisy half an hour after we found him, called her instinctively and without hesitation. But she and Tom had gone away early that afternoon, and taken baggage with them.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002976": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002976",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002977": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002977",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Left no address?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002978": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002978",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002979": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002979",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002980": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002980",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002981": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002981",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Say when they’d be back?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002982": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002982",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002983": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002983",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“No.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002984": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002984",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002985": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002985",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Any idea where they are? How I could reach them?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002986": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002986",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002987": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002987",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t know. Can’t say.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002988": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002988",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002989": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002989",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I wanted to get somebody for him. I wanted to go into the room where he lay and reassure him: “I’ll get somebody for you, Gatsby. Don’t worry. Just trust me and I’ll get somebody for you—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002990": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002990",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002991": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002991",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Meyer Wolfshiem’s name wasn’t in the phone book. The butler gave me his office address on Broadway, and I called Information, but by the time I had the number it was long after five, and no one answered the phone.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002992": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002992",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002993": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002993",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Will you ring again?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002994": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002994",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002995": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002995",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’ve rung three times.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002996": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002996",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002997": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002997",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It’s very important.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002998": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002998",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000002999": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000002999",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Sorry. I’m afraid no one’s there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003000": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003000",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003001": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003001",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I went back to the drawing-room and thought for an instant that they were chance visitors, all these official people who suddenly filled it. But, though they drew back the sheet and looked at Gatsby with shocked eyes, his protest continued in my brain:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003002": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003002",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003003": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003003",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look here, old sport, you’ve got to get somebody for me. You’ve got to try hard. I can’t go through this alone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003004": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003004",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003005": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003005",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Someone started to ask me questions, but I broke away and going upstairs looked hastily through the unlocked parts of his desk—he’d never told me definitely that his parents were dead. But there was nothing—only the picture of Dan Cody, a token of forgotten violence, staring down from the wall.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003006": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003006",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003007": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>Next morning I sent the butler to New York with a letter to Wolfshiem, which asked for information and urged him to come out on the next train. That request seemed superfluous when I wrote it. I was sure he’d start when he saw the newspapers, just as I was sure there’d be a wire from Daisy before noon—but neither a wire nor Mr. Wolfshiem arrived; no one arrived except more police and photographers and newspaper men. When the butler brought back Wolfshiem’s answer I began to have a feeling of defiance, of scornful solidarity between Gatsby and me against them all.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003008": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003008",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003009": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003010": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div><p>Dear Mr. Carraway. This has been one of the most terrible shocks of my life to me I hardly can believe it that it is true at all. Such a mad act as that man did should make us all think. I cannot come down now as I am tied up in some very important business and cannot get mixed up in this thing now. If there is anything I can do a little later let me know in a letter by Edgar. I hardly know where I am when I hear about a thing like this and am completely knocked down and out.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003011": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003012": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div><p class=\"valediction\">Yours truly</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003013": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003014": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div><p class=\"signature\">Meyer Wolfshiem</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003015": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003016": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003017": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p class=\"continued\">and then hasty addenda beneath:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003018": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003019": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003020": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div><p>Let me know about the funeral etc do not know his family at all.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003021": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003022": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003023": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When the phone rang that afternoon and Long Distance said Chicago was calling I thought this would be Daisy at last. But the connection came through as a man’s voice, very thin and far away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003024": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003025": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This is Slagle speaking…”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003026": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003027": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Yes?” The name was unfamiliar.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003028": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003029": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hell of a note, isn’t it? Get my wire?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003030": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003031": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There haven’t been any wires.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003032": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003033": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Young Parke’s in trouble,” he said rapidly. “They picked him up when he handed the bonds over the counter. They got a circular from New York giving ’em the numbers just five minutes before. What d’you know about that, hey? You never can tell in these hick towns—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003034": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003035": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Hello!” I interrupted breathlessly. “Look here—this isn’t Mr. Gatsby. Mr. Gatsby’s dead.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003036": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003037": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>There was a long silence on the other end of the wire, followed by an exclamation… then a quick squawk as the connection was broken.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003038": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003039": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I think it was on the third day that a telegram signed Henry C. Gatz arrived from a town in Minnesota. It said only that the sender was leaving immediately and to postpone the funeral until he came.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003040": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003041": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was Gatsby’s father, a solemn old man, very helpless and dismayed, bundled up in a long cheap ulster against the warm September day. His eyes leaked continuously with excitement, and when I took the bag and umbrella from his hands he began to pull so incessantly at his sparse grey beard that I had difficulty in getting off his coat. He was on the point of collapse, so I took him into the music-room and made him sit down while I sent for something to eat. But he wouldn’t eat, and the glass of milk spilled from his trembling hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003042": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003043": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I saw it in the Chicago newspaper,” he said. “It was all in the Chicago newspaper. I started right away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003044": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003045": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I didn’t know how to reach you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003046": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003047": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His eyes, seeing nothing, moved ceaselessly about the room.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003048": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003049": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“It was a madman,” he said. “He must have been mad.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003050": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003051": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wouldn’t you like some coffee?” I urged him.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003052": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003053": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I don’t want anything. I’m all right now, Mr.—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003054": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003055": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Carraway.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003056": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003057": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I’m all right now. Where have they got Jimmy?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003058": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003059": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I took him into the drawing-room, where his son lay, and left him there. Some little boys had come up on the steps and were looking into the hall; when I told them who had arrived, they went reluctantly away.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003060": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003061": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>After a little while Mr. Gatz opened the door and came out, his mouth ajar, his face flushed slightly, his eyes leaking isolated and unpunctual tears. He had reached an age where death no longer has the quality of ghastly surprise, and when he looked around him now for the first time and saw the height and splendour of the hall and the great rooms opening out from it into other rooms, his grief began to be mixed with an awed pride. I helped him to a bedroom upstairs; while he took off his coat and vest I told him that all arrangements had been deferred until he came.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003062": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003063": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I didn’t know what you’d want, Mr. Gatsby—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003064": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003065": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Gatz is my name.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003066": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003067": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“—Mr. Gatz. I thought you might want to take the body West.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003068": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003069": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He shook his head.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003070": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003071": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Jimmy always liked it better down East. He rose up to his position in the East. Were you a friend of my boy’s, Mr.—?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003072": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003073": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“We were close friends.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003074": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003075": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He had a big future before him, you know. He was only a young man, but he had a lot of brain power here.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003076": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003077": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He touched his head impressively, and I nodded.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003078": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003079": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“If he’d of lived, he’d of been a great man. A man like James J. Hill. He’d of helped build up the country.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003080": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003081": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“That’s true,” I said, uncomfortably.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003082": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003083": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He fumbled at the embroidered coverlet, trying to take it from the bed, and lay down stiffly—was instantly asleep.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003084": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003085": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>That night an obviously frightened person called up, and demanded to know who I was before he would give his name.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003086": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003087": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“This is Mr. Carraway,” I said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003088": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003089": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh!” He sounded relieved. “This is Klipspringer.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003090": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003091": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I was relieved too, for that seemed to promise another friend at Gatsby’s grave. I didn’t want it to be in the papers and draw a sightseeing crowd, so I’d been calling up a few people myself. They were hard to find.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003092": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003093": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“The funeral’s tomorrow,” I said. “Three o’clock, here at the house. I wish you’d tell anybody who’d be interested.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003094": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003095": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh, I will,” he broke out hastily. “Of course I’m not likely to see anybody, but if I do.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003096": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003097": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>His tone made me suspicious.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003098": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003099": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Of course you’ll be there yourself.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003100": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003101": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, I’ll certainly try. What I called up about is—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003102": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003103": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Wait a minute,” I interrupted. “How about saying you’ll come?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003104": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003105": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, the fact is—the truth of the matter is that I’m staying with some people up here in Greenwich, and they rather expect me to be with them tomorrow. In fact, there’s a sort of picnic or something. Of course I’ll do my best to get away.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003106": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003107": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I ejaculated an unrestrained “Huh!” and he must have heard me, for he went on nervously:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003108": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003109": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“What I called up about was a pair of shoes I left there. I wonder if it’d be too much trouble to have the butler send them on. You see, they’re tennis shoes, and I’m sort of helpless without them. My address is care of B. F.—”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003110": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003111": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I didn’t hear the rest of the name, because I hung up the receiver.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003112": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003113": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>After that I felt a certain shame for Gatsby—one gentleman to whom I telephoned implied that he had got what he deserved. However, that was my fault, for he was one of those who used to sneer most bitterly at Gatsby on the courage of Gatsby’s liquor, and I should have known better than to call him.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003114": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003115": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The morning of the funeral I went up to New York to see Meyer Wolfshiem; I couldn’t seem to reach him any other way. The door that I pushed open, on the advice of an elevator boy, was marked “The Swastika Holding Company,” and at first there didn’t seem to be anyone inside. But when I’d shouted “hello” several times in vain, an argument broke out behind a partition, and presently a lovely Jewess appeared at an interior door and scrutinized me with black hostile eyes.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003116": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003117": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Nobody’s in,” she said. “Mr. Wolfshiem’s gone to Chicago.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003118": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003119": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The first part of this was obviously untrue, for someone had begun to whistle “The Rosary,” tunelessly, inside.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003120": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003121": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Please say that Mr. Carraway wants to see him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003122": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003123": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I can’t get him back from Chicago, can I?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003124": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003125": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>At this moment a voice, unmistakably Wolfshiem’s, called “Stella!” from the other side of the door.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003126": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003127": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Leave your name on the desk,” she said quickly. “I’ll give it to him when he gets back.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003128": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003129": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“But I know he’s there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003130": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003131": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She took a step toward me and began to slide her hands indignantly up and down her hips.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003132": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003133": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“You young men think you can force your way in here any time,” she scolded. “We’re getting sickantired of it. When I say he’s in Chicago, he’s in Chi<i>ca</i>go.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003134": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003135": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I mentioned Gatsby.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003136": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003137": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh-h!” She looked at me over again. “Will you just—What was your name?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003138": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003139": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>She vanished. In a moment Meyer Wolfshiem stood solemnly in the doorway, holding out both hands. He drew me into his office, remarking in a reverent voice that it was a sad time for all of us, and offered me a cigar.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003140": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003141": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“My memory goes back to when first I met him,” he said. “A young major just out of the army and covered over with medals he got in the war. He was so hard up he had to keep on wearing his uniform because he couldn’t buy some regular clothes. First time I saw him was when he came into Winebrenner’s poolroom at Forty-third Street and asked for a job. He hadn’t eat anything for a couple of days. ‘Come on have some lunch with me,’ I said. He ate more than four dollars’ worth of food in half an hour.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003142": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003143": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Did you start him in business?” I inquired.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003144": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003145": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Start him! I made him.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003146": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003147": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Oh.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003148": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003149": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I raised him up out of nothing, right out of the gutter. I saw right away he was a fine-appearing, gentlemanly young man, and when he told me he was at Oggsford I knew I could use him good. I got him to join the American Legion and he used to stand high there. Right off he did some work for a client of mine up to Albany. We were so thick like that in everything”—he held up two bulbous fingers—“always together.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003150": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003151": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I wondered if this partnership had included the World’s Series transaction in 1919.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003152": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003153": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Now he’s dead,” I said after a moment. “You were his closest friend, so I know you’ll want to come to his funeral this afternoon.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003154": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003155": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I’d like to come.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003156": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003157": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Well, come then.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003158": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003159": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>The hair in his nostrils quivered slightly, and as he shook his head his eyes filled with tears.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003160": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003161": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“I can’t do it—I can’t get mixed up in it,” he said.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003162": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003163": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“There’s nothing to get mixed up in. It’s all over now.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003164": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003165": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“When a man gets killed I never like to get mixed up in it in any way. I keep out. When I was a young man it was different—if a friend of mine died, no matter how, I stuck with them to the end. You may think that’s sentimental, but I mean it—to the bitter end.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003166": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003167": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>I saw that for some reason of his own he was determined not to come, so I stood up.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003168": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003169": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Are you a college man?” he inquired suddenly.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003170": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003171": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>For a moment I thought he was going to suggest a “gonnegtion,” but he only nodded and shook my hand.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003172": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003173": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Let us learn to show our friendship for a man when he is alive and not after he is dead,” he suggested. “After that my own rule is to let everything alone.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003174": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003175": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>When I left his office the sky had turned dark and I got back to West Egg in a drizzle. After changing my clothes I went next door and found Mr. Gatz walking up and down excitedly in the hall. His pride in his son and in his son’s possessions was continually increasing and now he had something to show me.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003176": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003177": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Jimmy sent me this picture.” He took out his wallet with trembling fingers. “Look there.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003178": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003179": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>It was a photograph of the house, cracked in the corners and dirty with many hands. He pointed out every detail to me eagerly. “Look there!” and then sought admiration from my eyes. He had shown it so often that I think it was more real to him now than the house itself.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003180": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003181": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Jimmy sent it to me. I think it’s a very pretty picture. It shows up well.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003182": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003183": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Very well. Had you seen him lately?”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003184": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003185": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“He come out to see me two years ago and bought me the house I live in now. Of course we was broke up when he run off from home, but I see now there was a reason for it. He knew he had a big future in front of him. And ever since he made a success he was very generous with me.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003186": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003187": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He seemed reluctant to put away the picture, held it for another minute, lingeringly, before my eyes. Then he returned the wallet and pulled from his pocket a ragged old copy of a book called <i>Hopalong Cassidy</i>.</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003188": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003189": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>“Look here, this is a book he had when he was a boy. It just shows you.”</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003190": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003191": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><p>He opened it at the back cover and turned it around for me to see. On the last flyleaf was printed the word <b>schedule</b>, and the date September 12, 1906. And underneath:</p></div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003192": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/6a0861776c2a2321/text/000003193": {
            "role": "text",
            "title": "$:/plugins/twpub/6a0861776c2a2321/text/000003193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-6a0861776c2a2321-8bd1cf twpub-6a0861776c2a2321-678e8e twpub-6a0861776c2a2321-6b4cd0\"><div><table>\n<tbody>\n<tr>\n<td>Rise from bed</td>\n<td>6:00</td>\n<td class=\"right\">a.m.</td>\n</tr>\n<tr>\n<td>Dumbell exercise and wall-scaling</td>\n<td>6:15⁠–⁠6:30</td>\n<td class=\"right\">“</td>\n</tr>\n<tr>\n<td>Study electricity, etc.</td>\n<td>7:15⁠–⁠8:15</td>\n<td class=\"right\">“</td>\n</tr>\n<tr>\n<td>Work</td>\n<td>8:30⁠–⁠4:30</td>\n<td class=\"right\">p.m.</td>\n</tr>\n<tr>\n<td>Baseball and sports</td>\n<td>4:30⁠–⁠5:00</td>\n<td class=\"right\">“</td>\n</tr>\n<tr>\n<td>Practise elocution, poise and how to attain it</td>\n<td>5:00⁠–⁠6:00</td>\n<td class=\"right\">“</td>\n</tr>\n<tr>\n<td>Study needed inventions</td>\n<td>7:00⁠–⁠9:00</td>\n<td class=\"right\">“</td>\n</tr>\n</tbody>\n</table></div></div>"
        },
